INSERT INTO `competition` VALUES (1,'Garlando Liga',12,'<div><p>Die altbekannte Bar-foos-league wie sie vor über zehn Jahren gegründet wurde.<br><br><strong>Tischtyp: </strong><br>Garlando Deluxe<br><br><strong>Mögliche Spielorte:</strong><br></p><ul><li>Coyote Bar</li><li>Billiardino</li><li>Fambar</li><li>TFCZ</li><li>Sansibar</li><li>Acapulco</li><li>Poli Bar</li><li>La Catrina</li></ul></div>',NULL,NULL),(2,'Ullrich Liga',12,'<div><p>Mit dem Ullrich Tisch hat neben dem Garlando ein neuer Tisch-Typ in der Zürcher Töggeli-Szene einzug gehalten. Natürlich organisieren wir auch für unsere Ullrich-Spieler eine Liga.<br> <br><strong>Tischtyp: </strong><br>Ullrich<br><br><strong>Mögliche Spielorte:</strong><br></p><ul><li>Coyote Bar</li><li>Billiardino</li><li>TFCZ</li></ul></div>',NULL,NULL),(3,'Garlando Liga',13,'<div><p>Die altbekannte Bar-foos-league wie sie vor über zehn Jahren gegründet wurde.<br><br><strong>Tischtyp: </strong><br>Garlando Deluxe<br><br><strong>Mögliche Spielorte:</strong><br></p><ul><li>Coyote Bar</li><li>Billiardino</li><li>Fambar</li><li>TFCZ</li><li>Sansibar</li><li>Poli Bar</li><li>La Catrina</li></ul></div>',NULL,NULL),(4,'Ullrich Liga',13,'<div><p>Mit dem Ullrich Tisch hat neben dem Garlando ein neuer Tisch-Typ in der Zürcher Töggeli-Szene einzug gehalten. Natürlich organisieren wir auch für unsere Ullrich-Spieler eine Liga.<br> <br><strong>Tischtyp: </strong><br>Ullrich<br><br><strong>Mögliche Spielorte:</strong><br></p><ul><li>Coyote Bar</li><li>TFCZ</li></ul></div>',NULL,NULL),(5,'Garlando Liga',14,'<div><p>Die altbekannte Bar-foos-league wie sie vor über zehn Jahren gegründet wurde.<br><br><strong>Tischtyp: </strong><br>Garlando Deluxe<br><br><strong>Mögliche Spielorte:</strong><br></p><ul><li>Coyote Bar</li><li>Billiardino</li><li>Fambar</li><li>TFCZ</li><li>Sansibar</li><li>St. Joseph\'s Pub</li><li>Poli Bar</li><li>La Catrina</li><li>Liquid</li></ul></div>','<p>Modus</p>','<p>Regeln</p>'),(6,'Ullrich Liga',14,'<div><p>Mit dem Ullrich Tisch hat neben dem Garlando ein neuer Tisch-Typ in der Zürcher Töggeli-Szene einzug gehalten. Natürlich organisieren wir auch für unsere Ullrich-Spieler eine Liga.<br> <br><strong>Tischtyp: </strong><br>Ullrich<br><br><strong>Mögliche Spielorte:</strong><br></p><ul><li>Coyote Bar</li><li>TFCZ</li></ul></div>',NULL,NULL),(9,'Garlando Liga',9,'',NULL,NULL),(10,'Ullrich Liga',9,'',NULL,NULL),(11,'Garlando Liga',10,'',NULL,NULL),(12,'Garlando Liga',11,'',NULL,NULL),(13,'Ullrich Liga',11,'',NULL,NULL),(14,'Garlando Liga',1,'',NULL,NULL),(17,'Fordere SG Garlando',22,'','<p style=\"font-size: 13px;vertical-align: baseline;\"><b style=\"font-size: inherit;vertical-align: baseline;\">Jeder gegen Jeden</b><br/>Sämtliche Teams in einer Liga (resp. in der entsprechenden Gruppe) spielen gegen jedes andere Team genau ein Mal! Sollten wir uns entscheiden, kleinere Ligen zu bilden, spielt ihr gegen jeden Gegner zweimal, weil dann Hin- und Rückspiele ausgetragen werden. Wir werden vor Saisonbeginn über die Details informieren. </p><p style=\"font-size: 13px;vertical-align: baseline;\"><b style=\"font-size: inherit;vertical-align: baseline;\">Vier Sätze + Entscheidungssatz</b><br/>Bei jeder Begegnung werden mindestens vier Sätze gespielt. Sollte nach diesen noch kein Sieger feststehen (2:2) so wird ein Entscheidungssatz gespielt. Der Entscheidungssatz geht nur auf 3 Tore! Somit sind folgende Ergebnisse möglich: 4:0, 3:1, 3:2, 2:3, 1:3, 0:4</p><p style=\"font-size: 13px;vertical-align: baseline;\"><b style=\"font-size: inherit;vertical-align: baseline;\">Punkteverteilung</b><br/>Für einen Vier zu Null- oder Drei zu Eins - Sieg nach Sätzen erhält die gewinnende Mannschaft drei Punkte. Für einen Drei zu Zwei Sieg nach Sätzen erhält die gewinnende Mannschaft zwei Punkte, die verlierende Mannschaft einen Punkt.<br/></p><p style=\"font-size: 13px;vertical-align: baseline;\"><b style=\"font-size: inherit;vertical-align: baseline;\">Sechs Tore zum Satzgewinn</b><br/>Ein Satz ist bei beendet sobald ein Team sechs Tore erreicht hat. Es wird nicht auf zwei Tore Abstand gespielt (Auch nicht im Entscheidungssatz!).</p><p style=\"font-size: 13px;vertical-align: baseline;\"><b style=\"font-size: inherit;vertical-align: baseline;\">Halbzeit = Spielhalbzeit </b><br/>Zur Saisonhalbzeit müssen mindestens die Hälfte der zu absolvierenden Spiele durchgeführt worden sein. Sollte diese Bedingung nicht erfüllt sein, kann ein Team durch das Modusteam disqualifiziert werden!</p><p style=\"font-size: 13px;vertical-align: baseline;\"><b style=\"font-size: inherit;vertical-align: baseline;\">Tabelle </b><br/>Die Tabelle wir wie folgt berechnet:</p><ol style=\"font-size: 14px;\"><li>Anzahl Punkte</li><li>Satzverhältnis</li><li>Direktbegegnung</li></ol>','<ul style=\"font-size: 14px;\"><li><b style=\"font-size: inherit;vertical-align: baseline;\">Die oberste und wichtigste Regel bei einem Tischfussball-Match: Habt Spass und spielt Fairplay! :-)</b></li><li>Die Mannschaft, die Heimspiel hat, hat Anstoss und bezahlt die erste Partie, anschliessend wird abwechselnd bezahlt. Anspiel in den folgenden Sätze hat jeweils der Verlierer des vorangehenden Satzes.</li><li>Der Anstoss erfolgt bei der mittleren Figur der Fünferreihe unter Beachtung der “Bereitschaft”. Bereitschaft bedeutet: Der Ball muss ruhen. Dann fragt der Spieler in Ballbesitz “guet?“, der Gegner bestätigt mit “guet”. Daraufhin beginnt das Spiel. Vor dem ersten Durchspiel auf eine andere Reihe muss zuerst noch eine zweite Figur auf derselben Stange den Ball berühren.</li><li>Erfolgt beim Anstoss die Schussabgabe ohne vorgängige Ballberührung durch den Gegner, zählt das Tor nicht und der Anstoss wird wiederholt. Sobald eine gegnerische Figur den Ball berührt hat, sind Schüsse mit der Fünferreihe erlaubt.</li><li>Nicht gezählt werden Tore beim Anspiel, bei denen der Ball nach der ersten Schussabgabe durch die Fünferreihe durch eine oder mehrere eigene oder gegnerischen Figuren unkontrolliert ins Tor abgelenkt wird.</li><li>Standpässe mit der Fünferreihe sind verboten, dies heisst, der Ball muss vor einem Pass in Bewegung sein.</li><li>Die Figur bzw. die Stange dürfen sich vor und nach der Ballberührung maximal um 360 Grad drehen.</li><li>Bälle, die ins Tor gehen und dann wieder zurück auf die Spielfläche springen, zählen als Tor.</li><li>Springt der Ball aus dem Spielfeld verliert das Team, das zuletzt die Ballkontrolle hatte den Ball. Angespielt wird unter Beachtung der Bereitschaft auf der gegnerischen Zweierreihe. Mit der Berührung der zweiten Figur der Zweierreihe ist das Spiel frei. Die zweite Figur darf passen oder schiessen.</li><li>Ein Ball wird für tot erklärt, wenn er bewegungslos liegt und von keiner Figur erreicht werden kann. </li><li>Ein Ball, der für tot erklärt wird und der zwischen den beiden Fünferreihen liegt, wird unter Beachtung der Bereitschaft mir der Fünferreihe der Mannschaft, die ursprünglich Anstossrecht hatte wieder ins Spiel gebracht. Es gelten die gleichen Regeln wie beim Anstoss.</li><li>Ein Ball, der für tot erklärt wird und zwischen einem Tor und einer Fünferreihe liegt, wird durch die Zweierreihe auf derjenigen Spielhälfte, in der sich der tote Ball befindet, unter Beachtung der Bereitschaft, wieder ins Spiel gebracht. Es gelten die gleichen Regeln wie bei der Spielaufnahme nachdem der Ball das Spielfeld verlassen hat.</li><li>Zu starkes Anschlagen gegen die Bande ist strikt verboten! Bei starkem Anschlagen verliert der Ball seine natürliche Richtung. Ausserdem kann dadurch der Tisch stark beschädigt werden! Verliert ein Spieler den Ball weil der Gegner zu stark angeschlagen hat (und den Ball dabei nicht berührt hat), kann er ein foul reklamieren. Danach bekommt der gefoulte Spieler den Ball auf die Stange, auf der er den Ball zuletzt unter Kontrolle hatte, zurück. Die Spielaufnahme erfolgt unter Beachtung der Bereitschaft und einer Berührung einer zweiten Figur auf derselben Stange.</li><li>Zeitlimit: Maximal 10 Sekunden auf der Fünferreihe und 15 Sekunden auf den anderen Reihen, wobei die Torwart- und Abwehrstange als eine Stange betrachtet werden. </li><li>Positionswechsel: Nach einem Tor, nach einem Satz und während eines Time Outs dürfen beide Mannschaften die Positionen wechseln.</li><li>Seitenwechsel: Die Mannschaften dürfen am Ende eines Satzes die Seiten wechseln und haben dafür bis zu 90 Sekunden Zeit. </li><li>Time Out: Jedes Team darf pro Satz zwei Time Outs nehmen. Ein Time Out dauert maximal 45 Sekunden. Ist der Ball im Spiel, darf nur der Spieler, der im Ballbesitz ist, ein Time Out nehmen. Ist das Spiel unterbrochen, dürfen beide Teams ein Time Out nehmen.</li></ul>'),(19,'Garlando Liga',23,'<p style=\"font-size: 13px;vertical-align: baseline;\">Die altbekannte Bar-foos-league wie sie vor über zehn Jahren gegründet wurde.<br/><br/><strong style=\"font-size: inherit;vertical-align: baseline;\">Tischtyp: </strong><br/>Garlando Deluxe<br/><br/><strong style=\"font-size: inherit;vertical-align: baseline;\">Mögliche Spielorte:</strong><br/></p><ul style=\"font-size: 14px;\"><li>Coyote Bar</li><li>Billiardino</li><li>Fambar</li><li>TFCZ</li><li>Sansibar</li><li>St. Joseph\'s Pub</li><li>Poli Bar</li><li>UG Dart Club Zürich</li></ul><p><br/></p>','<p><b>Jeder gegen Jeden</b><br/>Sämtliche Teams in einer Liga (resp. in der entsprechenden Gruppe) spielen gegen jedes andere Team genau ein Mal!</p><p><b>Vier Sätze + Entscheidungssatz</b><br/>Bei jeder Begegnung werden mindestens vier Sätze gespielt. Sollte nach diesen noch kein Sieger feststehen (2:2) so wird ein Entscheidungssatz gespielt. <br/>Der Entscheidungssatz geht nur auf 3 Tore! Somit sind folgende Ergebnisse möglich: 4:0, 3:1, 3:2, 2:3, 1:3, 0:4</p><p><b>Punkteverteilung</b><br/>Für einen Vier zu Null- oder Drei zu Eins - Sieg nach Sätzen erhält die gewinnende Mannschaft drei Punkte. Für einen Drei zu Zwei Sieg nach Sätzen erhält die gewinnende Mannschaft zwei Punkte, die verlierende Mannschaft      einen Punkt.<br/></p><p><b>Sechs Tore zum Satzgewinn</b><br/>Ein Satz ist bei beendet sobald ein Team sechs Tore erreicht hat. Es wird nicht auf zwei Tore Abstand gespielt (Auch nicht im Entscheidungssatz!).</p><p><b>Halbzeit = Spielhalbzeit </b><br/>Zur Saisonhalbzeit müssen mindestens die Hälfte der zu absolvierenden Spiele durchgeführt worden sein. Sollte diese Bedingung nicht erfüllt sein, kann ein Team durch das Modusteam disqualifiziert werden!</p><p><b>Tabelle </b><br/>Die Tabelle wir wie folgt berechnet:</p><ol><li>Anzahl Punkte</li><li>Satzverhältnis</li><li>Direktbegegnung</li></ol><p><br/></p>','<ul><li><b>Die oberste und wichtigste Regel bei einem Tischfussball-Match: Habt Spass und spielt Fairplay! :-)</b></li><li>Die Mannschaft, die Heimspiel hat, hat Anstoss und bezahlt die erste Partie, anschliessend wird abwechselnd bezahlt. Anspiel in den folgenden Sätze hat jeweils der Verlierer des vorangehenden Satzes.</li><li>Der Anstoss erfolgt bei der mittleren Figur der Fünferreihe unter Beachtung der “Bereitschaft”. Bereitschaft bedeutet: Der Ball muss ruhen. Dann fragt der Spieler in Ballbesitz “guet?“, der Gegner bestätigt mit “guet”. Daraufhin beginnt das Spiel. Vor dem ersten Durchspiel auf eine andere Reihe muss zuerst noch eine zweite Figur auf derselben Stange den Ball berühren.</li><li>Erfolgt beim Anstoss die Schussabgabe ohne vorgängige Ballberührung durch den Gegner, zählt das Tor nicht und der Anstoss wird wiederholt. Sobald eine gegnerische Figur den Ball berührt hat, sind Schüsse mit der Fünferreihe erlaubt.</li><li>Nicht gezählt werden Tore beim Anspiel, bei denen der Ball nach der ersten Schussabgabe durch die Fünferreihe durch eine oder mehrere eigene oder gegnerischen Figuren unkontrolliert ins Tor abgelenkt wird.</li><li>Standpässe mit der Fünferreihe sind verboten, dies heisst, der Ball muss vor einem Pass in Bewegung sein.</li><li>Die Figur bzw. die Stange dürfen sich vor und nach der Ballberührung maximal um 360 Grad drehen.</li><li>Bälle, die ins Tor gehen und dann wieder zurück auf die Spielfläche springen, zählen als Tor.</li><li>Springt der Ball aus dem Spielfeld verliert das Team, das zuletzt die Ballkontrolle hatte den Ball. Angespielt wird unter Beachtung der Bereitschaft auf der gegnerischen Zweierreihe. Mit der Berührung der zweiten Figur der Zweierreihe ist das Spiel frei. Die zweite Figur darf passen oder schiessen.</li><li>Ein Ball wird für tot erklärt, wenn er bewegungslos liegt und von keiner Figur erreicht werden kann. </li><li>Ein Ball, der für tot erklärt wird und der zwischen den beiden Fünferreihen liegt, wird unter Beachtung der Bereitschaft mir der Fünferreihe der Mannschaft, die ursprünglich Anstossrecht hatte wieder ins Spiel gebracht. Es gelten die gleichen Regeln wie beim Anstoss.</li><li>Ein Ball, der für tot erklärt wird und zwischen einem Tor und einer Fünferreihe liegt, wird durch die Zweierreihe auf derjenigen Spielhälfte, in der sich der tote Ball befindet, unter Beachtung der Bereitschaft, wieder ins Spiel gebracht. Es gelten die gleichen Regeln wie bei der Spielaufnahme nachdem der Ball das Spielfeld verlassen hat.</li><li>Zu starkes Anschlagen gegen die Bande ist strikt verboten! Bei starkem Anschlagen verliert der Ball seine natürliche Richtung. Ausserdem kann dadurch der Tisch stark beschädigt werden! Verliert ein Spieler den Ball weil der Gegner zu stark angeschlagen hat (und den Ball dabei nicht berührt hat), kann er ein foul reklamieren. Danach bekommt der gefoulte Spieler den Ball auf die Stange, auf der er den Ball zuletzt unter Kontrolle hatte, zurück. Die Spielaufnahme erfolgt unter Beachtung der Bereitschaft und einer Berührung einer zweiten Figur auf derselben Stange.</li><li>Zeitlimit: Maximal 10 Sekunden auf der Fünferreihe und 15 Sekunden auf den anderen Reihen, wobei die Torwart- und Abwehrstange als eine Stange betrachtet werden. </li><li>Positionswechsel: Nach einem Tor, nach einem Satz und während eines Time Outs dürfen beide Mannschaften die Positionen wechseln.</li><li>Seitenwechsel: Die Mannschaften dürfen am Ende eines Satzes die Seiten wechseln und haben dafür bis zu 90 Sekunden Zeit. </li><li>Time Out: Jedes Team darf pro Satz zwei Time Outs nehmen. Ein Time Out dauert maximal 45 Sekunden. Ist der Ball im Spiel, darf nur der Spieler, der im Ballbesitz ist, ein Time Out nehmen. Ist das Spiel unterbrochen, dürfen beide Teams ein Time Out nehmen.</li></ul>'),(20,'Ullrich Liga',23,'<p style=\"font-size: 13px;vertical-align: baseline;\">Mit dem Ullrich Tisch hat neben dem Garlando ein neuer Tisch-Typ in der Zürcher Töggeli-Szene einzug gehalten. Natürlich organisieren wir auch für unsere Ullrich-Spieler eine Liga.<br/><br/><strong style=\"font-size: inherit;vertical-align: baseline;\">Tischtyp: </strong><br/>Ullrich<br/><br/><strong style=\"font-size: inherit;vertical-align: baseline;\">Mögliche Spielorte:</strong><br/></p><ul style=\"font-size: 14px;\"><li>Coyote Bar</li><li>TFCZ</li><li>UG Dart Club Zürich</li></ul>','<p style=\"font-size: 13px;vertical-align: baseline;\"><b style=\"font-size: inherit;vertical-align: baseline;\">Jeder gegen Jeden</b><br/>Sämtliche Teams in einer Liga (resp. in der entsprechenden Gruppe) spielen gegen jedes andere Team genau ein Mal!</p><p style=\"font-size: 13px;vertical-align: baseline;\"><b style=\"font-size: inherit;vertical-align: baseline;\">Vier Sätze + Entscheidungssatz</b><br/>Bei jeder Begegnung werden mindestens vier Sätze gespielt. Sollte nach diesen noch kein Sieger feststehen (2:2) so wird ein Entscheidungssatz gespielt. Der Entscheidungssatz geht nur auf 3 Tore! Somit sind folgende Ergebnisse möglich: 4:0, 3:1, 3:2, 2:3, 1:3, 0:4</p><p style=\"font-size: 13px;vertical-align: baseline;\"><b style=\"font-size: inherit;vertical-align: baseline;\">Punkteverteilung</b><br/>Für einen Vier zu Null- oder Drei zu Eins - Sieg nach Sätzen erhält die gewinnende Mannschaft drei Punkte. Für einen Drei zu Zwei Sieg nach Sätzen erhält die gewinnende Mannschaft zwei Punkte, die verlierende Mannschaft einen Punkt.<br/></p><p style=\"font-size: 13px;vertical-align: baseline;\"><b style=\"font-size: inherit;vertical-align: baseline;\">Sechs Tore zum Satzgewinn</b><br/>Ein Satz ist bei beendet sobald ein Team sechs Tore erreicht hat. Es wird nicht auf zwei Tore Abstand gespielt (Auch nicht im Entscheidungssatz!).</p><p style=\"font-size: 13px;vertical-align: baseline;\"><b style=\"font-size: inherit;vertical-align: baseline;\">Halbzeit = Spielhalbzeit </b><br/>Zur Saisonhalbzeit müssen mindestens die Hälfte der zu absolvierenden Spiele durchgeführt worden sein. Sollte diese Bedingung nicht erfüllt sein, kann ein Team durch das Modusteam disqualifiziert werden!</p><p style=\"font-size: 13px;vertical-align: baseline;\"><b style=\"font-size: inherit;vertical-align: baseline;\">Tabelle </b><br/>Die Tabelle wir wie folgt berechnet:</p><ol style=\"font-size: 14px;\"><li>Anzahl Punkte</li><li>Satzverhältnis</li><li>Direktbegegnung</li></ol><p><br/></p>','<p>Es wird nach den Ullrich-Regeln gespielt. Diese findet ihr hier: <a href=\"http://www.players4players.de/Regeln.regeln.0.html\" target=\"\">http://www.players4players.de/Regeln.regeln.0.html</a></p><p><br/></p>'),(21,'Garlando-Liga 17/18',21,'<p>Zum ersten mal in Luzern, die erste Töggeli-Bar Liga<br/><br/>Tischtyp: <br/>Garlando World Champion<br/><br/>Mögliche Spielorte:<br/><br/>• Haifischbar<br/>• Bar 59<br/>• El Bario<br/>• TFCL<br/>• Treibhaus Luzern<br/></p>','<p style=\"font-size: 13px;vertical-align: baseline;\"><b style=\"font-size: inherit;vertical-align: baseline;\">Jeder gegen Jeden</b><br/>Sämtliche Teams in einer Liga (resp. in der entsprechenden Gruppe) spielen gegen jedes andere Team ein Hin- und Rückspiel! Wer Heimspiel hat entscheidet, in welcher der Partnerbars gespielt wird.</p><p style=\"font-size: 13px;vertical-align: baseline;\"><b style=\"font-size: inherit;vertical-align: baseline;\">Vier Sätze + Entscheidungssatz</b><br/>Bei jeder Begegnung werden mindestens vier Sätze gespielt. Sollte nach diesen noch kein Sieger feststehen (2:2) so wird ein Entscheidungssatz gespielt. Der Entscheidungssatz geht nur auf 3 Tore! Somit sind folgende Ergebnisse möglich: <br/>4:0, 3:1, 3:2, 2:3, 1:3, 0:4</p><p style=\"font-size: 13px;vertical-align: baseline;\"><b style=\"font-size: inherit;vertical-align: baseline;\">Punkteverteilung</b><br/>Für einen Vier zu Null- oder Drei zu Eins - Sieg nach Sätzen erhält die gewinnende Mannschaft drei Punkte. Für einen Drei zu Zwei Sieg nach Sätzen erhält die gewinnende Mannschaft zwei Punkte, die verlierende Mannschaft einen Punkt.<br/></p><p style=\"font-size: 13px;vertical-align: baseline;\"><b style=\"font-size: inherit;vertical-align: baseline;\">Sechs Tore zum Satzgewinn</b><br/>Ein Satz ist bei beendet sobald ein Team sechs Tore erreicht hat. Es wird nicht auf zwei Tore Abstand gespielt (Auch nicht im Entscheidungssatz!).</p><p style=\"font-size: 13px;vertical-align: baseline;\"><b style=\"font-size: inherit;vertical-align: baseline;\">Halbzeit = Spielhalbzeit </b><br/>Zur Saisonhalbzeit müssen mindestens die Hälfte der zu absolvierenden Spiele durchgeführt worden sein. Sollte diese Bedingung nicht erfüllt sein, kann ein Team durch das Modusteam disqualifiziert werden!</p><p style=\"font-size: 13px;vertical-align: baseline;\"><b style=\"font-size: inherit;vertical-align: baseline;\">Tabelle </b><br/>Die Tabelle wir wie folgt berechnet:</p><ol style=\"font-size: 14px;\"><li>Anzahl Punkte</li><li>Satzverhältnis</li><li>Direktbegegnung</li></ol><!--EndFragment--><p><br/></p><p><br/></p>','<ul style=\"font-size: 14px;\"><li><b style=\"font-size: inherit;vertical-align: baseline;\">Die oberste und wichtigste Regel bei einem Tischfussball-Match: Habt Spass und spielt Fairplay! :-)</b></li><li>Die Mannschaft, die Heimspiel hat, hat Anstoss und bezahlt die erste Partie, anschliessend wird abwechselnd bezahlt. Anspiel in den folgenden Sätze hat jeweils der Verlierer des vorangehenden Satzes.</li><li>Der Anstoss erfolgt bei der mittleren Figur der Fü