eitschaft, wieder ins Spiel gebracht. Es gelten die gleichen Regeln wie bei der Spielaufnahme nachdem der Ball das Spielfeld verlassen hat.</li><li><b>Zu starkes Anschlagen gegen die Bande ist strikt verboten!</b> Bei starkem Anschlagen verliert der Ball seine natürliche Richtung. Ausserdem kann dadurch der Tisch stark beschädigt werden! Verliert ein Spieler den Ball weil der Gegner zu stark angeschlagen hat (und den Ball dabei nicht berührt hat), kann er ein foul reklamieren. Danach bekommt der gefoulte Spieler den Ball auf die Stange, auf der er den Ball zuletzt unter Kontrolle hatte, zurück. Die Spielaufnahme erfolgt unter Beachtung der Bereitschaft und einer Berührung einer zweiten Figur auf derselben Stange.</li><li>Zeitlimit: Maximal 10 Sekunden auf der Fünferreihe und 15 Sekunden auf den anderen Reihen, wobei die Torwart- und Abwehrstange als eine Stange betrachtet werden. </li><li>Positionswechsel: Nach einem Tor, nach einem Satz und während eines Time Outs dürfen beide Mannschaften die Positionen wechseln.</li><li>Seitenwechsel: Die Mannschaften dürfen am Ende eines Satzes die Seiten wechseln und haben dafür bis zu 90 Sekunden Zeit. </li><li>Time Out: Jedes Team darf pro Satz zwei Time Outs nehmen. Ein Time Out dauert maximal 45 Sekunden. Ist der Ball im Spiel, darf nur der Spieler, der im Ballbesitz ist, ein Time Out nehmen. Ist das Spiel unterbrochen, dürfen beide Teams ein Time Out nehmen.</li></ul><!--EndFragment--><p><br/></p><p><br/></p>'),(22,'Garlando Liga',25,'<p style=\"font-size: 13px;vertical-align: baseline;\">Die altbekannte Bar-foos-league wie sie vor über zehn Jahren gegründet wurde.<br/><br/><strong style=\"font-size: inherit;vertical-align: baseline;\">Tischtyp: </strong><br/>Garlando Deluxe<br/><br/><strong style=\"font-size: inherit;vertical-align: baseline;\">Mögliche Spielorte:</strong></p><ul style=\"font-size: 14px;\"><li>Fambar</li><li>TFCZ</li><li>Sansibar</li><li>St. Joseph\'s Pub</li><li>Poli Bar</li><li>UG Dart Club Zürich</li><li>Sender by GDS.FM</li></ul>','<p><br/></p><!--StartFragment--><p><b>Jeder gegen Jeden</b><br/>Jedes Teams in einer Liga (resp. in einer Gruppe) spielt gegen sämtliche anderen Teams ein Mal! Bei kleinen Ligen / Gruppen kann eine Hin- und Rückrunde ausgetragen werden.<br/></p><p><b>Drei Sätze plus Entscheidungssatz</b><br/>Das Team, welches zuerst drei Sätze für sich entscheidet, gewinnt das Spiel. <br/><!--StartFragment-->Bei Drei zu Null oder Drei zu Eins ist das Spiel beendet.<!--EndFragment--><br/>Steht es nach vier Sätzen Zwei zu Zwei wird der &#34;Entscheidungssatz&#34; ausgetragen.<br/>Um den Entscheidungssatz zu gewinnen, genügen drei Tore! Somit sind folgende Ergebnisse möglich: 3:0, 3:1, 3:2, 2:3, 1:3, 0:3</p><p><b>Punkteverteilung</b><br/>Für  einen Drei zu Null- oder Drei zu Eins - Sieg nach Sätzen erhält die <br/>gewinnende Mannschaft drei Punkte. Für einen Drei zu Zwei Sieg nach <br/>Sätzen erhält die gewinnende Mannschaft zwei Punkte, die verlierende <br/>Mannschaft      einen Punkt.<br/></p><p><b>Sechs Tore zum Satzgewinn</b><br/>Ein  Satz ist bei beendet sobald ein Team sechs Tore erreicht hat. Es wird <br/>nicht auf zwei Tore Abstand gespielt <br/></p><p><b>Drei Tore zum Satzgewinn im Entscheidungssatz</b><br/>Der Satz ist bei beendet sobald ein Team drei Tore erreicht hat. Es wird <br/>nicht auf zwei Tore Abstand gespielt <!--EndFragment--><br/></p><p><b>Tabelle </b><br/>Die Tabelle wir wie folgt berechnet:</p><ol><li>Anzahl Punkte</li><li>Satzverhältnis</li><li>Direktbegegnung</li></ol><!--EndFragment--><p><br/></p><p><br/></p>','<!--StartFragment--><p><br/></p><!--StartFragment--><ul><li><b>Die oberste und wichtigste Regel bei einem Tischfussball-Match: Habt Spass und spielt Fairplay! :-)</b></li><li>Die  Mannschaft, die Heimspiel hat, hat Anstoss und bezahlt die erste <br/>Partie, anschliessend wird abwechselnd bezahlt. Anspiel in den folgenden<br/>Sätze hat jeweils der Verlierer des vorangehenden Satzes.</li><li>Der Anstoss erfolgt bei der mittleren Figur der Fünferreihe unter Beachtung <br/>der “Bereitschaft”. Bereitschaft bedeutet: Der Ball muss ruhen. Dann <br/>fragt der Spieler in Ballbesitz “guet?“, der Gegner bestätigt mit <br/>“guet”. Daraufhin beginnt das Spiel.<br/></li><li>Mit  dem Berühren des Balles durch eine zweite Figur auf der Fünferreihe ist<br/>das Spiel frei. Die zweite Figur kann passen oder schiessen.<br/></li><li>Die  Anspielregeln gelten analog auch auf der Zweier- und Dreierreihe für die Spielwiederaufnahme nach Time <br/>Out, Toter Ball, Foul und Out<br/></li><li>Standpässe mit der Fünferreihe sind verboten, dies heisst, der Ball muss vor einem Pass in Bewegung sein.</li><li>Die Figur bzw. die Stange dürfen sich vor und nach der Ballberührung maximal um 360 Grad drehen.</li><li>Bälle, die ins Tor gehen und dann wieder zurück auf die Spielfläche springen, zählen als Tor.</li><li>Springt  der Ball aus dem Spielfeld verliert das Team, das zuletzt die <br/>Ballkontrolle hatte den Ball. Angespielt wird unter Beachtung der <br/>Bereitschaft auf der gegnerischen Zweierreihe.<br/></li><li>Ein Ball wird für tot erklärt, wenn er bewegungslos liegt und von keiner Figur erreicht werden kann. </li><li>Ein  Ball, der für tot erklärt wird und der zwischen den beiden Fünferreihen<br/>liegt, wird unter Beachtung der Bereitschaft mir der Fünferreihe der <br/>Mannschaft, die ursprünglich Anstossrecht hatte wieder ins Spiel <br/>gebracht.</li><li>Ein Ball, der für tot erklärt wird und zwischen einem Tor und einer <br/>Fünferreihe liegt, wird durch die Zweierreihe auf derjenigen <br/>Spielhälfte, in der sich der tote Ball befindet, unter Beachtung der <br/>Bereitschaft, wieder ins Spiel gebracht.<br/></li><li>Zu  starkes Anschlagen gegen die Bande ist strikt verboten! Bei starkem <br/>Anschlagen verliert der Ball seine natürliche Richtung. Ausserdem kann <br/>dadurch der Tisch stark beschädigt werden! Verliert ein Spieler den Ball<br/> weil der Gegner zu stark angeschlagen hat (und den Ball dabei nicht <br/>berührt hat), kann er ein foul reklamieren. Danach bekommt der gefoulte <br/>Spieler den Ball auf die Stange, auf der er den Ball zuletzt unter <br/>Kontrolle hatte, zurück.<br/></li><li>Zeitlimit: Maximal 10 Sekunden auf der Fünferreihe und <br/>15 Sekunden auf den anderen Reihen, wobei die Torwart- und Abwehrstange <br/>als eine Stange betrachtet werden. </li><li>Positionswechsel: Nach einem Tor, nach einem Satz und während eines Time Outs dürfen beide Mannschaften die Positionen wechseln.</li><li>Seitenwechsel: Die Mannschaften dürfen am Ende eines Satzes die Seiten wechseln und haben dafür bis zu 90 Sekunden Zeit. </li><li>Time  Out: Jedes Team darf pro Satz zwei Time Outs nehmen. Ein Time Out <br/>dauert maximal 45 Sekunden. Ist der Ball im Spiel, darf nur der Spieler,<br/>der im Ballbesitz ist, ein Time Out nehmen. Ist das Spiel unterbrochen,<br/>dürfen beide Teams ein Time Out nehmen.</li></ul><!--EndFragment--><p><br/></p><p><br/></p><p><br/></p><p><br/></p>'),(23,'Ullrich Liga',25,'<p style=\"font-size: 13px;vertical-align: baseline;\">Mit dem Ullrich Tisch hat neben dem Garlando ein neuer Tisch-Typ in der Zürcher Töggeli-Szene Einzug gehalten. Natürlich organisieren wir auch für unsere Ullrich-Spieler eine Liga.<br/><br/><strong style=\"font-size: inherit;vertical-align: baseline;\">Tischtyp: </strong><br/>Ullrich<br/><br/><strong style=\"font-size: inherit;vertical-align: baseline;\">Mögliche Spielorte:</strong></p><ul style=\"font-size: 14px;\"><li>TFCZ</li><li>UG Dart Club Zürich</li></ul>','<p></p><p><br/></p><!--StartFragment--><p><b>Jeder gegen Jeden</b><br/>Jedes Teams in einer Liga (resp. in einer<br/> Gruppe) spielt gegen sämtliche anderen Teams ein Mal! Bei kleinen Ligen<br/> / Gruppen kann eine Hin- und Rückrunde ausgetragen werden.<br/></p><p><b>Drei Sätze plus Entscheidungssatz</b><br/>Das Team, welches zuerst drei Sätze für sich entscheidet, gewinnt das Spiel. <br/>Bei Drei zu Null oder Drei zu Eins ist das Spiel beendet.<br/>Steht  es nach vier Sätzen Zwei zu Zwei wird der &#34;Entscheidungssatz&#34; <br/>ausgetragen. Um den Entscheidungssatz zu gewinnen, genügen drei Tore! <br/></p><p>Es sind also folgende Ergebnisse möglich: 3:0, 3:1, 3:2, 2:3, 1:3, 0:3</p><p><b>Punkteverteilung</b><br/>Für  einen Drei zu Null- oder Drei zu Eins - Sieg nach Sätzen erhält die <br/>gewinnende Mannschaft drei Punkte. Für einen Drei zu Zwei Sieg nach <br/>Sätzen erhält die gewinnende Mannschaft zwei Punkte, die verlierende <br/>Mannschaft      einen Punkt.<br/></p><p><b>Sechs Tore zum Satzgewinn</b><br/>Ein  Satz ist bei beendet sobald ein Team sechs Tore erreicht hat. Es wird <br/>nicht auf zwei Tore Abstand gespielt <br/></p><p><b>Drei Tore zum Satzgewinn im Entscheidungssatz</b><br/>Der Entscheidungssatz ist beendet sobald ein Team drei Tore erreicht hat. Es wird <br/>nicht auf zwei Tore Abstand gespielt <br/></p><p><b>Tabelle </b><br/>Die Tabelle wir wie folgt berechnet:</p><ol><li>Anzahl Punkte</li><li>Satzverhältnis</li><li>Direktbegegnung</li></ol><!--EndFragment--><p><br/></p><p><br/></p><ol><li></li></ol><!--EndFragment--><p><br/></p><p><br/></p>','<p></p><p style=\"font-size: 13px;vertical-align: baseline;\">Es wird nach den Ullrich-Regeln gespielt. Diese findet ihr hier: <a href=\"http://www.players4players.de/Regeln.regeln.0.html\" target=\"\" style=\"vertical-align: baseline;\">http://www.players4players.de/Regeln.regeln.0.html</a></p><p><br/></p>'),(24,'Töggeli Liga Luzern',26,'<p><span style=\"font-size: 13px;float: none;\">Zum zweiten Mal in Luzern wird die Töggeli Liga ausgetragen.</span><br style=\"font-size: 13px;\"/><br style=\"font-size: 13px;\"/><span style=\"font-size: 13px;float: none;\">Tischtyp: </span><br style=\"font-size: 13px;\"/><span style=\"font-size: 13px;float: none;\">Garlando World Champion + Tornado</span><br style=\"font-size: 13px;\"/><br style=\"font-size: 13px;\"/><span style=\"font-size: 13px;float: none;\">Mögliche Spielorte:</span><br style=\"font-size: 13px;\"/><br style=\"font-size: 13px;\"/><span style=\"font-size: 13px;float: none;\">• Haifish Bar</span><br style=\"font-size: 13px;\"/><span style=\"font-size: 13px;float: none;\">• Bar 59</span><br style=\"font-size: 13px;\"/><span style=\"font-size: 13px;float: none;\">• El Barrio</span><br style=\"font-size: 13px;\"/><span style=\"font-size: 13px;float: none;\">• TFCL (Tischfussball Club Luzern)</span><br style=\"font-size: 13px;\"/><br/><br/><br/></p>','<p><b><span style=\"font-size: 10.0pt;color: #2f3239;\">Jeder gegen Jeden</span></b><span style=\"font-size: 10.0pt;color: #2f3239;\"><br/> Jedes Team in einer Liga (resp. in einer Gruppe) spielt gegen sämtliche andere Teams zwei Mal! </span></p><p><b><span style=\"font-size: 10.0pt;color: #2f3239;\">Drei Sätze plus Entscheidungssatz </span></b><b><span style=\"font-size: 10.0pt;\">(Best of five)</span></b><span style=\"font-size: 10.0pt;color: #2f3239;\"><br/> Das Team, welches zuerst drei </span><span style=\"font-size: 10.0pt;\">Sätze auf jeweils 5 Tore für sich entscheidet, gewinnt das Spiel. <br/> Steht es nach vier Sätzen Zwei zu Zwei in den Sätzen wird der &#34;Entscheidungssatz&#34; ausgetragen.<br/> Um den Entscheidungssatz zu gewinnen, genügen drei Tore! Somit sind im fünften Satz folgende Satzergebnisse möglich: <br/>3:0, 3:1, 3:2, 2:3, 1:3, 0:3</span></p><p><b><span style=\"font-size: 10.0pt;\">Punkteverteilung</span></b><span style=\"font-size: 10.0pt;color: #2f3239;\"><br/> Für einen Drei zu Null- oder Drei zu Eins - Sieg nach Sätzen erhält die <br/> gewinnende Mannschaft drei Punkte. Für einen Drei zu Zwei Sieg nach <br/> Sätzen erhält die gewinnende Mannschaft zwei Punkte, die verlierende <br/> Mannschaft einen Punkt.</span></p><p><b><span style=\"font-size: 10.0pt;color: #2f3239;\">Fünf Tore zum Satzgewinn</span></b><span style=\"font-size: 10.0pt;color: #2f3239;\"><br/> Ein Satz ist bei beendet sobald ein Team fünf Tore erreicht hat. </span></p><p><b><span style=\"font-size: 10.0pt;color: #2f3239;\">Drei Tore zum Satzgewinn im Entscheidungssatz</span></b><span style=\"font-size: 10.0pt;color: #2f3239;\"><br/> Der Satz ist beendet sobald ein Team drei Tore erreicht hat. </span></p><p><b><span style=\"font-size: 10.0pt;color: #2f3239;\">Tabelle </span></b><span style=\"font-size: 10.0pt;color: #2f3239;\"><br/> Die Tabelle wird wie folgt berechnet:</span><br/>             1.  Anzahl Punkte<br/>             2.  Satzvehältnis<br/>             3.  Direktbegegnung <br/></p><p></p><p><span style=\"font-size: 10.0pt;color: #2f3239;\"></span></p>','<ul type=\"disc\">  <li><span style=\"font-size: 10.5pt;color: #2f3239;\">Die oberste und      wichtigste Regel bei einem Tischfussball-Spiel: <b>Habt Spass und spielt      Fairplay! :)<br/></b></span><b><span style=\"font-size: 10.5pt;\"></span></b></li>  <li style=\"color: #2f3239;\"><span style=\"font-size: 10.5pt;\">Die Mannschaft mit Heimspiel      hat Anstoss und <b>bezahlt die      erste <br/>      Partie</b>. Anschliessend wird abwechselnd bezahlt. Anspiel in den      folgenden Sätze hat jeweils der Verlierer des vorangehenden Satzes.</span></li>  <li style=\"color: #2f3239;\"><b><span style=\"font-size: 10.5pt;\">Der Anstoss erfolgt bei der mittleren Figur      der Fünferreihe</span></b><span style=\"font-size: 10.5pt;\">. Unter      Beachtung <br/>      der “<i>Bereitschafts-Regel</i>”.      Bereitschaft bedeutet: Der Ball muss ruhen. Dann fragt der Spieler in Ballbesitz “guet?“, der Gegner bestätigt mit “guet”. Daraufhin beginnt das Spiel.</span></li>  <li style=\"color: #2f3239;\"><b><span style=\"font-size: 10.5pt;\">Mit dem Berühren des Balles durch eine      zweite Figur auf der Fünferreihe ist das Spiel frei gegeben</span></b><span style=\"font-size: 10.5pt;\">. Ab da kann die zweite Figur passen oder schiessen.</span></li>  <li><b><span style=\"font-size: 10.5pt;color: #2f3239;\">Standpässe mit      der Fünferreihe sind verboten</span></b><span style=\"font-size: 10.5pt;color: #2f3239;\"> dies heisst, der Ball muss vor      einem Pass in Bewegung sein.</span><span style=\"font-size: 10.5pt;\"></span></li>  <li style=\"color: #2f3239;\"><span style=\"font-size: 10.5pt;\">Die Anspielregeln      gelten analog auch auf der Zweier- und Dreierreihe für die      Spielwiederaufnahme nach Toter Ball, Foul oder Out.</span></li>  <li style=\"color: #2f3239;\"><b><span style=\"font-size: 10.5pt;\">Springt der Ball aus dem Spielfeld</span></b><span style=\"font-size: 10.5pt;\"> verliert das Team, das      zuletzt die Ballkontrolle hatte den Ball. Angespielt wird immer unter Beachtung      der <i>Bereitschafts-Regel</i> auf der gegnerischen      Zweierreihe.</span></li>  <li style=\"color: #2f3239;\"><b><span style=\"font-size: 10.5pt;\">Ein      Ball wird für tot erklärt</span></b><span style=\"font-size: 10.5pt;\">, wenn er bewegungslos liegt und von keiner      Figur erreicht werden kann. (Bitte nicht den Tisch hochziehen um den      Ball wieder zu bewegen)</span></li>  <li style=\"color: #2f3239;\"><span style=\"font-size: 10.5pt;\">Ein Ball, der für tot      erklärt wird und der <b>zwischen den      beiden Fünferreihen </b><b>liegt</b>, wird unter Beachtung der      <i>Bereitschafts-Regel</i> mir der      Fünferreihe der Mannschaft, die zuletzt Anspiel hatte wieder ins Spiel gebracht.</span></li>  <li style=\"color: #2f3239;\"><span style=\"font-size: 10.5pt;\">Ein Ball, der für tot      erklärt wird und <b>zwischen einem Tor      und einer Fünferreihe liegt</b>, wird durch die Zweierreihe auf derjenigen Spielhälfte, in der sich der toter Ball befindet, unter Beachtung      der <i>Bereitschafts-Regel</i> wieder ins      Spiel gebracht.</span></li>  <li style=\"color: #2f3239;\"><span style=\"font-size: 10.5pt;\">Die Figur bzw. die Stange dürfen sich vor und      nach der Ballberührung <b>maximal um      360° Grad drehen</b>.</span></li>  <li style=\"color: #2f3239;\"><b><span style=\"font-size: 10.5pt;\">Bälle,      die ins Tor gehen und dann wieder zurück auf die Spielfläche springen,      zählen als Tor.</span></b></li>  <li style=\"color: #2f3239;\"><b><span style=\"font-size: 10.5pt;\">Zu starkes Anschlagen gegen die Bande ist      strikt verboten!</span></b><span style=\"font-size: 10.5pt;\"> Bei      starkem Anschlagen verliert der Ball seine natürliche Richtung. Ausserdem      kann dadurch der Tisch stark beschädigt werden! Verliert ein Spieler den Ball weil der Gegner zu stark angeschlagen hat (und den Ball dabei nicht berührt hat), kann er ein Foul reklamieren. Danach bekommt der      gefoulte Spieler den Ball auf die Stange, auf der er den Ball zuletzt unter Kontrolle hatte, zurück.</span></li>  <li style=\"color: #2f3239;\"><b><span style=\"font-size: 10.5pt;\">Zeitlimit</span></b><span style=\"font-size: 10.5pt;\">: Maximal <b>10      Sekunden</b> auf der Fünferreihe und <b>15 Sekunden</b> auf den anderen      Reihen, wobei die Torwart- und Abwehrreihe als eine Stange betrachtet werden. </span></li>  <li style=\"color: #2f3239;\"><b><span style=\"font-size: 10.5pt;\">Positionswechsel      mit Partner</span></b><span style=\"font-size: 10.5pt;\">:      Man darf den Platz mit dem Partner nach jedem Spielunterbruch wechseln.      (Fouls gelten nicht als Spielunterbruch)</span></li>  <li><b><span style=\"font-size: 10.5pt;color: #2f3239;\">Time Out: Es      gibt keine Time Outs.</span></b><b><span style=\"font-size: 10.5pt;\"></span></b></li> </ul>'),(25,'Fordere St. Gallen - Bar-foos-league',24,'<p>Cool, dass ihr dabei seid! Nach der erfolgreichen Registrierung meldet ihr euch gemeinsam mit euerem Mitspieler für die zweite Saison von &#34;Fordere St. Gallen&#34; an. </p>','<p><b>Jeder gegen Jeden</b></p><p>Euer Team wird abhängig von eurer Spielstärke in eine Liga eingeteilt. Da spielt ihr gegen ca. 6 andere Gegner je ein Heimspiel bei euch in der Heimbar und ein Auswärtsspiel bei euern Gegnern. Wenn ihr gleich beide Matches an einem Abend durchführt, kommt ihr sehr schnell voran. Eine Variante ist auch, dass man gleich mehrere Spiele an einem Abend in einer Bar austrägt. Das ist euch überlassen. </p><p><b>Liga-Chat</b></p><p>Wichtig ist uns, dass die Spiele auch tatsächlich gespielt werden. Dafür eröffnen wir pro Liga einen Whatsapp-Chat, in dem ihr euch austauschen könnt. Auch laufende Fragen können da platziert werden. </p><p style=\"font-size: 13px;vertical-align: baseline;\"><b style=\"font-size: inherit;vertical-align: baseline;\">Drei Sätze plus Entscheidungssatz</b><br/>Das Team, welches zuerst drei Sätze für sich entscheidet, gewinnt das Spiel. Bei Drei zu Null oder Drei zu Eins ist das Spiel beendet.<br/>Steht es nach vier Sätzen Zwei zu Zwei wird der &#34;Entscheidungssatz&#34; ausgetragen.<br/>Um den Entscheidungssatz zu gewinnen, genügen drei Tore! Somit sind folgende Ergebnisse möglich: 3:0, 3:1, 3:2, 2:3, 1:3, 0:3</p><p style=\"font-size: 13px;vertical-align: baseline;\"><b style=\"font-size: inherit;vertical-align: baseline;\">Punkteverteilung</b><br/>Für  einen Drei zu Null- oder Drei zu Eins - Sieg nach Sätzen erhält die gewinnende Mannschaft drei Punkte. Für einen Drei zu Zwei Sieg nach Sätzen erhält die gewinnende Mannschaft zwei Punkte, die verlierende Mannschaft einen Punkt.<br/></p><p style=\"font-size: 13px;vertical-align: baseline;\"><b style=\"font-size: inherit;vertical-align: baseline;\">Sechs Tore zum Satzgewinn</b><br/>Ein  Satz ist bei beendet sobald ein Team sechs Tore erreicht hat. Es wird nicht auf zwei Tore Abstand gespielt </p><p style=\"font-size: 13px;vertical-align: baseline;\"><b style=\"font-size: inherit;vertical-align: baseline;\">Drei Tore zum Satzgewinn im Entscheidungssatz</b><br/>Der Satz ist bei beendet sobald ein Team drei Tore erreicht hat. Es wird nicht auf zwei Tore Abstand gespielt </p><p style=\"font-size: 13px;vertical-align: baseline;\"><b style=\"font-size: inherit;vertical-align: baseline;\">Tabelle </b><br/>Die Tabelle wir wie folgt berechnet:</p><ol style=\"font-size: 14px;\"><li>Anzahl Punkte</li><li>Satzverhältnis</li><li>Direktbegegnung</li></ol><!--EndFragment--><p><br/></p><p><br/></p><p><br/></p>','<ul style=\"font-size: 14px;\"><li><b style=\"font-size: inherit;vertical-align: baseline;\">Die oberste und wichtigste Regel bei einem Tischfussball-Match: Habt Spass und spielt fair! :-)</b></li><li>Die  Mannschaft, die Heimspiel hat, hat Anstoss und bezahlt die erste Partie, anschliessend wird abwechselnd bezahlt. Anspiel in den folgenden Sätze hat jeweils der Verlierer des vorangehenden Satzes.</li><li>Der Anstoss erfolgt bei der mittleren Figur der Fünferreihe unter Beachtung der “Bereitschaft”. Bereitschaft bedeutet: Der Ball muss ruhen. Dann fragt der Spieler in Ballbesitz “guet?“, der Gegner bestätigt mit “guet”. Daraufhin beginnt das Spiel.<br/></li><li>Mit  dem Berühren des Balles durch eine zweite Figur auf der Fünferreihe ist das Spiel frei. Die zweite Figur kann passen oder schiessen.<br/></li><li>Die  Anspielregeln gelten analog auch auf der Zweier- und Dreierreihe für die Spielwiederaufnahme nach Time Out, Toter Ball, Foul und Out<br/></li><li>Standpässe mit der Fünferreihe sind verboten, dies heisst, der Ball muss vor einem Pass in Bewegung sein.</li><li>Die Figur bzw. die Stange dürfen sich vor und nach der Ballberührung maximal um 360 Grad drehen.</li><li>Bälle, die ins Tor gehen und dann wieder zurück auf die Spielfläche springen, zählen als Tor.</li><li>Springt  der Ball aus dem Spielfeld verliert das Team, das zuletzt die Ballkontrolle hatte den Ball. Angespielt wird unter Beachtung der Bereitschaft auf der gegnerischen Zweierreihe.<br/></li><li>Ein Ball wird für tot erklärt, wenn er bewegungslos liegt und von keiner Figur erreicht werden kann. </li><li>Ein  Ball, der für tot erklärt wird und der zwischen den beiden Fünferreihen liegt, wird unter Beachtung der Bereitschaft mir der Fünferreihe der Mannschaft, die ursprünglich Anstossrecht hatte wieder ins Spiel gebracht.</li><li>Ein Ball, der für tot erklärt wird und zwischen einem Tor und einer Fünferreihe liegt, wird durch die Zweierreihe auf derjenigen Spielhälfte, in der sich der tote Ball befindet, unter Beachtung der Bereitschaft, wieder ins Spiel gebracht.<br/></li><li>Zu  starkes Anschlagen gegen die Bande ist strikt verboten! Bei starkem Anschlagen verliert der Ball seine natürliche Richtung. Ausserdem kann dadurch der Tisch stark beschädigt werden! Verliert ein Spieler den Ball weil der Gegner zu stark angeschlagen hat (und den Ball dabei nicht berührt hat), kann er ein Foul reklamieren. Danach bekommt der gefoulte Spieler den Ball auf die Stange, auf der er den Ball zuletzt unter Kontrolle hatte, zurück.<br/></li><li>Zeitlimit: Maximal 10 Sekunden auf der Fünferreihe und 15 Sekunden auf den anderen Reihen, wobei die Torwart- und Abwehrstange als eine Stange betrachtet werden. </li><li>Positionswechsel: Nach einem Tor, nach einem Satz und während eines Time Outs dürfen beide Mannschaften die Positionen wechseln.</li><li>Seitenwechsel: Die Mannschaften dürfen am Ende eines Satzes die Seiten wechseln und haben dafür bis zu 90 Sekunden Zeit. </li><li>Time  Out: Jedes Team darf pro Satz zwei Time Outs nehmen. Ein Time Out dauert maximal 45 Sekunden. Ist der Ball im Spiel, darf nur der Spieler, der im Ballbesitz ist, ein Time Out nehmen. Ist das Spiel unterbrochen, dürfen beide Teams ein Time Out nehmen.</li></ul><!--EndFragment--><p><br/></p><p></p>'),(26,'Bar-foos-league Winti 19/20',27,'<p>Ja los, schreib Geschichte mit uns und melde dich jetzt für die <b>erste Saison der Bar-foos-league in Winti</b> an! fordere Winti freut sich... <br/></p><p>Schreib dir schonmal die folgenden Termine auf: <br/></p><p><b>Vorspielen A:</b> am Montag 07.10.2019, 18.00 - 22.00 Uhr im Widder <br/></p><p><b>Vorspielen B:</b> am Dienstag 22.10.2019, 18.00 - 22.00 Uhr in der Couleur Bar</p><p><b>Saisonstart:</b> ab Samstag 9.11.2019</p><p><b>Eröffnungsparty mit Barmaster:</b> am Samstag Nachmittag 16.11.2019 im Albani</p><p><b>Halbzeitparty mit Barmaster:</b> am Samstag Abend 25.01.2020 in der Couleur Bar</p><p><b>Finaltag mit Barmaster:</b> am Sonntag 26. April 2020 im Salzhaus<br/></p>','<p></p><p></p><p></p><p><b><span style=\"color: #2f3239;\">Jeder gegen Jeden</span></b><span style=\"color: #2f3239;\"><br/> Jedes Team in einer Liga (resp. in einer Gruppe) spielt gegen sämtliche andere Teams ein oder zwei Mal (abhängig von Gruppengrösse).</span><span style=\"color: #2f3239;\"></span></p><p><b><span style=\"color: #2f3239;\">Drei Sätze plus Entscheidungssatz </span></b><b>(Best of five)</b><span style=\"color: #2f3239;\"><br/> Das Team, welches zuerst drei </span>Sätze auf jeweils 6 Tore für sich entscheidet, gewinnt das Spiel. <br/> Steht es nach vier Sätzen Zwei zu Zwei in den Sätzen wird der &#34;Entscheidungssatz&#34; ausgetragen.<br/> Um den Entscheidungssatz zu gewinnen, genügen drei Tore! Somit sind im fünften Satz folgende Satzergebnisse möglich: <br/> 3:0, 3:1, 3:2, 2:3, 1:3, 0:3</p><p><b>Punkteverteilung</b><span style=\"color: #2f3239;\"><br/> Für einen Drei zu Null- oder Drei zu Eins - Sieg nach Sätzen erhält die <br/> gewinnende Mannschaft drei Punkte. Für einen Drei zu Zwei Sieg nach <br/> Sätzen erhält die gewinnende Mannschaft zwei Punkte, die verlierende <br/> Mannschaft einen Punkt.</span></p><p><b>Sechs Tore zum Satzgewinn</b><span style=\"color: #2f3239;\"><br/> </span><span style=\"color: #2f3239;\">Ein Satz ist beendet sobald ein Team sechs Tore erreicht hat. </span></p><p><b><span style=\"color: #2f3239;\">Drei Tore zum Satzgewinn im Entscheidungssatz</span></b><span style=\"color: #2f3239;\"><br/> Der Satz ist beendet sobald ein Team drei Tore erreicht hat. </span></p><p><b><span style=\"color: #2f3239;\">Tabelle </span></b><span style=\"color: #2f3239;\"><br/> Die Tabelle wird wie folgt berechnet:</span><br/>              1.  Anzahl Punkte<br/>              2.  Satzvehältnis<br/>              3.  Direktbegegnung</p><p></p><p><b><u><span style=\"color: #2f3239;\">Spielorganisation</span></u></b></p><p><span style=\"color: #2f3239;\">Denkt daran, dass der Töggelikasten nach dem Eintragen zwar innerhalb von unserem Verein reserviert ist und kein anderes Team dieselbe Spielzeit auswählen kann – für die Bar und dessen Gäste seid ihr aber «normale» Töggelimenschen welche am Kasten anstehen und fordern müssen – weil das Ligaspiel dann aber klar länger dauern wird als die üblichen Spiele, bitten wir euch die weiteren Töggelimenschen darauf aufmerksam zu machen. Nur so sind wir auch weiterhin in unseren Partnerbars willkommen.</span></p><p><span style=\"color: #2f3239;\">Mehrere Spiele können an einem Abend abgemacht werden, dann müsst ihr für eure Anzahl Saisonspiele nicht ganz so viele Abende aufwenden.</span></p><p><span style=\"color: #2f3239;\">Es kann sein, dass in unseren Partnerbars ein ausserordentlicher (oder spontaner) Anlass (z.B. Konzert) stattfindet und ihr trotzdem den Kasten reserviert habt. Klärt vorgängig ab, ob ein solcher Anlass euer Spiel gefährden könnte und weicht auf eine andere Bar aus. Wenn ihr schon vor Ort seid, dann spricht ihr euch mit dem gegnerischen Team kurz ab, wo ihr das Spiel austragen möchtet.</span></p><p></p>','<p></p><p></p><ul><li><span style=\"color: #2f3239;\">Die oberste und wichtigste Regel bei einem Tischfussball-Spiel: <b>Habt Spass und spielt Fairplay! :)</b></span></li><li>Die Mannschaft mit Heimspiel hat Anstoss und <b>bezahlt die erste Partie</b>. Anschliessend wird abwechselnd bezahlt. Anspiel in den folgenden Sätzen hat jeweils der Verlierer des vorangehenden Satzes. </li><li><b>Der Anstoss erfolgt bei der mittleren Figur der Fünferreihe</b>. Unter Beachtung der “<i><i>Bereitschaftsregel</i></i>”. Bereitschaft bedeutet: Der Ball muss ruhen. Dann fragt der Spieler in Ballbesitz “guet?“, der Gegner bestätigt mit “guet”. Daraufhin beginnt das Spiel. </li><li><b>Mit dem Berühren des Balles durch eine zweite Figur auf der Fünferreihe ist das Spiel frei gegeben</b>. Ab da kann die zweite Figur passen oder schiessen. </li><li><b><span style=\"color: #2f3239;\">Standpässe mit der Fünferreihe sind verboten</span></b><span style=\"color: #2f3239;\"> dies heisst, der Ball muss vor einem Pass in Bewegung sein.</span> </li><li>Die Anspielregeln gelten analog auch auf der Zweier- und Dreierreihe für die Spielwiederaufnahme nach Toter Ball, Foul oder Out. </li><li><b>Springt der Ball aus dem Spielfeld</b> verliert das Team, das zuletzt die Ballkontrolle hatte den Ball. Angespielt wird immer unter Beachtung der <i></i><i>Bereitschaftsregel</i> auf der gegnerischen Zweierreihe. </li><li><b>Ein Ball wird für tot erklärt</b>, wenn er bewegungslos liegt und von keiner Figur erreicht werden kann. (Bitte nicht den Tisch hochziehen, um den Ball wieder zu bewegen) </li><li>Ein Ball, der für tot erklärt wird und der <b>zwischen den beiden Fünferreihen liegt</b>, wird unter Beachtung der <i>Bereitschaftsregel</i> mir der Fünferreihe der Mannschaft, die zuletzt Anspiel hatte wieder ins Spiel gebracht. </li><li>Ein Ball, der für tot erklärt wird und <b>zwischen einem Tor und einer Fünferreihe liegt</b>, wird durch die Zweierreihe auf derjenigen Spielhälfte, in der sich der tote Ball befindet, unter Beachtung der <i></i><i>Bereitschaftsregel</i> wieder ins Spiel gebracht. </li><li>Die Figur bzw. die Stange dürfen sich vor und nach der Ballberührung <b>maximal um 360° Grad drehen</b>. </li><li><b>Bälle, die ins Tor gehen und dann wieder zurück auf die Spielfläche springen, zählen als Tor.</b> </li><li><b>Zu starkes Anschlagen gegen die Bande ist strikt verboten!</b> Bei starkem Anschlagen verliert der Ball seine natürliche Richtung. Ausserdem kann dadurch der Tisch stark beschädigt werden! Verliert ein Spieler den Ball, weil der Gegner zu stark angeschlagen hat (und den Ball dabei nicht berührt hat), kann er ein Foul reklamieren. Danach bekommt der gefoulte Spieler den Ball auf die Stange, auf der er den Ball zuletzt unter Kontrolle hatte, zurück. </li><li><b>Zeitlimit</b>: Maximal <b>10 Sekunden</b> auf der Fünferreihe und <b>15 Sekunden</b> auf den anderen Reihen, wobei die Torwart- und Abwehrreihe als eine Stange betrachtet werden.  </li><li><b>Positionswechsel mit Partner</b>: Man darf den Platz mit dem Partner nach jedem Spielunterbruch wechseln. (Fouls gelten nicht als Spielunterbruch) </li><li><b><span style=\"color: #2f3239;\">Time Out: Es gibt ein Time Out pro Team pro Satz. </span></b><span style=\"color: #2f3239;\">Das Time Out ist bei eigenem Ballbesitz oder bei Spielunterbruch zu nehmen.</span><b><span style=\"color: #2f3239;\"><br/></span></b><h4><b><u></u></b></h4></li><li><b></b><h4><b><u>Verhaltenskodex Verein fordere Winti</u></b></h4></li><p></p><ul><li>Der Verein fordere Winti schliesst niemanden aufgrund von Geschlecht, Rasse, Nationalität, Religion, sexueller Identität oder Behinderung aus dem Vereinsleben aus.</li><li>Der Verein fordere Winti erwartet von seinen Mitgliedern, dass in keiner Form diskriminiert wird, sei es aufgrund von Geschlecht, Rasse, Nationalität, Religion, sexueller Identität oder Behinderung.</li><li>Der Verein fordere Winti fördert den Spielbetrieb einer Spassliga. Bei Ligaspielen soll der Spass im Vordergrund stehen, allfällige Meinungsdifferenzen sollen in respektvoller, fairer und sportlicher Weise geklärt werden.</li><li>Der Verein fordere Winti fördert Toleranz und verbindet Menschen aller Kulturen, Hautfarbe und sozialen Schichten.</li><li>Der Vorstand behält sich vor, Aktiv- wie auch Passivmitglieder aus dem laufenden Spielbetrieb und dem Vereinsleben auszuschliessen, sofern es zu Diskriminierungen oder anderen gröberen Verstössen gegen den Verhaltenskodex kommt. Der Vorstand begründet einen allfälligen Ausschluss, der Entscheid ist jedoch final. Der Mitgliederbeitrag wird grundsätzlich nicht zurückerstattet, die Entscheidung darüber liegt beim Vorstand. </li></ul></ul><p></p>'),(27,'Bar-foos-league SG',28,'<h6></h6><p>Cool, dass ihr dabei seid! <br/></p><p><span style=\"font-size: 13px;\">Für die Teilnahme braucht ihr zunächst beide einen Account bei Fordere.ch. Falls dein Teampartner noch keinen hat, könnt ihr diesen </span><a href=\"https://sg.fordere.ch/register\" target=\"\" style=\"font-size: 13px;\">jetzt erstellen</a><span style=\"font-size: 13px;\">. </span></p><h2></h2><h2 style=\"font-size: 30px;vertical-align: baseline;\"><span style=\"font-size: 13px;vertical-align: baseline;\">Und wie funktioniert Fordere überhaupt?</span></h2><p></p><p><span style=\"font-size: 13px;vertical-align: baseline;\">Du bist dir noch nicht sicher, wie die Liga abläuft? <a href=\"https://sg.fordere.ch/news/195\" target=\"\">Hier</a> sind die wichtigsten Infos zusammengefasst, ansonsten schau mal in die <a href=\"http://sg.fordere.ch/faq\" target=\"\">FAQ</a> oder schreib uns einfach eine <a href=\"https://sg.fordere.ch/contact\" target=\"\">Mail</a>. </span></p><h2><span style=\"font-size: 13px;vertical-align: baseline;\">Mitgliederbeitrag</span></h2><div><p><span style=\"font-size: 13px;float: none;\">Pro Spieler wird ein Mitgliederbeitrag von 25.- fällig. Wofür das Geld verwendet wird? <a href=\"https://sg.fordere.ch/faq\" target=\"\">Hier</a> findest du die Antwort.</span></p><p></p><h2><span style=\"font-size: 13px;vertical-align: baseline;\">Wichtige Termine</span></h2><div><p><span style=\"font-size: 13px;float: none;\">Wann beginnt die Saison? Bis wann kann ich spielen? Und wann ist der Finaltag? Hier sind die wichtigsten <a href=\"https://sg.fordere.ch/season/termine\" target=\"\">Termine</a>.</span></p><p></p><p><br/></p></div><p>Keine weiteren Fragen? Na dann kannst du dich ja jetzt für die Saison 2019/20 anmelden. Wir freuen uns auf euch!</p><p></p></div>','<h4><b>Ablauf der Liga<br/></b></h4><p><b></b><b>Jeder gegen Jeden</b><br/>Die Ligen sind in Gruppen mit rund 6 - 7 Teams aufgeteilt. Innerhalb eurer Gruppe spielt ihr gegen jedes Team je ein Heimspiel in eurer Heimbar und ein Auswärtsspiel bei euren Gegnern. Wenn ihr gleich beide Matches an einem Abend durchführt, kommt ihr sehr schnell voran. Eine Variante ist auch, dass man gleich mehrere Spiele an einem Abend in einer Bar austrägt. Das ist euch überlassen. <br/><br/><b>Spiele selbst abmachen &amp; rechtzeitig durchführen</b><br/>Um euch grösstmögliche Flexibilität zu geben, entscheidet ihr selbst, wann ihr Matches spielt. Die Termine macht ihr direkt mit euren Gegnern ab. Dafür eröffnen wir pro Liga einen Whatsapp-Chat, in dem ihr euch austauschen könnt. Auch laufende Fragen können da platziert werden. <br/>Wichtig ist uns, dass die Spiele auch tatsächlich gespielt werden. Darum sind wir dieses Jahr strenger, was die Anzahl der gespielten Spiele anbetrifft: bis zur Halbzeit im am 09. Februar solltet ihr die Hälfte aller Spiele gespielt oder zumindest in naher Zeit fix abgemacht haben. Sollte euch das nicht möglich sein, besprecht das bitte frühzeitig mit dem OK und eueren Liga-Kollegen im Chat. Teams, die zu wenig Spiele spielen und sich auch nicht mit den Coaches / dem OK absprechen, müssen wir leider disqualifizieren.<br/><br/><b>Töggelichampion!</b><br/>Bei Fordere steht der Spielspass absolut im Vordergrund. Zu gewinnen gibt es Ruhm, Ehre und Pokale für die Besten der jeweiligen Liga.<br/>Wir wünschen euch einfach eine gute Zeit mit alten Bekannten und neuen Freunden. Am Finaltag im Mai laden wir die Spieler aus allen Ligen zu einem grossen gemeinsamen Abschlussfest ein, an dem nochmals gemeinsam getöggelt, die Preise verliehen und auf die Saison angestossen wird.  Wir freuen uns schon jetzt drauf!</p><p><br/></p><h4><b>Modus</b></h4><p><b>Drei Sätze plus Entscheidungssatz</b><br/>Das Team, welches zuerst drei Sätze für sich entscheidet, gewinnt das Spiel. Bei Drei zu Null oder Drei zu Eins ist das Spiel beendet. Steht es nach vier Sätzen Zwei zu Zwei wird der &#34;Entscheidungssatz&#34; ausgetragen. Um den Entscheidungssatz zu gewinnen, genügen drei Tore! <br/>Somit sind folgende Ergebnisse möglich: 3:0, 3:1, 3:2, 2:3, 1:3, 0:3<br/><br/><b>Sechs Tore zum Satzgewinn, drei Tore im Entscheidungssatz</b><br/>Ein normaler  Satz ist bei beendet sobald ein Team sechs Tore erreicht hat. Es wird nicht auf zwei Tore Abstand gespielt. <br/>Entscheidungssatz: Der Satz ist bei beendet sobald ein Team drei Tore erreicht hat. Es wird nicht auf zwei Tore Abstand gespielt.<br/><br/><b>Punkteverteilung</b><br/>Für  einen 3:0 oder 3:1 - Sieg nach Sätzen erhält die gewinnende Mannschaft drei Punkte. Für einen 3:2 Sieg nach Sätzen erhält die gewinnende Mannschaft zwei Punkte, die verlierende Mannschaft einen Punkt.<br/><br/><b>Tabelle </b><br/>Die Tabelle wird wie folgt berechnet:<span id=\"selectionBoundary_1564502474718_1214196119228862\" class=\"rangySelectionBoundary\"><br/></span></p><ol> <li>Anzahl Punkte</li><li>Satzverhältnis</li><li>Direktbegegnung</li></ol><p><br/></p>','<div><b>Die oberste und wichtigste Regel beim Tischfussball-Match: Habt Spass und spielt fair! :-)</b></div><div><b><br/></b></div><ul><li>Die  Mannschaft, die Heimspiel hat, hat Anstoss und bezahlt die erste Partie, anschliessend wird abwechselnd bezahlt. Anspiel in den folgenden Sätzen hat jeweils der Verlierer des vorangehenden Satzes.</li><li>Der Anstoss erfolgt bei der mittleren Figur der Fünferreihe unter Beachtung der “Bereitschaft”. Bereitschaft bedeutet: Der Ball muss ruhen. Dann fragt der Spieler in Ballbesitz “guet?“, der Gegner bestätigt mit “guet”. Daraufhin beginnt das Spiel.</li><li>Mit  dem Berühren des Balles durch eine zweite Figur auf der Fünferreihe ist das Spiel frei. Die zweite Figur kann passen oder schiessen.</li><li>Die  Anspielregeln gelten analog auch auf der Zweier- und Dreierreihe für die Spielwiederaufnahme nach Time Out, Toter Ball, Foul und Out</li><li>Standpässe mit der Fünferreihe sind verboten, dies heisst, der Ball muss vor einem Pass in Bewegung sein.</li><li>Die Figur bzw. die Stange dürfen sich vor und nach der Ballberührung maximal um 360 Grad drehen.</li><li>Bälle, die ins Tor gehen und dann wieder zurück auf die Spielfläche springen, zählen als Tor.</li><li>Springt  der Ball aus dem Spielfeld verliert das Team, das zuletzt die Ballkontrolle hatte den Ball. Angespielt wird unter Beachtung der Bereitschaft auf der gegnerischen Zweierreihe.</li><li>Ein Ball wird für tot erklärt, wenn er bewegungslos liegt und von keiner Figur erreicht werden kann. <br/></li><li>Ein  Ball, der für tot erklärt wird und der zwischen den beiden Fünferreihen liegt, wird unter Beachtung der Bereitschaft mir der Fünferreihe der Mannschaft, die zuletzt Anstossrecht hatte wieder ins Spiel gebracht.</li><li>Ein Ball, der für tot erklärt wird und zwischen einem Tor und einer Fünferreihe liegt, wird durch die Zweierreihe auf derjenigen Spielhälfte, in der sich der tote Ball befindet, unter Beachtung der Bereitschaft, wieder ins Spiel gebracht.</li><li>Zu  starkes Anschlagen gegen die Bande ist strikt verboten! Bei starkem Anschlagen verliert der Ball seine natürliche Richtung. Ausserdem kann dadurch der Tisch stark beschädigt werden! Verliert ein Spieler den Ball weil der Gegner zu stark angeschlagen hat (und den Ball dabei nicht berührt hat), kann er ein Foul reklamieren. Danach bekommt der gefoulte Spieler den Ball auf die Stange, auf der er den Ball zuletzt unter Kontrolle hatte, zurück.</li><li>Zeitlimit: Maximal 10 Sekunden auf der Fünferreihe und 15 Sekunden auf den anderen Reihen, wobei die Torwart- und Abwehrstange als eine Stange betrachtet werden. <br/></li><li>Positionswechsel: Nach einem Tor, nach einem Satz und während eines Time Outs dürfen beide Mannschaften die Positionen wechseln.</li><li>Seitenwechsel: Die Mannschaften dürfen am Ende eines Satzes die Seiten wechseln. <br/></li><li>Time  Out: Jedes Team darf pro Satz zwei Time Outs nehmen. Ein Time Out dauert maximal 45 Sekunden. Ist der Ball im Spiel, darf nur der Spieler, der im Ballbesitz ist, ein Time Out nehmen. Ist das Spiel unterbrochen, dürfen beide Teams ein Time Out nehmen.<br/><br/><br/><br/></li></ul>'),(28,'Garlando Liga',29,'<p style=\"font-size: 13px;vertical-align: baseline;\">Die altbekannte Bar-foos-league wie sie vor über zehn Jahren gegründet wurde.<br/><br/><strong style=\"font-size: inherit;vertical-align: baseline;\">Tischtyp: </strong><br/>Garlando Deluxe<br/><br/><strong style=\"font-size: inherit;vertical-align: baseline;\">Mögliche Spielorte:</strong></p><ul style=\"font-size: 14px;\"><li>Fambar</li><li>TFCZ</li><li>Sansibar</li><li>St. Joseph\'s Pub</li><li>Poli Bar</li><li>UG Dart Club Zürich</li><li>Strauss</li></ul>','<p style=\"font-size: 13px;vertical-align: baseline;\"><b style=\"font-size: inherit;vertical-align: baseline;\">Jeder gegen Jeden</b><br/>Jedes Teams in einer Liga (resp. in einer Gruppe) spielt gegen sämtliche anderen Teams ein Mal! Bei kleinen Ligen / Gruppen kann eine Hin- und Rückrunde ausgetragen werden.<br/></p><p style=\"font-size: 13px;vertical-align: baseline;\"><b style=\"font-size: inherit;vertical-align: baseline;\">Drei Sätze plus Entscheidungssatz</b><br/>Das Team, welches zuerst drei Sätze für sich entscheidet, gewinnt das Spiel. Bei Drei zu Null oder Drei zu Eins ist das Spiel beendet.<br/>Steht es nach vier Sätzen Zwei zu Zwei wird der &#34;Entscheidungssatz&#34; ausgetragen.<br/>Um den Entscheidungssatz zu gewinnen, genügen drei Tore! Somit sind folgende Ergebnisse möglich: 3:0, 3:1, 3:2, 2:3, 1:3, 0:3</p><p style=\"font-size: 13px;vertical-align: baseline;\"><b style=\"font-size: inherit;vertical-align: baseline;\">Punkteverteilung</b><br/>Für  einen Drei zu Null- oder Drei zu Eins - Sieg nach Sätzen erhält die gewinnende Mannschaft drei Punkte. Für einen Drei zu Zwei Sieg nach Sätzen erhält die gewinnende Mannschaft zwei Punkte, die verlierende Mannschaft einen Punkt.<br/></p><p style=\"font-size: 13px;vertical-align: baseline;\"><b style=\"font-size: inherit;vertical-align: baseline;\">Sechs Tore zum Satzgewinn</b><br/>Ein  Satz ist bei beendet sobald ein Team sechs Tore erreicht hat. Es wird nicht auf zwei Tore Abstand gespielt </p><p style=\"font-size: 13px;vertical-align: baseline;\"><b style=\"font-size: inherit;vertical-align: baseline;\">Drei Tore zum Satzgewinn im Entscheidungssatz</b><br/>Der Satz ist bei beendet sobald ein Team drei Tore erreicht hat. Es wird nicht auf zwei Tore Abstand gespielt </p><p style=\"font-size: 13px;vertical-align: baseline;\"><b style=\"font-size: inherit;vertical-align: baseline;\">Tabelle </b><br/>Die Tabelle wir wie folgt berechnet:</p><ol><li>Anzahl Punkte</li><li>Satzverhältnis</li><li>Direktbegegnung</li></ol><p style=\"font-size: 13px;vertical-align: baseline;\"><br/></p><p style=\"font-size: 13px;vertical-align: baseline;\"><br style=\"font-size: 13px;\"/><!--EndFragment--><br/></p><p><br/></p>','<p><br/></p><p><br/></p><!--StartFragment--><ul><li><b style=\"font-size: inherit;vertical-align: baseline;\">Die oberste und wichtigste Regel bei einem Tischfussball-Match: Habt Spass und spielt Fairplay! :-)</b></li><li>Die  Mannschaft, die Heimspiel hat, hat Anstoss und bezahlt die erste Partie, anschliessend wird abwechselnd bezahlt. Anspiel in den folgenden<br/>Sätze hat jeweils der Verlierer des vorangehenden Satzes.</li><li>Der Anstoss erfolgt bei der mittleren Figur der Fünferreihe unter Beachtung der “Bereitschaft”. Bereitschaft bedeutet: Der Ball muss ruhen. Dann fragt der Spieler in Ballbesitz “guet?“, der Gegner bestätigt mit “guet”. Daraufhin beginnt das Spiel.<br/></li><li>Nach der Bereitschaft ist das Spiel mit der dritten Ballberührung freigegeben. Die drei Ballberührungen müssen durch mindestens zwei Figuren der gleichen Stange erfolgen. Aufeinanderfolgende Berührungen durch dieselbe Figur ohne zwischenzeitlichen Kontakt durch eine zweite Figur gelten als nur eine Berührung. Mit der dritten Ballberührung kann gepasst oder geschossen werden.<br/></li><li>Die  Anspielregeln gelten analog auch auf der Zweier- und Dreierreihe für die Spielwiederaufnahme nach Time Out, Toter Ball, Foul und Out<br/></li><li>Standpässe mit der Fünferreihe sind verboten, dies heisst, der Ball muss vor einem Pass in Bewegung sein.</li><li>Die Figur bzw. die Stange dürfen sich vor und nach der Ballberührung maximal um 360 Grad drehen.</li><li>Bälle, die ins Tor gehen und dann wieder zurück auf die Spielfläche springen, zählen als Tor.</li><li>Springt  der Ball aus dem Spielfeld verliert das Team, das zuletzt die Ballkontrolle hatte den Ball. Angespielt wird unter Beachtung der Bereitschaft auf der gegnerischen Zweierreihe.<br/></li><li>Ein Ball wird für tot erklärt, wenn er bewegungslos liegt und von keiner Figur erreicht werden kann. </li><li>Ein  Ball, der für tot erklärt wird und der zwischen den beiden Fünferreihen<br/>liegt, wird unter Beachtung der Bereitschaft mir der Fünferreihe der Mannschaft, die ursprünglich Anstossrecht hatte wieder ins Spiel gebracht.</li><li>Ein Ball, der für tot erklärt wird und zwischen einem Tor und einer Fünferreihe liegt, wird durch die Zweierreihe auf derjenigen Spielhälfte, in der sich der tote Ball befindet, unter Beachtung der Bereitschaft, wieder ins Spiel gebracht.<br/></li><li>Zu  starkes Anschlagen gegen die Bande ist strikt verboten! Bei starkem Anschlagen verliert der Ball seine natürliche Richtung. Ausserdem kann dadurch der Tisch stark beschädigt werden! Verliert ein Spieler den Ball<br/> weil der Gegner zu stark angeschlagen hat (und den Ball dabei nicht berührt hat), kann er ein foul reklamieren. Danach bekommt der gefoulte Spieler den Ball auf die Stange, auf der er den Ball zuletzt unter Kontrolle hatte, zurück.<br/></li><li>Zeitlimit: Maximal 10 Sekunden auf der Fünferreihe und 15 Sekunden auf den anderen Reihen, wobei die Torwart- und Abwehrstange als eine Stange betrachtet werden. </li><li>Positionswechsel: Nach einem Tor, nach einem Satz und während eines Time Outs dürfen beide Mannschaften die Positionen wechseln.</li><li>Seitenwechsel: Die Mannschaften dürfen am Ende eines Satzes die Seiten wechseln und haben dafür bis zu 90 Sekunden Zeit. </li><li>Time  Out: Jedes Team darf pro Satz zwei Time Outs nehmen. Ein Time Out dauert maximal 45 Sekunden. Ist der Ball im Spiel, darf nur der Spieler,<br/>der im Ballbesitz ist, ein Time Out nehmen. Ist das Spiel unterbrochen,<br/>dürfen beide Teams ein Time Out nehmen.</li></ul><p style=\"font-size: 13px;vertical-align: baseline;\"><br/></p><p style=\"font-size: 13px;vertical-align: baseline;\"><br/></p><p style=\"font-size: 13px;vertical-align: baseline;\"><br/></p><p style=\"font-size: 13px;vertical-align: baseline;\"><br style=\"font-size: 13px;\"/><!--EndFragment--><br/></p><p><br/></p>'),(29,'Ullrich Liga',29,'<p style=\"font-size: 13px;vertical-align: baseline;\">Mit dem Ullrich Tisch hat neben dem Garlando ein neuer Tisch-Typ in der Zürcher Töggeli-Szene Einzug gehalten. Natürlich organisieren wir auch für unsere Ullrich-Spieler eine Liga.<br/><br/><strong style=\"font-size: inherit;vertical-align: baseline;\">Tischtyp: </strong><br/>Ullrich<br/><br/><strong style=\"font-size: inherit;vertical-align: baseline;\">Mögliche Spielorte:</strong></p><ul style=\"font-size: 14px;\"><li>TFCZ</li><li>UG Dart Club Zürich</li></ul>','<p style=\"font-size: 13px;vertical-align: baseline;\"><b style=\"font-size: inherit;vertical-align: baseline;\">Jeder gegen Jeden</b><br/>Jedes Teams in einer Liga (resp. in einer<br/> Gruppe) spielt gegen sämtliche anderen Teams ein Mal! Bei kleinen Ligen<br/> / Gruppen kann eine Hin- und Rückrunde ausgetragen werden.<br/></p><p style=\"font-size: 13px;vertical-align: baseline;\"><b style=\"font-size: inherit;vertical-align: baseline;\">Drei Sätze plus Entscheidungssatz</b><br/>Das Team, welches zuerst drei Sätze für sich entscheidet, gewinnt das Spiel. Bei Drei zu Null oder Drei zu Eins ist das Spiel beendet.<br/>Steht  es nach vier Sätzen Zwei zu Zwei wird der &#34;Entscheidungssatz&#34; ausgetragen. Um den Entscheidungssatz zu gewinnen, genügen drei Tore! </p><p style=\"font-size: 13px;vertical-align: baseline;\">Es sind also folgende Ergebnisse möglich: 3:0, 3:1, 3:2, 2:3, 1:3, 0:3</p><p style=\"font-size: 13px;vertical-align: baseline;\"><b style=\"font-size: inherit;vertical-align: baseline;\">Punkteverteilung</b><br/>Für  einen Drei zu Null- oder Drei zu Eins - Sieg nach Sätzen erhält die gewinnende Mannschaft drei Punkte. Für einen Drei zu Zwei Sieg nach Sätzen erhält die gewinnende Mannschaft zwei Punkte, die verlierende Mannschaft einen Punkt.<br/></p><p style=\"font-size: 13px;vertical-align: baseline;\"><b style=\"font-size: inherit;vertical-align: baseline;\">Sechs Tore zum Satzgewinn</b><br/>Ein  Satz ist bei beendet sobald ein Team sechs Tore erreicht hat. Es wird nicht auf zwei Tore Abstand gespielt </p><p style=\"font-size: 13px;vertical-align: baseline;\"><b style=\"font-size: inherit;vertical-align: baseline;\">Drei Tore zum Satzgewinn im Entscheidungssatz</b><br/>Der Entscheidungssatz ist beendet sobald ein Team drei Tore erreicht hat. Es wird nicht auf zwei Tore Abstand gespielt </p><p style=\"font-size: 13px;vertical-align: baseline;\"><b style=\"font-size: inherit;vertical-align: baseline;\">Tabelle </b><br/>Die Tabelle wir wie folgt berechnet:</p><ol><li>Anzahl Punkte</li><li>Satzverhältnis</li><li>Direktbegegnung</li></ol>','<p style=\"font-size: 13px;vertical-align: baseline;\">Es wird nach den Ullrich-Regeln gespielt. Diese findet ihr hier: <a href=\"http://www.players4players.de/Regeln.regeln.0.html\" target=\"\" style=\"vertical-align: baseline;\">http://www.players4players.de/Regeln.regeln.0.html</a></p>'),(30,'Töggeli Liga Luzern',30,'<p><span style=\"font-size: 13px;vertical-align: baseline;float: none;\"><b>Tischtyp</b>: </span><br style=\"font-size: 13px;\"/><span style=\"font-size: 13px;vertical-align: baseline;float: none;\">Garlando World Champion und Deluxe!<br/></span><br style=\"font-size: 13px;\"/><span style=\"font-size: 13px;vertical-align: baseline;float: none;\"><b>Mögliche Spielorte:<br/></b></span><span style=\"font-size: 13px;\">Verhandlungen laufen noch...</span></p><h5><b><u>Anmeldung</u></b><br/>Die Anmeldung ist Grundsätzlich auch <b><u>OHNE PARTNER/in</u></b> möglich. <br/>Um dich alleine eintragen zu lassen, schreib uns eine E-Mail und beantworte die folgenden Fragen an:  <br/><br/>info.luzern@fordere.ch<br/>- Spielst du lieber hinten oder vorne?<br/>- Wunschtag/ Abend für die Spiele?<br/>- Wunsch Stärkeklasse von 1 bis 4?</h5><h5><p><span style=\"color: inherit;font-size: 14px;\">Wir werden dich mit einem passenden Partner/in &#34;verkoppeln&#34; :)</span></p><br/></h5>','<p style=\"font-size: 13px;vertical-align: baseline;\"><b style=\"font-size: inherit;vertical-align: baseline;\"><span style=\"font-size: 10pt;vertical-align: baseline;\">Jeder gegen Jeden</span></b><span style=\"font-size: 10pt;vertical-align: baseline;\"><br/>Jedes Team in einer Liga (resp. in einer Gruppe) spielt gegen sämtliche andere Teams zwei Mal!</span></p><p style=\"font-size: 13px;vertical-align: baseline;\"><b style=\"font-size: inherit;vertical-align: baseline;\"><span style=\"font-size: 10pt;vertical-align: baseline;\">Drei Sätze plus Entscheidungssatz </span></b><b style=\"font-size: inherit;vertical-align: baseline;\"><span style=\"font-size: 10pt;vertical-align: baseline;\">(Best of five)</span></b><span style=\"font-size: 10pt;vertical-align: baseline;\"><br/>Das Team, welches zuerst drei </span><span style=\"font-size: 10pt;vertical-align: baseline;\">Sätze auf jeweils 5 Tore für sich entscheidet, gewinnt das Spiel. <br/>Steht es nach vier Sätzen Zwei zu Zwei in den Sätzen wird der &#34;Entscheidungssatz&#34; ausgetragen.<br/>Um den Entscheidungssatz zu gewinnen, genügen drei Tore! Somit sind im fünften Satz folgende Satzergebnisse möglich: 3:0, 3:1, 3:2, 2:3, 1:3, 0:3</span></p><p style=\"font-size: 13px;vertical-align: baseline;\"><b style=\"font-size: inherit;vertical-align: baseline;\"><span style=\"font-size: 10pt;vertical-align: baseline;\">Punkteverteilung</span></b><span style=\"font-size: 10pt;vertical-align: baseline;\"><br/>Für einen Drei zu Null- oder Drei zu Eins - Sieg nach Sätzen erhält die <br/>gewinnende Mannschaft drei Punkte. Für einen Drei zu Zwei Sieg nach <br/>Sätzen erhält die gewinnende Mannschaft zwei Punkte, die verlierende <br/>Mannschaft einen Punkt.</span></p><p style=\"font-size: 13px;vertical-align: baseline;\"><b style=\"font-size: inherit;vertical-align: baseline;\"><span style=\"font-size: 10pt;vertical-align: baseline;\">Fünf Tore zum Satzgewinn</span></b><span style=\"font-size: 10pt;vertical-align: baseline;\"><br/>Ein Satz ist bei beendet sobald ein Team fünf Tore erreicht hat.</span></p><p style=\"font-size: 13px;vertical-align: baseline;\"><b style=\"font-size: inherit;vertical-align: baseline;\"><span style=\"font-size: 10pt;vertical-align: baseline;\">Drei Tore zum Satzgewinn im Entscheidungssatz</span></b><span style=\"font-size: 10pt;vertical-align: baseline;\"><br/>Der Satz ist beendet sobald ein Team drei Tore erreicht hat.</span></p><p style=\"font-size: 13px;vertical-align: baseline;\"><b style=\"font-size: inherit;vertical-align: baseline;\"><span style=\"font-size: 10pt;vertical-align: baseline;\">Tabelle </span></b><span style=\"font-size: 10pt;vertical-align: baseline;\"><br/>Die Tabelle wird wie folgt berechnet:</span><br/>             1.  Anzahl Punkte<br/>             2.  Satzvehältnis<br/>             3.  Direktbegegnung </p><!--EndFragment--><p><br/></p><p><br/></p>','<p style=\"font-size: 13px;vertical-align: baseline;\"><b style=\"font-size: inherit;vertical-align: baseline;\"><span style=\"font-size: 10pt;vertical-align: baseline;\"></span></b></p><ul type=\"disc\" style=\"font-size: 14px;\"><li><span style=\"font-size: 10.5pt;vertical-align: baseline;\">Die oberste und wichtigste Regel bei einem Tischfussball-Spiel: <b style=\"font-size: inherit;vertical-align: baseline;\">Habt Spass und spielt      Fairplay! :)<br/></b></span><b style=\"font-size: inherit;vertical-align: baseline;\"><span style=\"font-size: 10.5pt;vertical-align: baseline;\"></span></b></li><li><span style=\"font-size: 10.5pt;vertical-align: baseline;\">Die Mannschaft mit Heimspiel hat Anstoss und <b style=\"font-size: inherit;vertical-align: baseline;\">bezahlt die erste <br/>Partie</b>. Anschliessend wird abwechselnd bezahlt. Anspiel in den folgenden Sätze hat jeweils der Verlierer des vorangehenden Satzes.</span></li><li><b style=\"font-size: inherit;vertical-align: baseline;\"><span style=\"font-size: 10.5pt;vertical-align: baseline;\">Der Anstoss erfolgt bei der mittleren Figur der Fünferreihe</span></b><span style=\"font-size: 10.5pt;vertical-align: baseline;\">. Unter Beachtung <br/>der “<i style=\"vertical-align: baseline;\">Bereitschafts-Regel</i>”. Bereitschaft bedeutet: Der Ball muss ruhen. Dann fragt der Spieler in Ballbesitz “guet?“, der Gegner bestätigt mit “guet”. Daraufhin beginnt das Spiel.</span></li><li><b style=\"font-size: inherit;vertical-align: baseline;\"><span style=\"font-size: 10.5pt;vertical-align: baseline;\">Mit dem Berühren des Balles durch eine zweite Figur auf der Fünferreihe ist das Spiel frei gegeben</span></b><span style=\"font-size: 10.5pt;vertical-align: baseline;\">. Ab da kann die zweite Figur passen oder schiessen.</span></li><li><b style=\"font-size: inherit;vertical-align: baseline;\"><span style=\"font-size: 10.5pt;vertical-align: baseline;\">Standpässe mit der Fünferreihe sind verboten</span></b><span style=\"font-size: 10.5pt;vertical-align: baseline;\"> dies heisst, der Ball muss vor einem Pass in Bewegung sein.</span><span style=\"font-size: 10.5pt;vertical-align: baseline;\"></span></li><li><span style=\"font-size: 10.5pt;vertical-align: baseline;\">Die Anspielregeln gelten analog auch auf der Zweier- und Dreierreihe für die Spielwiederaufnahme nach Toter Ball, Foul oder Out.</span></li><li><b style=\"font-size: inherit;vertical-align: baseline;\"><span style=\"font-size: 10.5pt;vertical-align: baseline;\">Springt der Ball aus dem Spielfeld</span></b><span style=\"font-size: 10.5pt;vertical-align: baseline;\"> verliert das Team, das zuletzt die Ballkontrolle hatte den Ball. Angespielt wird immer unter Beachtung der <i style=\"vertical-align: baseline;\">Bereitschafts-Regel</i> auf der gegnerischen Zweierreihe.</span></li><li><b style=\"font-size: inherit;vertical-align: baseline;\"><span style=\"font-size: 10.5pt;vertical-align: baseline;\">Ein Ball wird für tot erklärt</span></b><span style=\"font-size: 10.5pt;vertical-align: baseline;\">, wenn er bewegungslos liegt und von keiner Figur erreicht werden kann. (Bitte nicht den Tisch hochziehen um den Ball wieder zu bewegen)</span></li><li><span style=\"font-size: 10.5pt;vertical-align: baseline;\">Ein Ball, der für tot erklärt wird und der <b style=\"font-size: inherit;vertical-align: baseline;\">zwischen den beiden Fünferreihen </b><b style=\"font-size: inherit;vertical-align: baseline;\">liegt</b>, wird unter Beachtung der <i style=\"vertical-align: baseline;\">Bereitschafts-Regel</i> mir der Fünferreihe der Mannschaft, die zuletzt Anspiel hatte wieder ins Spiel gebracht.</span></li><li><span style=\"font-size: 10.5pt;vertical-align: baseline;\">Ein Ball, der für tot erklärt wird und <b style=\"font-size: inherit;vertical-align: baseline;\">zwischen einem Tor und einer Fünferreihe liegt</b>, wird durch die Zweierreihe auf derjenigen Spielhälfte, in der sich der toter Ball befindet, unter Beachtung der <i style=\"vertical-align: baseline;\">Bereitschafts-Regel</i> wieder ins Spiel gebracht.</span></li><li><span style=\"font-size: 10.5pt;vertical-align: baseline;\">Die Figur bzw. die Stange dürfen sich vor und nach der Ballberührung <b style=\"font-size: inherit;vertical-align: baseline;\">maximal um 360° Grad drehen</b>.</span></li><li><b style=\"font-size: inherit;vertical-align: baseline;\"><span style=\"font-size: 10.5pt;vertical-align: baseline;\">Bälle, die ins Tor gehen und dann wieder zurück auf die Spielfläche springen, zählen als Tor.</span></b></li><li><b style=\"font-size: inherit;vertical-align: baseline;\"><span style=\"font-size: 10.5pt;vertical-align: baseline;\">Zu starkes Anschlagen gegen die Bande ist strikt verboten!</span></b><span style=\"font-size: 10.5pt;vertical-align: baseline;\"> Bei starkem Anschlagen verliert der Ball seine natürliche Richtung. Ausserdem kann dadurch der Tisch stark beschädigt werden! Verliert ein Spieler den Ball weil der Gegner zu stark angeschlagen hat (und den Ball dabei nicht berührt hat), kann er ein Foul reklamieren. Danach bekommt der gefoulte Spieler den Ball auf die Stange, auf der er den Ball zuletzt unter Kontrolle hatte, zurück.</span></li><li><b style=\"font-size: inherit;vertical-align: baseline;\"><span style=\"font-size: 10.5pt;vertical-align: baseline;\">Zeitlimit</span></b><span style=\"font-size: 10.5pt;vertical-align: baseline;\">: Maximal <b style=\"font-size: inherit;vertical-align: baseline;\">10 Sekunden</b> auf der Fünferreihe und <b style=\"font-size: inherit;vertical-align: baseline;\">15 Sekunden</b> auf den anderen Reihen, wobei die Torwart- und Abwehrreihe als eine Stange betrachtet werden. </span></li><li><b style=\"font-size: inherit;vertical-align: baseline;\"><span style=\"font-size: 10.5pt;vertical-align: baseline;\">Positionswechsel mit Partner</span></b><span style=\"font-size: 10.5pt;vertical-align: baseline;\">: Man darf den Platz mit dem Partner nach jedem Spielunterbruch wechseln. (Fouls gelten nicht als Spielunterbruch)</span></li><li><b style=\"font-size: inherit;vertical-align: baseline;\"><span style=\"font-size: 10.5pt;vertical-align: baseline;\">Time Out: Es gibt keine Time Outs.</span></b></li></ul><!--EndFragment--><p><br/></p><p><br/></p><p><br/></p>');
