INSERT INTO `forumpost` VALUES (1,85,1,'<p>Hallo zusammen</p><p><b>Wir haben wieder ein Forum! Olé :-)</b><br/></p><p>Die alten Einträge aus dem alten Forum werden wir hier nicht importieren. Dies weil es rein schon von der Struktur nicht passen würde. Sobald es aber die Infrastruktur zulässt werde ich mal versuchen das alte Ding wieder als readonly-Forum brauchbar zu machen...</p><p>Nun wünschen wir freudiges Diskutieren.<br/></p>','2015-05-03 13:21:35'),(2,24,2,'<p>29.4.2015</p><p>1. schöb / tom</p><p>2 .martin z / hr</p><p>3. oli g. / patrick</p><p>4. nino / markus</p><p><br/></p><p>6.5.2015</p><p>1. nino / hr</p><p>2. raphael / kimon</p><p>3. greg / hans</p><p>4. virgilio / stefan  </p><p><br/></p><p>Freitag beginnt das Zürich Open im TFCZ</p><p>19 h Pro/Am</p><p>20 h Mixed</p><p>20 h Neuling Doppel</p><p><br/></p><p>Man kann alles ohne Lizenzgebühren spielen.</p>','2015-05-07 14:41:45'),(3,24,2,'<p>Resultate ab Jan 15</p><p>22.4.2015</p><p>1.Greg / hr</p><p>2.Leu / Tom</p><p>3.Kathia / Markus</p><p>4.Kimon / Moritz</p><p><br/></p><p>15.4.2015</p><p>1.Zimi / Marco</p><p>2.hr /Jef</p><p>3.Patrick /Virgilio</p><p>4.Röbi / Resi</p><p><br/></p><p>8.4.2015</p><p>1.hr / Patrick</p><p>2.Martin / Virgilio</p><p>3.Berner / Jef</p><p>4.Reto / Markus</p><p><br/></p><p>1.4.2015</p><p>1.Resi / hr</p><p>2.Hugo / Röbi</p><p>3. Jef / Ole</p><p>4.Oli Z. / Flo</p><p><br/></p><p>25.3.2015</p><p>1.Nino / Leu</p><p>2.Oli G. / Berner</p><p>3.Hiwi / Röbi</p><p>4.Markus / Virgilio</p><p><br/></p><p>18.3.2015</p><p>1.Kimon / markus</p><p>2.Ole / Oli Z.</p><p>3.Tom / Hiwi</p><p><br/></p><p>11.3.2015</p><p>1.hr / Virgilio</p><p>2.Miguel / Kimon</p><p>3.Leu / greg</p><p>4.Hans B. / Röbi</p><p><br/></p><p>4.3.2015</p><p>1. Oli Z. / Leu</p><p>2. hr / Markus</p><p>3. Röbi / Virgilio</p><p>4. Resi / Andre</p><p><br/></p><p>18.2.2015</p><p>1. Oli Z. / hr</p><p>2. Kimon / Jef</p><p>3. Resi / Markus</p><p>4. Röbi / Hiwi</p><p><br/></p><p>11.2.2015</p><p>1. Oli G. / Götz</p><p>2. Kimon / Hiwi</p><p>3. Claudia / Leu</p><p>4. Ole / Resi</p><p><br/></p><p>28.1.2015</p><p>1. Oli G. / Ole</p><p>2. Leu / Virgi</p><p>3. hr / Claudia</p><p>4. Tom / Jef</p><p><br/></p><p>21.1.2015</p><p>1. Oli G. / Hugo</p><p>2. Roli / André</p><p>3. Markus / Schöb</p><p>4. Kimon / Tom</p><p><br/></p><p>13.1.2015</p><p>1. Oli G. / domenico</p><p>2. hr / Jef</p><p>3. Nini / Resi</p><p>4. Kimon / Lukas</p><p><br/></p><p>7.1.2015</p><p>1. hr / Oli Z.</p><p>2. Greg / Hans</p><p>3. Tom / Oli G.</p><p>4. resi / jef</p>','2015-05-07 14:45:52'),(4,2971,3,'<p>&#34;Dieses Jahr könnt ihr bis zum 17. Mai Liga Spiele (Ullrich oder Garlando) durchführen und eintragen. Nach diesem Datum werden alle nicht gespielten Partien als Forfait-Sieg für das Auswärtsteam gewertet. D.h. 4:0.&#34;<br/>Beachtet, um für den Finaltag zugelassen zu werden dürft ihr maximal zwei Spiele nicht gespielt haben!<br/><br/>Wäre es nicht fairer, wenn man die Partien nicht wertet? Sonst kann man ja einfach 2 Auswärtspiele auslassen und somit 6 Punkte einheimsen. Das verfälscht schlussendlich die Rangliste...<br/><br/>Gruss Carlo<br/></p>','2015-05-13 17:41:22'),(5,85,3,'<p>Einheimsen geht so einfach nicht, da man nur die Punkte für nicht gespielte Auswärtsspiele erhält. Falls ein Team uns mitteilt, dass die anderen mehrmals angefragt wurden aber das Spiel dennoch nicht zustande gekommen ist werden wir natürlich die Punkte an das Heimteam vergeben. Dies benötigt aber eine Intervention der entsprechenden Teams.</p><p>Auf den ersten Blick finde ich aber deine Idee, dass entsprechende Spiele für beide Teams als 0-Spiele definiert werden als besser.. ich leite dies mal an das Modus Team weiter. Die werden sich sicher in Kürze hier melden :-)</p><p><br/></p>','2015-05-13 20:18:40'),(6,24,2,'<p>13.5.2015</p><p>1. marco /hr</p><p>2. virgilio / oli g.</p><p>3. claudia / kimon</p><p>4. andy / jef</p>','2015-05-15 09:32:28'),(7,24,2,'<p>20.5.2015</p><p>1. tom / virgilio</p><p>2. markus / mirco</p><p>3. oli z / hr</p><p>4. oli g. / charly</p>','2015-05-21 08:13:45'),(8,181,3,'<p>Würde ich auch als die fairere Variante betrachten, da 6Mnt ja sicher ausreichend sein sollten um die jeweiligen Spiele absolvieren zu können. Sonst können gewisse Teams mit Auswärtsspielen bewusst auf Taktik spielen.</p>','2015-05-26 23:09:33'),(9,85,3,'<p>Das Modusteam will sich wohl hier nicht melden. Darum ich nochmals :-)</p><p>Dieses Jahr müssen wir die Regelung beibehalten. Dies weil wir dies so kommuniziert haben. </p><p>Leider trifft es genau in der 2. Ullrich Liga ein Team welches durch diese Regelung nicht am Finaltag teilnehmen könnte. In Absprache mit dem Modusteam wurde nun festgelegt, dass sich in der 2. Ullrich Liga sämtliche Teams für den Finaltag qualifizieren.</p><p>Ab dem nächsten Jahr wird hier eine bessere Lösung gesucht. Ich denke keine Punkte trifft es nicht schlecht...</p>','2015-05-27 15:17:39'),(10,24,2,'<p>27.5.2015</p><p>1. roli / röbi</p><p>2. patrick / kimon</p><p>3. markus / hr</p><p>4. nino / virgilio</p>','2015-05-28 08:55:22'),(11,24,2,'<p>3.6.2015</p><p>1. virgilio / nino</p><p>2. tom / hr</p><p>3. dina / röbi</p><p>4. leu / jef</p>','2015-06-04 08:43:09'),(12,85,4,'<p>Hallo zusammen</p><p>Bis jetzt habe ich noch nicht sehr viel Feeedack zum Finaltag erhalten. Wenn natürlich für euch alles perfekt war ist das super und wir belassen alles so. Wenn ihr aber irgend etwas geändert haben wollt bitten wir euch dies uns zu melden. </p><p>Hier mal was mir gerade einfällt oder was ich aus persönlichen Gesprächen bereits aufgenommen habe:</p><ul><li>Zeitplan war schlecht! D.h. wir waren viel zu spät fertig. Dadurch gab es kein Rangverlesen. Nächstes Jahr müssen wir hier etwas am Modus resp. an der Turnierleitung anpassen. (Vielleicht führen wir einfach ein, dass Pio und Yves nicht mehr alles spielen dürfen :-p)</li><li>Kommunikation nach drassen! Ich glaube 90% der Spieler die erneut aufgerufen werden mussten waren einfach draussen und haben so den Aufruf nicht gehört. Dieses Problem ist bereits mit dem GZ besprochen. Nächstes Jahr haben wir draussen auch einen Lautsprecher :-)</li></ul><p>Falls euch sonst noch was einfällt, einfach hier schreiben oder uns direkt über die bekannte E-Mail kontaktieren :-)</p>','2015-06-05 20:06:57'),(13,24,2,'<p>10.6.2015</p><p>1. oli g. / fabio p.</p><p>2. miguel / hr</p><p>3. martin z. / resi</p><p>4. gabriel / jörg</p>','2015-06-11 09:17:19'),(14,24,2,'<p>17.6.2015</p><p>1. oli g. / esi</p><p>2. hans / hr</p><p>3. schöb / marco</p><p>4. resi / ursin</p>','2015-06-18 09:58:14'),(15,24,2,'<p>24.6.2015</p><p>1. kimon / tom</p><p>2. fabio p / hr</p><p>3. markus / hans</p><p>4. oli g / oli z</p>','2015-06-25 10:31:15'),(16,24,2,'<p>1.7.2015</p><p>1. matt / roger</p><p>2. gabriel / hr</p><p>3. miguel / kimon</p><p>4. leu / esi</p>','2015-07-02 09:37:06'),(17,278,4,'<p>Hoi Zäme</p><p>Ich geb hier mal meinen Senf dazu. </p><p>Also positiv: </p><ul><li>Coole Stimmung</li><li>Super Verpflegung</li><li>Location optimal</li><li>Dass es diesen Anlass überhaupt gibt :)</li><li>Organisation war super, merci :)</li></ul><p>Optimierungspotential:</p><ul><li>Es hat einiges zu spät begonnen (hat der Event je pünktlich angefangen? :)) Als es begann, hatten einige Teams gleich Pause, da die Gegner nicht aufgetaucht sind. Hier mein Vorschlag: Man könnte eine Anmeldung vor Ort einführen: Jedes Team, das sich, bis sagen wir 12:30 Uhr beim Spielmaster angemeldet hat (persönlich, in Fleisch und Blut sozusagen), wird eingetragen und macht am Turnier mit. Ich weiss nicht, ob das ein riesen Aufwand für die Spielleitung ist, die Teams einzutragen (würde ich sonst also übernehmen :)) und ob die Auslosung dann auf Klick passieren kann, oder ob das eine grosse Vorbereitung braucht. Je nachdem wären dann wirklich nur die Teams in der Tabelle, die auch wirklich da sind und man könnte um 13:00 pünktlich starten, und es gäbe nicht gleich zu Beginn einige Leerzeiten und ein Durcheinander und sowieso...</li><li>Jap, es sitzen natürlich alle draussen. Und jap, dann ists ein bitzeli mühsam die Teams rechtzeitig zu erreichen. Lautsprecher find ich gut, Bildschirm mit demselben Inhalt wie auf der Leinwand drinnen fänd ich noch besser. </li></ul><p>LG, Co</p><p><br/></p>','2015-07-08 13:48:24'),(18,24,2,'<p>8.7.2015</p><p>1. hugo / roger</p><p>2. ursin / röbi</p><p>3. heiko / leu</p><p>4. jef / oli z</p>','2015-07-09 09:37:10'),(19,85,4,'<p>Hallo Corinne</p><p>Danke für dein Feedback! </p><p><span>Ob es jemals rechtzeitig angefangen hat weiss ich nicht, aber diesese Jahr hatten wir doch etwas sehr viel Verspätung. Wir haben den Punkt aufgenommen und versuchen hier nächstes Jahr eine optimale Lösung zu finden.</span><br/></p><p>Draussen wir nächstes Jahr schonmal sicher ein weiterer Lautsprecher stehen. Ob wir einen zweiten Beamer oder einen TV für draussen organisieren können müssen wir schauen.</p><p><br/></p>','2015-07-15 10:41:39'),(20,24,2,'<p>15.7.2015</p><p>1. simon / kimon</p><p>2. leu / virgilio</p><p>3. tom / hr</p><p>4. patrick / roger</p>','2015-07-16 09:36:11'),(21,24,2,'<p>22.7.2015</p><p>1. schöb / jörg</p><p>2. röbi / jef</p><p>3. roger / hr</p><p>4. zimi / david</p><p>26 Spieler</p>','2015-07-23 09:02:02'),(22,24,2,'<p>29.7.2015</p><p>1. raphael / kimon</p><p>2. roger / ursin</p><p>3. fabrizio / oli z</p><p>4. vinci / nino</p><p>26</p>','2015-07-30 09:00:47'),(23,24,2,'<p>5.8.2015</p><p>1. roberto p / dina</p><p>2. matt / reto</p><p>3. claudia / fabio dS</p><p>4. gianni / roger</p><p>24</p>','2015-08-06 11:37:37'),(24,24,2,'<p>12.8.2015</p><p>1. fabio dS / daniel</p><p>2. oli g / hr</p><p>3. virgilio / gianni</p><p>4. röbi pf / fabrizio</p><p>18</p>','2015-08-13 09:30:05'),(25,24,2,'<p>19.8.2015</p><p>1. fabio dS / hr</p><p>2. chris / oli g</p><p>3. sille / markus</p><p>4. kimon / oli z</p><p>24</p>','2015-08-20 09:11:01'),(26,24,2,'<p>26.8.2015</p><p>1. kimon / leu</p><p>2. gabriel / hr</p><p>3. oli z / jef</p><p>4. virgilio / roger</p><p>18</p>','2015-08-27 09:08:51'),(27,24,2,'<p>2.9.2015</p><p>1.fabio dS  / resi</p><p>2. kimon / roger</p><p>3. oli g / nino</p><p>4. pascal / leu</p><p>26</p>','2015-09-03 09:59:48'),(28,24,2,'<p>9.9.2015</p><p>1. jef / hr</p><p>2. greg / resi</p><p>3. gianni / markus</p><p>4. oli z / kimon</p><p>24</p>','2015-09-10 08:42:04'),(29,24,2,'<p>16.9.2015</p><p>1. schöb / resi</p><p>2. claudia / hr</p><p>3. roger / zimi</p><p>4. roberto p / ursin</p><p>18</p>','2015-09-17 09:13:09'),(30,24,2,'<p>23.9.2015</p><p>1. greg / hr</p><p>2. matt / patrick</p><p>3. kimon / marco</p><p>4. matthias / roger</p><p>20</p>','2015-09-24 08:53:09'),(31,24,2,'<p>30.9.2015</p><p>1. zimi / marco</p><p>2. resi / fabio dS</p><p>3. matt / david</p><p>4. claudia / hr</p><p>22</p>','2015-10-01 09:14:05'),(32,24,2,'<p>7.10.2015</p><p>1. andy / leu</p><p>2. ursin / hr</p><p>3. oli / claudia</p><p>4. roberto p / roger</p><p>20</p>','2015-10-08 08:57:45'),(33,181,5,'<p>Den nachfolgenden Artikel habe ich heute im 20min gesichtet ;)</p><p>http://www.20min.ch/schweiz/zuerich/story/Statt-aufs-Handy-gestarrt-wird-getoeggelt-16599134</p>','2015-10-14 09:43:29'),(34,85,5,'<p>Wir durften auch noch beim Radio24 vorbeischauen :-)</p><p>http://www.radio24.ch/podcast/download/2463482.mp3</p>','2015-10-17 10:48:16'),(35,24,2,'<p>14.10.2015</p><p>1. leu / oli g.</p><p>2. roberto p / fabio dS</p><p>3. resi / kimon</p><p>4. röbi / claudia</p><p>14</p><p><br/></p><p>21.10.2015</p><p>1. patrick / roli</p><p>2. zimi / hugo</p><p>3. markus / claudia</p><p>4. jef / oli z</p><p>18</p><p><br/></p><p><br/></p>','2015-10-23 16:27:27'),(36,24,2,'<p>28.10.2015</p><p>1. zuba / markus</p><p>2. tom / hr</p><p>3. fabrizio / roli</p><p>4. röbi / schöb</p><p>16</p>','2015-10-29 08:55:27'),(37,24,2,'<p>4.11.2015</p><p>1. jef / roger</p><p>2. patrik / resi</p><p>3. chris / ursin</p><p>4. markus / nino</p><p>16</p>','2015-11-05 09:33:02'),(38,24,2,'<p>11.11.2015</p><p>1. hans / fabio dS</p><p>2. giani / hr</p><p>3. miguel / david</p><p>4. leu / patrick</p><p>24</p>','2015-11-12 09:30:06'),(39,24,2,'<p>18.11.2015</p><p>1. hans / hr</p><p>2. claudia / zuba</p><p>3. markus / hussein</p><p>4. ursin / miguel</p><p>14<br/></p>','2015-11-19 09:00:34'),(40,24,2,'<p>25.11.2015</p><p>1. david / oli g.</p><p>2. nino / zimi</p><p>3. roger / ursin</p><p>4. pascal / hr</p><p>17</p>','2015-11-26 09:43:35'),(41,24,2,'<p>2.12.2015</p><p>1. cristina / kimon</p><p>2. leu / hans</p><p>3. zimi / oli g.</p><p>4. roger / jef</p><p>18</p>','2015-12-03 08:52:47'),(42,24,2,'<p>9.12.2015</p><p>1. oli g. / hans</p><p>2. cristina / hr</p><p>3. matt / resi</p><p>4. röbi / marco</p><p>16</p>','2015-12-10 08:39:11'),(43,24,2,'<p>16.12.2015</p><p>1. markus / heiko</p><p>2. roger / hr</p><p>3. nino / resi</p><p>4. jef / claudia</p><p>14</p>','2015-12-17 09:19:31'),(44,24,2,'<p>23.12.2015</p><p>1. röbi / hr</p><p>2. tom p. / resi</p><p>3. roger / hans</p><p>4. mich / oli z</p><p>12</p>','2015-12-28 08:50:36'),(45,24,2,'<p>6.1.2016</p><p>1. oli g. / claudia</p><p>2. oli z / hr</p><p>3. hans / leu</p><p>4. virgilio / nino</p><p>20</p>','2016-01-07 10:23:53'),(46,24,2,'<p>13.1.2016</p><p>1. oli g. / virgilio</p><p>2. michi / markus</p><p>3. roger / greg</p><p>4. claudia / oli z</p><p>12<br/></p>','2016-01-14 09:30:57'),(47,32,6,'<p>Hallo</p><p><br/></p><p>Zurzeit sind Überlegungen im Gang, nach welchem Modus am Finaltag gespielt werden soll. Es werden soviele Teams wie noch nie den Finaltag bestreiten, was die Sache nicht einfach macht. Ein Doppel k.o. scheint aus Zeitgründen nicht möglich.</p><p><br/></p><p>Ich bin nicht im Modusteam, doch da eine Vorrunde im Schweizer System mit anschliessendem single k.o. bo3 droht, muss ich meinen Senf dazu abgeben.</p><p><br/></p><p>Die Vorrunde wird schon während der Saison gespielt. Diese sollte nicht derart abgewertet werden, indem nochmals eine Vorrunde am Finaltag gespielt werden muss. Diese vergeudet nur extrem viel Zeit und schüttelt die Tabelle vollkommen durch. Denn im single k.o. würde es nach der Vorrunde wohl gleich zu harten duellen kommen, da die Finaltag-Vorrunde für einige nur einem lockeren Einspielen verkommt. Zudem wird die Saison-Vorrunde damit belanglos. Künftig brauchen wir keine Vorrunde während der Saison mehr zu spielen, da am Finaltag alles von vorn beginnt. Nein, man sollte unbedingt verhindern, dass die Vorrunde an Stellenwert einbüsst, da doch die Vorrunde UND der Finaltag die Liga ausmacht. </p><p><br/></p><p>Die Teams welche die Vorrunde gut abschliessen, sollen belohnt werden. Sei es mit Freilos oder mit ner guten Setzung. </p><p><br/></p><p>Wenn Doppel KO nicht geht, soll es lieber ein gesetztes Single K.O. best of 5 geben. Dies ist gut planbar und jedes team hätte mindestens 3 sätze (und das dyp?) gespielt. Aufgrund der vielen Teams muss eine solche Massnahme in Kauf genommen werden, wenn das Ende noch vor Mitternacht angepeilt werden soll (was ich absolut als richtig erachte)</p><p><br/></p><p>Möchte ein Team mehr spielen, sollten diese eben die Bar-Master spielen und bei frühem Ausscheiden das DYP/crazy dyp.</p><p><br/></p><p>Alternativ schlage ich vor, dass wenigstens die ersten 4 bis 6 Teams von vorrunden-spielen ausgenommen werden, die restlichen Teams (5/7 bis 16) könnten ja um die weiteren verbleibenden Plätze im 8er Tableau kämpfen. Sollten teams dann wider erwarten gleich im ersten single KO spiel ausscheiden, können sie sich immerhin mit dem 5. Schlussrang trösten. Es darf aber einfach nicht sein, dass die Saison-Vorrunde zur Makukatur verkommt.  </p><p>Es gibt aber sicher noch weitere Modi, welche Sinn machen, jedoch bestimmt nicht mit einer kompletten Neuauflage einer Vorrunde mit anschl. Single KO bo3.</p><p>Wichtig wird auch sein, dass die Turnierleitung möglichst effizient arbeiten kann. </p><p><br/></p><p>Gruess zimi</p>','2016-01-26 23:39:57'),(48,32,6,'<p>*Makulatur</p>','2016-01-26 23:42:50'),(49,24,2,'<p>20.1.2016</p><p>1. nino / hr</p><p>2. claudia / oli g.</p><p>3. matt / markus</p><p>4. nicole / zuba</p><p>18</p><p>27.1.2016</p><p>1. zuba / markus</p><p>2. hans / leu</p><p>3. nino / hr</p><p>4. nicole / patrick</p><p>18</p><p><br/></p><p><br/></p>','2016-01-28 09:32:54'),(50,85,6,'<p>Das ist korrekt! </p><p>Wir haben viel aus dem letzten Finaltag gelernt. Da haben wir leider bereits verspätet begonnen und dann auch noch ein paar organisatorische Fehler gemacht. Alles zusammen hat letztes Jahr zu einer Verspätung von (glaube) so 4h geführt...</p><p>Dieses Jahr werden massiv mehr Teams am Finaltag teilnehmen. Natürlich werden wir versuchen die Fehler vom letzten Jahr nicht zu wiederholen. Aber ich bin der Meinung, dass wir ohne eine Anpassung am Modus keine Chance haben in den gegebenen Rahmenbedingungen das Turnier durchzuführen.</p><p>Vielleicht kurz ein paar Worte zu genau diesen Rahmenbedingungen:</p><ul><li>Beginn nicht vor 11:00 (lieber später)</li><li>Rangverkündigung um spätestens 23:00</li><li>Anzahl Garlando Tische: 19</li><li>Anzahl Ullrich Tische: 4</li></ul>Es gibt nun diverse Varianten die gespielt werden können:<p><b>Variante 1: Doppel KO</b><br/>Zeitlich (aus meiner Sicht) unmöglich mit den gegebenen Randbedingungen. Problematisch ist vor allem auch die mögliche Blockade zwischen Ullrich und Garlando</p><p><b>Variante 2: Alle spielen Vorrunde, dann Single KO Best of 3</b><br/>Die Saison wird hier nur minim gewichtet, da alle in einer Vorrunde antreten müssen. Es wird sicher kein Schweizer System gespielt sondern anhand der Saison entsprechend Gesetzt. Es kommen max. 50% der Vorrunden-Teilnehmer in das Single-KO-Feld.</p><p><b>Variante 3: Die ersten N Teams sind gesetzt, alle anderen spielen Vorrunde um die restlichen Plätze im Single KO Best of 5</b><br/>Die Sieger der Saison haben den Vorteil gleich gesetzt zu sein. Die Top Teams treffen also nicht zu früh aufeinander. Durch den Zeitgewinn in der Vorrunde kann evtl. ein Best of 5 im Single-KO gespielt werden. Auch hier in der Vorrunde kein Schweizer System! Problematisch kann sein, dass die Top-Teams gleich mit einem Single-KO match einsteigen.</p><p><b>Variante 4: Single KO von Anfang an für alle</b><br/>Je nachdem hat man nur 1 Spiel und man ist draussen. Zeitlich und organisatorisch super!</p><p>Es gilt nun irgendwie einen Kompromiss zu finden um für möglichst alle Spieler einen passenden Modus zu gestalten welcher die grösste Sicherheit bietet um 23:00 das Turnier beendet zu haben und doch am Schluss der Beste gewinnt.</p><p>Natürlich sind wir auch offen, falls jemand noch eine Variante 5 kennen sollte :-)</p><p><br/></p>','2016-01-28 12:43:13'),(51,2938,6,'<p>Bin für Variante 3 oder 4. Variante 3 wäre mir sicher lieber, aber ich weiss nicht, wie viel Zeit man damit effektiv sparen kann. Das wisst ihr sicher besser.</p><p>------</p><p>Ich weiss, folgendes sprengt vielleicht den Ramen der Diskussion ein wenig, aber ich möchte dies trotzdem hier anbringen:</p><p>Was ich bisher am Finaltag geschätzt habe ist, dass man immer mindestens 2 Spiele machen konnte. Wenn ich mir den kompletten Tag freihalte und mich aufs spielen freue, dann würde es mich ein wenig frustrieren, wenn ich nach dem ersten Spiel eigentlich wieder gehen kann. Selbst wenn ich noch beim Dyp teilnehmen wollte, müsste ich unter Umständen einfach ewig warten.</p><p>Die Spiele unter der Saison sind weitestgehend irrelevant. Einerseits finde ich es gut, dass die Chancen am Finaltag für alle gleich sind, andererseits führt das halt dazu, dass die Spiele während der Saison an Bedeutung verlieren. Im Moment habe ich den Eindruck, dass es relativ viele Teams mit noch keinen Spielen hat. Ich mag falsch liegen, aber ich sehe einige Teams, die wahrscheinlich irgendwann aussteigen. Warum erwähne ich dies?</p><p>Ich würde tendenziell die \'Qualifikationslinie\' anheben. In der aktuellen Saison kann man das sicher nicht mehr tun, das wäre unfair. Aber für die nächste Saison wäre es vielleicht eine Überlegung wert. Über die Anzahl Qualifikationen kann man vielleicht auch steuern, dass man am Finaltag einen Modus spielen kann, bei dem möglichst jedes Team 2+ Spiele hat. Letztenendes bin z.B. ich bei der Liga dabei, weil ich gern spiele. Ehrgeiz ist da, aber mir ist es lieber ich kann 1 Spiel mehr spielen als zuschauen zu müssen.</p><p>Der Finaltag umfasste im Minimum 2 Spiele bisher. Im Gegensatz zu der ganzen Saison sind das nicht viele. Ich fände es besser man lässt weniger Teams für 2+ Spiele kommen, als viele Teams, wobei ein relativ grosser Teil (hab nicht gerechnet) nur 1 Spiel hat.</p>','2016-01-28 17:13:23'),(52,123,6,'<p>Wurde schon mal in Betracht gezogen, den Ullrich-Finaltag am Vorabend im TFCZ auszuspielen?</p><p>Damit wären Blockaden unmöglich und die Siegerehrung könnte trotzdem am Samstag durchgeführt werden.</p><p><br/></p><p>Einem Single-KO-System würde ich Doppel-KO mit nur einem Satz (auf 7 oder 10) vorziehen.</p><p>Ausserdem wäre es wohl sinnstiftend, das DYP nur für die ausgeschiedenen Mannschaften durchzuführen.<br/></p>','2016-01-29 08:22:23'),(53,85,6,'<p>Nächstes Jahr werden wir uns definitiv die Überlegung machen, dass wir weniger Teams für den Finaltag zulassen. Entsprechend erhält auch die Vorrunde wieder mehr Spannung. Wie Kevin bereits erwähnt hat, finde ich es aber für dieses Jahr keine gute Idee diese Linie noch zu korrigieren!</p><p>Es wird wieder ein DYP-Turnier für alle Ausgeschiedenen wie auch &#34;Nicht-Liga&#34; Spieler geben. Startzeitpunkt wird festgelegt je nach freier Anzahl der Tische. Wenn wir ein Crazy-DYP spielen hätten wir hier z.B. die Möglichkeit bei 2-3 freien Tischen bereits mit dem DYP zu starten.. einsteigen kann man ja bei diesem Modus immer. Natürlich dürfen wie letztes Jahr nur die ausgeschiedenen Spieler teilnehmen... zumindest war dies bereits letztes Jahr die Idee! Warum wir das nicht geschafft haben ist mir auch noch ein Rätsel :-/</p><p>Die Idee den Ullrich Finaltag in den TFCZ zu verschieben ist für mich eine Abweretung der Ullrich Liga. Weiter finde ich es problematisch dass wir bereits einen Termin für den Finaltag definiert haben. Nicht alle sind so flexibel! Ich werde aber diese Idee noch in den Entscheidungsprozess miteinbringen! Danke!</p><p><br/></p><p><br/></p><p><br/></p>','2016-01-29 16:33:32'),(54,456,7,'Hallo Leute,<br/><br/>Habe mir eined Garlando gekauft und natürlich Bärenherz Bälle. <br/>Damit diese sich von Anfang an gut spielen lassen, wollte ich sie abschleifen. <br/>Hat das schon mal jemand von Euch gemacht? Wie geht das am einfachsten? <br/><br/>Danke im Voraus und Gruss<br/>Philip<br/><p><br/></p>','2016-02-02 13:58:13'),(55,456,7,'<p>ich nochmals, habs gegoogeltund leider nix schlaues gefunden. nur dass man das wohl aufrauhen nennt und nicht abschleifen... &#128514;</p><p>jemand ein tip?</p><p><br/></p><p>danke</p><p>philip</p>','2016-02-02 21:20:48'),(56,21,6,'<p>Variante 3 und 4 sind ganz ok. Ich favorisiere die 4te, weil so die lange Saison deutlich stärker gewichtet wird. Zeitlich gesehen ist das ohnehin die einzig vernünftige Lösung, weil die Ullrich-Liga einige andere Spiele blockieren wird. <span>Und diejenigen, denen ein Spiel zu wenig ist, die sollen am Dyp teilnehmen.</span></p><p><br/></p><p><br/></p>','2016-02-03 00:00:56'),(57,85,7,'<p>Frag sonst mal im TFCZ bei HR (info@tfcz.ch) nach. Ich glaube er prepariert die Bälle ebenfalls.</p>','2016-02-03 13:20:40'),(58,456,7,'<p>Danke Stefan!<br/></p>','2016-02-03 13:51:52'),(59,24,2,'<p>3.2.2016</p><p>1. cristina / roger</p><p>2. oli g / hr</p><p>3. nick / röbi</p><p>4. jef / nino</p><p>14</p><p><br/></p>','2016-02-04 09:09:57'),(60,85,6,'<p>Also, wir haben uns gestern in der Poli Bar getroffen und den Modus für den Finaltag definiert. Es wird wie folgt gespielt:</p><ul><li>Alle Teams die sich für den Finaltag qualifiziert haben spielen eine Vorrunde. Dabei werden wir Gruppen à 4-5 Teams bilden die jeweils anhand der Platzierung während der Saison eingeteilt werden. Gespielt wird 1 Satz auf 7 (zwei Abstand bis 10). z.B: würde in einer Gruppe der 1. 5. 12. und 16 spielen. </li><li>Die besten 8 (resp. 16 bei den grösseren Ligen) qualifizieren sich für das Single KO. Dieses wird in einem Best of Three gespielt. </li><li>Sämtliche Ligen werden gleich gespielt (Ullrich und Garlando).</li></ul><p>Somit hoffen wir, dieses Jahr den Finaltag in einem zeitlichen Rahmen abschliessen zu können. Wir werden nun noch einige Szenarien durchrechnen um zu prüfen ob gegebenenfalls die Finals Best of Five gespielt werden können und um die optimale Gruppengrösse der Vorrunde zu evaluieren.</p><p>Für das nächste Jahr wird es folgende Anpassungen geben 8insofern auch nächstes Jahr wieder so eine grosse Anzahl Teams teilnimmt):</p><ul><li>Wir werden versuchen eine grössere Location zu erhalten. Dies ist aber ein sehr schwierige (finanziell gesehen) unterfangen. </li><li>Wir werden den Strich für die Finaltag-Qualifikation vor der Saison anhand des Finaltag-Modus bestimmen. D.h. es kommen weniger Teams an den Finaltag!</li></ul>','2016-02-06 14:45:18'),(61,24,2,'<p>10.2.2016</p><p>1. resi / hr</p><p>2. dina / virgilio</p><p>3. schön / heiko</p><p>4. röbi  / jef</p><p>18</p><p><br/></p>','2016-02-11 09:02:45'),(62,3154,8,'<p>Salut zusammen</p><p>auf folgender youtube Seite findet ihr die aktuellen Begegnungen &#34;Der Grenzgänger&#34;:</p><p><a href=\"https://www.youtube.com/channel/UCj5ABs9rtGBw-aePWI_LwBQ/videos?view=0&amp;sort=dd&amp;shelf_id=0\">https://www.youtube.com/channel/UCj5ABs9rtGBw-aePWI_LwBQ/videos?view=0&amp;sort=dd&amp;shelf_id=0</a><br/></p><p>Weitersagen, Teilen und Anschauen erwünscht!</p><p>Danke und sportliche Grüsse</p><p>Holger &amp; Marcel (Die Grenzgänger)</p>','2016-02-11 20:25:47'),(63,181,6,'<p>Schade wird die Qulifikation in der Vorrunde nicht mehr gewichtet und nur Single-KO gespielt (Doppel-KO macht mehr Spass). Man hätte ja die ersten vier jeder Gruppe setzen können und den Rest eine erneute Vorrunde mit Ausscheiden spielen lassen - so hätte die Anzahl Teams nochmals reduziert werden können. Best of 3 finde ich gut, das hat sich beim letzten Finaltag auch bewährt. Die Anpassung der Finaltag Qualifikationsgrenze für die nächste Saison ist wohl die einzige Lösung dieses Problem effektiv in den Griff zu bekommen (auch müsste man die Anzahl Spiele bis zur Halbzeit effektiver durchsetzen, nicht dass es am Schluss wieder sehr eng wird und auch hier ein verbindliches Soll definiert ist).</p>','2016-02-14 16:10:08'),(64,24,2,'<p>17.2.2016</p><p>1. zimi / hans</p><p>2. claudia / hr</p><p>3. miguel / resi</p><p>4. michi / cristian</p><p>20</p>','2016-02-18 09:18:43'),(65,260,9,'<p>Was geschieht mit den Teams die das Halbzeit Ziel, (die hälfte aller Spiele) nicht erreicht haben?<br/></p>','2016-02-20 10:01:26'),(66,24,2,'<p>24.2.2016</p><p>1. resi / röbi</p><p>2. hans / oli z</p><p>3. roger / cristina</p><p>4. cristian / roberto p</p><p>20</p>','2016-02-25 08:48:05'),(67,123,9,'<p>Das würde mich auch interessieren.</p><p>Nach acht Tagen ohne Antwort denke ich mal, es passiert nichts.</p><p><br/></p>','2016-02-28 16:38:29'),(68,260,9,'<p>Ich finde, man sollte diese Regel streichen, wenn es ja sowieso keine Sau interessiert. Regeln aufstellen die keiner befolgen muss braucht es ja nun wirklich nicht.<br/></p>','2016-02-29 20:11:49'),(69,85,9,'<p>Wir haben die Regel vor so 2 Jahren angepasst. D.h. das Modusteam behält sich zur Halbzeit vor, Teams auszuschliessen.</p><p>Wir haben entsprechend auch ca 5 Teams gelöscht!</p><p>Auf jeden Fall behalten wir die Wenigspieler im Auge und werden auch in Zukunft entsprechende Sanktionen vornehmen!</p>','2016-02-29 22:35:17'),(70,123,9,'<p>Also ich sehe bei uns noch ein Team mit null Spielen. </p><p>Weniger geht eigentlich nicht, von daher gebe ich Roger Recht.<br/></p>','2016-03-01 16:43:25'),(71,85,9,'<p>Stimmt!</p><p>Wir sind noch mit einigen Teams in Kontakt!</p><p>Wir sind logischerweise daran interessiert, die Teams anstatt sie einfach rauszuwerfen zum Spielen anzuhalten. Nur wenn dies nicht klappt kommt es zu einer Disqualifikation!</p><p>Die Halbzeit ist ein schwieriges Thema. z.b. für Studenten ist es jeweils schwierig bereits so viele Spiele abzumachen.. Die starten aber meist nach der Halbzeit so richtig in die Saison...</p><p>Wir bleiben auf jeden Fall an den Teams dran :-)</p>','2016-03-03 08:45:18'),(72,24,2,'<p>2.3.2016</p><p>1. kimon / matt</p><p>2. hans / david</p><p>3. nicole / hr</p><p>4. tom / reto</p><p>22</p>','2016-03-03 08:55:43'),(73,85,9,'<p>Anmerkung: Das streichen der Regel würde dazu führen, dass wir keine Möglichkeit mehr haben Teams zu disqualifizieren. resp. es sieht dann sehr willkürlich aus. Mit der aktuellen Regel kann das Modusteam Teams, die noch nicht die Hälfte haben und auch nicht weiter auf Anfragen eingehen problemlos aus der Liga disqualifizieren.</p>','2016-03-03 18:30:36'),(74,260,9,'<p>Würde die Regel gestrichen, würden Teams die ende Saison nicht genügend Spiele haben, nicht am Finaltag teilnehmen.</p><p>Weil sie zu wenig Spiele, oder zu wenig Punkte haben.</p><p>Wenn ich das richtig sehe, haben bis jetzt weniger als die Hälfte aller Teams das Halbzeitziel immer noch nicht erreicht.</p><p>Das klingt nach einem riesen Aufwand, all die Teams im Auge zu behalte.</p><p>Ich würde mich nur auf den Finaltag konzentrieren.</p><p><br/></p>','2016-03-04 17:19:11'),(75,85,9,'<p>D.h. du bist der Meinung, wir sollten die Regel konsequent durchziehen und alle rausschmeissen? Oder die Regel komplett streichen?</p><p>Wie gesagt, die Regel ermöglicht uns momentan den Ausschluss.. Ohne sind wir sozusagen machtlos XD</p><p>Weiter hat man über die Jahre gelernt, dass wenn eine Liga über einen aktiven Liga-Coach verfügt der die Nachzügler auchmal anspornt hat dies einen sehr positiven Einfluss auf die Anzahl gespielter spiele...</p><p>Wir haben leider noch nicht die optimale Lösung gefunden um die Leute aktiv zum Spielen zu animieren.</p><p>Vielleicht wäre mal zu überlegen, wesentlich kleinere Gruppe zu machen und dann die Saison auf 2-3 Monate zu verkürzen? Manchmal habe ich das Gefühl, wenn die Saison beinahe ein halbes Jahr dauert, vergessen einige einfach, dass sie dabei sind :-/</p><p>Eine Idee waren sogenannte Ligaabende.. leider waren die beiden Testläufe sehr schwach besucht (lag evtl auch an der Kommunikation?). Aus Zeitgründen konnten noch keine weiteren durchgeführt werden (gewisse Ideen brauchen auch einfach Anlaufzeit...).</p><p><br/></p><p><br/></p>','2016-03-05 07:56:28'),(76,85,9,'<p>Was übrigens auch sehr spannend ist, an einem Montag werden sehr wenige Ligaspiele durchgeführt. Warum dies so ist, ist mir ein Rätsel. Geht man einfach an einem Montag nicht in eine Bar? Muss man noch das Wochenende auskurieren? </p>','2016-03-05 07:59:10'),(77,260,9,'<p>Ja, man sollte Regeln konsequent durchsetzen, ausser man hat einen triftigen Grund. Oder bist du der Meinung, Regeln sind da, Umgangen zu werden?</p><p>Jeder weiss auf was er sich einlässt und was die Anforderungen sind.</p><p>Jetzt habt ihr das Problem zur Halbzeit und ende Saison. Ohne Regel  nur noch ende Saison. Ich denke der Aufwand für euch wäre viel keiner. Wenn es euch natürlich Spass macht allen nachzulaufen und Mammi und Papi zu Spielen, dann ist das natürlich auch ok.</p><p>Ps. es gibt nie die perfekte Lösung.</p><p><br/></p>','2016-03-07 20:14:47'),(78,85,9,'<p>Nein, Regeln sind definitiv nicht da um sie zu umgehen.</p><p>Aber wenn eine Regel kontraproduktiv ist, sollte man sie auch hinterfragen und wenn nötig anpassen. Es ist nunmal so, dass Weihnachten/Neujahr wie auch die Prüfungszeit in die erste Halbzeit fallen. Ich sage nicht, dass es desshalb unmöglich ist die Hälfte der Spiele durchzuführen. Jedoch kann ich die Schwierigkeiten verstehen!</p><p>Allerdings gibt es auch die andere Art von Nicht-Spielern. Die sogenannten &#34;inaktiven&#34;. Wir versuchen genau diese zu finden und auszuschliessen, was nicht gerade einfach ist :-/</p><p>Der Aufwand ist schlussendlich der gleiche. Es ist die Aufgabe der Liga-Coaches/Modusteams die Teams während der Saison im Auge zu behalten und entsprechend zu reagieren. <span>Ob wir nun bei der Halbzeit schon viele Teams ausschliessen oder nicht ist dabei recht egal (glaube ich).</span></p><p></p><p><br/></p><p><br/></p><p></p><p><br/></p>','2016-03-08 08:50:32'),(79,24,2,'<p>9.3.2016</p><p>1. bundi / oli g.</p><p>2. hans / matt</p><p>3. markus / hiwi</p><p>4. heiko / hr</p><p>18</p>','2016-03-10 09:07:34'),(80,24,2,'<p>16.3.2016</p><p>1. roger / cristina</p><p>2. leu / claudia</p><p>3. miguel / hr</p><p>4. kimon / nino</p><p>16</p>','2016-03-17 09:54:12'),(81,42,2,'<p>23.3.2016</p><p>1. Fäbeli/Hiwi</p><p>2. Greg/Kimon</p><p>3. Markus/Tom</p><p>4. Bundi/Miguel</p><p><br/></p><p>24</p><p><br/></p><p><br/></p>','2016-03-24 06:56:02'),(82,24,2,'<p>30.3.2016</p><p>1. zimi / matt</p><p>2. oli g. / jef</p><p>3. dina / hr</p><p>4. roger / greg</p><p>20</p>','2016-03-31 09:13:01'),(83,24,2,'<p>6.4.2016</p><p>1. kimon / claudia</p><p>2. markus / leu</p><p><span>3. michi / hr</span></p><p></p><p>4. hans / roger</p><p>24</p><p></p>','2016-04-07 09:29:25'),(84,24,2,'<p>20.4.2016</p><p>1. schöb / yves</p><p>2. simona / hr</p><p>3. jef / markus</p><p>4. reto / nino</p><p>16</p>','2016-04-21 09:22:20'),(85,24,2,'<p>27.4.2016</p><p>1. michi / zimi</p><p>2. oli z / cristina</p><p>3. julie / röbi</p><p>4. jef / petrus</p><p>14</p><p><br/></p>','2016-04-28 08:28:43'),(86,32,2,'<p>Wo bleibt denn das ergebnis vom 13.4.? Da wird jef keine freude haben wenn das ergebnis nicht gepostet ist ;-)</p>','2016-04-28 12:45:03'),(87,24,2,'<p>13.4.2016</p><p>1. zimi / jef</p><p>2. david / silvan</p><p>3. claudia / hr</p><p>4. nino / matt</p><p>20</p>','2016-05-02 15:14:55'),(88,24,2,'<p>4.5.2016</p><p>1. markus / leu</p><p>2. michi / resi</p><p>3. raphael / roger</p><p>4. hans / jef</p><p>18</p>','2016-05-10 09:07:04'),(89,24,2,'<p>11.5.2016</p><p>1. miguel /schöb</p><p>2. jef / kimon</p><p>3. andy / hr</p><p>4. michi / roger</p><p>18</p>','2016-05-12 09:35:46'),(90,24,2,'<p>18.5.2016</p><p>1. jef / hr</p><p>2. david / virgilio</p><p>3. raphael / roger</p><p>4. andy / oli z</p><p>24</p>','2016-05-19 09:18:23'),(91,24,2,'<p>25