INSERT INTO `news` VALUES (1,85,'2014-08-26 00:05:31','NEU: wöchentliches \"Donnerstags Vollmond DYP\"',NULL,'Ab diesem Donnerstag findet in der Vollmond Taverne nun wöchentlich ein DYP statt. Anmeldung jeweils bis 20:15. Spielbeginn um 20:30. Der Modus wird je nach Anzahl Spieler/Teams festgelegt. Die Teilnahme kostet dich nur 5.-. Das Siegerteam gewinnt die Antrittsgelder der anderen Teams.\n',1,1),(2,85,'2014-08-25 23:59:06','Montagslounge DYP',NULL,'Sucht ihr noch eine Beschäftigung für den Montag Abend? Dann können wir euch nächsten Montag dem 1. September das erste Montagslounge-DYP im Arche Brockenhaus & Bistro empfehlen. Gespielt wird auf Garlando Delux, ab 18 Uhr sind die Tische für euch bereit. Um 19:00 ist Turnierbeginn. Die Teilnahme ist gratis! Mehr Infos zum Event hier in der Ausschreibung... \nMontagslounge Spezial – Töggeliturnier DYP | 1. September 2014 | 18 – 24 Uhr Die Montagslounge freut sich bekannt zu geben, dass im Arche Brockenhaus & Bistro am 1. September 2014 ein Tischfussballturnier statt finden wird. Ab 18 Uhr besteht die Möglichkeit sich an einem der vier Garlando Deluxe Kästen warm zu spielen. Ab 19 Uhr gilt es dann Ernst. Jedes Team hat die Gelegenheit an mindestens drei Vorrundenspielen teilzunehmen. Es können bis zu 16 Teams bzw. 32 SpielerInnen mitspielen. Dazu gibt es, typisch Montagslounge, flotte Musik, Barbecue, pikante Tapas und leckere Drinks in flauschigem Ambiente, ergänzt durch einen zusätzlichen Workout Bereich mit Ping Pong Tischen. Die Montagslounge befindet sich an der Hohlstrasse 489, in Zürich-Altstetten. Der Eintritt ist gratis. Teilnahmebedingungen/Anmeldung Gespielt wird im DYP Modus. Es können bis zu 16 Teams bzw. 32 SpielerInnen teilnehmen. \nBitte unter dem folgenden Link anmelden:http://goo.gl/51J3Bw \nSpontane Spieler kommen, je nach Belegung, auf eine Warteliste. “De schnäller isch de gschwinder”. Die Teilnahme am Turnier ist gratis. \n.. oder direkt im Facebook-Event:https://www.facebook.com/events/643645799083580\n \n',1,1),(3,85,'2014-08-19 20:52:28','Vollmond DYP',NULL,'Am 23. August führt die Vollmond Taverne ein DYP-Turnier durch. Beginn ist um 20:00. Anmelden könnt ihr euch bereits ab 19:00\nWäre das nicht die optimale Vorbereitung für die nächste Saison? ...\nInfos zum Turnier:\nWer: Alle, die Lust und Zeit haben...\nWie: DYP (Draw Your Partner): Partner wird zugelost. Spielmodus hängt von der Anzahl Spieler/innen ab, aber sicher nicht K.o.-System von Anfang an. Also kommt jeder zu mehreren Spielen. Die Sieger/innen gewinnen tolle Preise, nämlich das Antrittsgeld der anderen Teams ! \nWann: Anmeldung vor Ort von 19.00 bis 19.55 Uhr Spielbeginn ab 20.00 Uhr \nWieviel: CHF 5.-- pro Spieler/in. \nWarum: Es soll in erster Linie Spass machen !\n',1,1),(4,85,'2014-07-31 16:04:24','Generalversammlung 2014',NULL,'Am Donnerstag 14. August 2014 findet um 19.30 die fordere.ch Generalversammlung in der Vollmond Taverne statt.\n',1,1),(5,85,'2014-05-26 20:29:03','Fordere.ch im Fernsehen',NULL,'Züri Plus hat uns am letzten Samstag besucht: http://zueriplus.ch/sport.htm?videoid=1107&#10;',1,1),(6,85,'2014-05-14 12:13:05','Zürich Open',NULL,'Am 16. bis 17. Mai findet im TFCZ das Zürich Open statt. Gespielt wird auf Ullrich Tischen. Wäre das nicht das optimale Vorbereitungsturnier für euch? \nHier gibts weitere Infos zu den Kategorien:http://bit.ly/1oO9vgN\n',1,1),(7,85,'2014-05-01 18:26:13','Season (Pre) - End Party 03.05.2014',NULL,'Gratulation! Wir haben erneut unzählige tolle Töggeli-Begegnungen hinter uns und der Finaltag rückt bereits näher. Aber jetzt gibt\'s zuerst mal Party! Diesen Samstag (03.05.2014) treffen wir uns in der Coyote Bar in Zürich um das Saison-Ende zu feiern. Es gibt auch noch einen weiteren Grund: Loïc Schülé (unser Präsidente) hat Geburtstag!\n \nHier noch der Facebook-Event:https://www.facebook.com/events/690702257660241/?ref_newsfeed_story_type...\n',1,1),(8,85,'2014-04-30 12:16:56','Deadline und Cup',NULL,'Die definitive Deadline um Spiele durchzuführen wird auf den 18. Mai verschoben. Ab diesem Datum werden alle nicht gespielten Spiele als 4:0 Sieg für das Gastteam eingetragen.\nDie nächste Cup-Runde findet direkt am Finaltag statt. D.h. wer im Cup noch dabei auf jeden Fall auch am Finaltag anwesend sein!\n',1,1),(9,85,'2014-04-24 19:49:01','Vollmond DYP',NULL,'Am 26. April findet in der Vollmond das legendäre Vollmond-DYP-Turnier statt. Jeder ist willkommen. Ab 19:00 könnt ihr euch anmelden. Das Turnier beginnt um 20:00. Anmeldegebühr pro Spieler ist 5.-. Zu gewinnen gibts neben Ruhm und Ehre das Antrittsgeld aller Mitspieler.\nMehr Infos hier zu finden:http://www.vollmond-taverne.com/events/april.html\n \n',1,1),(10,85,'2014-04-03 12:34:21','Rookie Night im TFCZ',NULL,'Für alle die sich optimal auf den Finaltag vorbereiten wollen findet am Freitag (4.4.2014) im TFCZ ein Rookie-Turnier statt. Es handelt sich dabei um ein STF-Neuling-Turnier.\nAnmeldeschluss: 19:30Spielbeginn: 19:45Tisch: Ullrich\n',1,1),(11,85,'2014-03-27 11:54:28','Ullrich Liga Regeln',NULL,'Leider hat sich in den Regeln der Ullrich Liga ein kleiner Fehler eingeschlichen. Diesen habe ich behoben. Der Modus der Ullrich Liga entspricht exakt dem Modus der Garlando-Liga. D.h. wir spielen auf sechs Tore und sollte nach vier Sätzen unentschieden stehen wird ein Entscheidungssatz auf drei Tore gespielt. Die Regeln wurden nun entsprechend angepasst.\n',1,1),(12,85,'2014-03-13 13:03:28','Cup Runde #3',NULL,'Die neue Auslosung ist online. Deadline für diese Runde ist der 13. April. Wer zu diesem Zeitpunkt das Resultat noch nicht eingetragen hat wird disqualifiziert!\n',1,1),(13,85,'2014-03-04 12:53:22','Poli Bar',NULL,'Gerne möchten wir Euch darauf hinweisen, dass wir eine weitere Bar zu unserern Partnern zählen dürfen: die Poli Bar.\nSie befindet sich im Kreis 3, an der Gertrudstrasse 50 in 8003 Zürich. Für die Töggeli-Freunde der wichtigste Punkt: es ist ein Garlando Deluxe aufgestellt. Schaut doch mal vorbei und verschafft Euch einen Eindruck vor Ort :)\nMehr Informationen:\nFacebook: www.facebook.com/polibarzh\nWeb: www.polibar.ch\nBald gibt\'s weitere Informationen zum Ligabetrieb! \nGrüsse vom Fordere-Team\nFlorian\n',1,1),(14,85,'2014-02-27 23:48:13','Hubertus @ Vollmond',NULL,'Am 8. März findet in der Vollmond ein Hubertus-Turnier statt. Turnierstart ist um 20:00. \nHier die Einladung der Organisatoren:\nLiebe Töggeliverrückte, nimmersatte Hub-Anhänger, fanatische Kickerfreunde\nAm Samstag 8.März ist es soweit, to the moon please, ab in die Taverna 2014! Wir veranstalten auch dieses Jahr wieder unverschämterweise, wie wir sind, ein Töggeliturnier in der Vollmond Taverne in Wiedikon ZH. Alle sind willkommen, Bar ist vorhanden, Flo kümmert sich mit einer sportlichen Professionalität um eure Trinkgewohnheiten, die so noch nie in der Hubertusgeschichte erlebt wurde. 2 Superstars, Garlando und Ullrich (aus DE) werden für Schweiss, besetze Toiletten, tonnen- und literweise Flüssigkeiten und Flüche sorgen (Longoni fällt verletzungsbedingt leider aus -> Bänderzerrung)!!Turniermodus und Töggeliregeln verstehe ich nicht, aber werden am Tag des Turniers garantiert durch das potente Schiedsrichterquartett der Ballvereinigung Turbine Lokomotive Roter Stern Hubertus verkündet. Und eines ist jetzt schon klar: es wird ein heisser, diskussionswürdiger, geschichtsträchtiger, zukunftsorientierter Extremsport-Abend.Soviel ist klar: Anmelden von Teams (zu zw2eit) zwischen 19:00 und 20:00 Uhr. Turnierstart ab 20:00 Uhr!!!!Ich weiss, März ist nicht mehr weit entfernt... aber bleib jetzt einfach locker, Zeit ist relativ.Zieh die Jacken aus und los gehts! Wir freuen unsHub-Team\n',1,1),(15,85,'2014-02-09 22:35:14','Cup Runde #2',NULL,'Die zweite Runde ist online. Deadline ist der 9. März 2013.\n',1,1),(16,85,'2014-02-06 13:11:21','Halbzeitparty',NULL,'Wir haben bereits die Hälfte der Saison erreicht. Deshalb gibt\'s wie jedes Jahr ein kleines Fest, um das zu feiern. Beginn ist ca 20:00 in der Vollmond Taverne.\nWer: Alle, die Tischfussball mögen. Und alle anderen.\nWann: Freitag 07.02.2014, ab ca. 20:00 Uhr\nWo: Vollmond-Taverne, Zentralstrasse 53, 8003 Zürich\nWas: Ab ca. 20:30 gibt\'s ein tolles Turnier. Einschreiben bitte bevor\'s losgeht :) Gegen Hunger & Durst gibt\'s Hot Dogs (à la Stray Cat) und Bier.\nWichtig: Natürich finden auch die Jubiläums- T-Shirt Übergabe sowie ein zusätzlicher Verkauf statt. Teilnahme ist also Pflicht!\n',1,1),(17,85,'2014-01-24 14:28:03','DYP in der Coyote Bar',NULL,'Nächsten Mittwoch (29. Januar) findet in der Coyote Bar ein DYP-Turnier statt. Natürlich seid ihr alle herzlich eingeladen mitzumachen! Dementsprechend können an diesem Abend keine Spiele in der Coyote Bar abgemacht werden.\nMehr Informationen zum Turnier findet ihr hier:https://www.spontacts.com/ausgehen-diverse/zuerich/toeggeli-plausch-turn...\nStartschuss zu den legendären Töggli Turnieren im Jahr 2014. Es handelt sich um Plausch-Turniere, Anfänger und Fortgeschrittene werden 2-er Teams zugelost, jeder hat eine faire Chance zu gewinnen. Die Gewinner erhalten eine Flasche Prosecco. Keine Teilnahme-Gebühr. Für die Hungrigen unter euch, ist die Küche mit hausgemachten Bio Burgern ab 18:00 Uhr geöffnet. Freue mich jetzt schon altbekannte und neue Spontäctler zutreffen. (Ich habe fleissig geübt... imfall... die Letzten werden die Ersten sein.. Rsrsrs)\n \n',1,1),(18,85,'2014-01-09 13:08:40','Deadline Cup Runde 1',NULL,'Alle Spiele der 1. Cup Runde müssen bis am 31. Januar gespielt sein. Bei nicht gespielten Begegnungen werden beide Teams automatisch disqualifiziert.\n',1,1),(19,85,'2013-12-04 13:10:57','Vollmond is back',NULL,'Die Vollmond konnte endlich wieder ihren Barbetrieb aufnehmen. Dort warten nun ein Ullrich wie auch ein Garlando Deluxe um von euch bespielt zu werden.\n',1,1),(20,85,'2013-09-24 20:57:45','Anmeldung online ',NULL,'Anmeldung onlineAb sofort ist die Anmeldung für die kommende Saison 2013/2014 freigeschaltet. Verliert keine Zeit und meldet euch an! Die Anmeldephase endet am 20. Oktober 2013, also macht\'s lieber heute als morgen! Neuigkeiten für die kommende Saison:\nStatt dem Ullrich-Cup gibt es neu eine Ullrich-Liga.\nBei der Anmeldung können Jubiläums-T-Shirts mitbestellt werden. Unbedingt machen! \nTermine Die wichtigsten Termine in der nächsten Zeit sind wie folgt: \nEröffnungsapéro: Freitag, 15. November 2013\nHalbzeit-Party (10 Jahre Jubiläum!): Freitag, 7. Februar 2014 \nNeues Design Fordere hat ein neues Design! Los, sofort ausprobieren und staunen: www.fordere.ch \nDas wäre vorerst alles. Wir freuen uns auf die nächsten Saison und sind fleissig am vorbereiten! \nFlorian\n',1,1),(21,85,'2013-08-11 16:01:31','Vorstand komplett',NULL,'Es freut mich, euch mitteilen zu dürfen, dass das Team von Fordere nun komplett ist. Ich möchte kurz die drei neuen Mitglieder vorstellen:\nVize-Präsident: Marc Barmettler Marc \"finesse\" (oder war\'s womöglich doch \"béton\"?) Barmettler spielt seit einigen Jahren immer fleissig (mit Loic oder Nico) in der zweiten Liga mit und ist hin und wieder in der Sansibar anzutreffen. Er wird Loic beim Job des Präsidenten unterstützen und wird ihn bei Abwesenheit vertreten. Wir freuen uns sehr, dass Marc mithelfen wird!\nEvent-Chef(s): Charles Kavuma und Sandra Schwarz Ebenfalls keine unbekannten sind Charly Kavuma (\"hipp hipp hubertus\") und Sandra Schwarz (\"Krokodilfarm\"). Charly hat letzte Saison beim Modus-Team viel mitgeholfen, während Sandra zu den grossen Unterstützern des Finaltages gehört hat. Sie werden die Organisation der Events (z.B. Eröffnungs-Apéro, Halbzeit-Party, Finaltag, ...) übernehmen und somit einen wichtigen Job leisten.\nVielen Dank auch an euch! Nun steht die Vorbereitung der nächsten Saison an. Wir werden euch informieren, sobald Neuigkeiten verfügbar sind. Stay tuned!\nFlorian\n',1,1),(22,85,'2013-07-24 21:21:01','GV im TFCZ',NULL,'Das war\'s. Die Saison 2012/2013 der bar-foos-league ist offiziell vorüber. An der Generalversammlung wurde der Vorstand entlastet (ouf...) aber viel wichtiger: wir haben einen neuen Präsidenten!\nSaison 2013/2014 Die nächste Saison wird nicht mehr Nico den Verein anführen (vielen Dank nochmals!). Mit einem Glanzresultat neu gewählt wurde ein alter bekannter: Loïc Schülé. Wir freuen uns alle sehr, dass er diesen anspruchsvollen Job erneut übernimmt und es uns allen ermöglicht, eine weitere Saison der bar-foos-league zu spielen! Ebenfalls gab es aufgrund eines Rücktritts von Dina (dir auch vielen Dank!) einen Wechsel im Vorstand.Dieser sieht neu wie folgt aus:Präsident: Loïc SchüléSportchef: Mirco SauterKassiererin: Divyam Ruth TäschlerKommunikation: Florian Schwendener\nOffen bleibt noch der Posten des Veranstaltungschefs. Bewerbungen wie immer an info@fordere.ch.\n',1,1),(23,85,'2013-07-17 09:42:27','GV im TFCZ',NULL,'Diesen Samstag dem 20.07.2013 findet um 16:00 die GV im TFCZ statt!\n',1,1),(24,85,'2013-04-19 14:12:57','Acapulco 27.4',NULL,'Am 27.4 findet im Acapulco ein nicht fordere-Event statt. Der Kickerraum ist am 27.4 bis 20:00 nicht verfügbar.\n',1,1),(25,85,'2013-03-20 21:55:20','Cup - Runde #3',NULL,'Die neue Auslosung für die 3. Runde ist online. Bitte bemüht euch trotz knappem Zeitplan eure Spiele zu absolvieren.\n',1,1),(26,85,'2013-02-07 22:11:03','Daten nächste Cup Runde',NULL,'Die neue Cup und Ullrich Cup Runde wurde ausgelost. Deadlines sind:\nCup und Ullrich Cup loser Bracket: 03.03.2013Ullrich Cup winner Bracket: 31.03.2013\n',1,1),(27,85,'2013-02-07 21:31:10','Cup Deadline 12.2.2013',NULL,'Die Deadline wurde bereits überschritten. Da noch so viele Partien offen sind setzen wir die endgültige Deadline auf den 12.2. Teams die zu diesem Zeitpunkt ihr Spiel noch nicht absolviert haben werden beide disqualifiziert.\n',1,1),(28,85,'2013-02-07 21:27:50','Halbzeitparty & Wichtige News',NULL,' \nBereits ist die Hälfte der Saison um! Das ging aber schnell... Wart Ihr auch alle brav und habt die Hälfte eurer Spiele hinter euch? Nicht? Das ist in Ordnung. Ihr habt noch ein wenig Zeit. Wir kontrollieren das auch (noch) nicht, wären natürlich aber froh, wenn jedes Team versucht, langsam aber sicher voll in die Saison zu starten. Nach dieser Einleitung möchte ich auch gleich zu den Inhalten kommen. \nSpielbetrieb\nWie bereits erwähnt, sollte bald etwa die Hälfte aller Spiele vorüber sein. Genauer gesagt habt Ihr dafür bis zum 1. März 2013 Zeit. Zu diesem sehr wichtigen Datum (Party Party) komme ich aber noch. Wenn Ihr ein Problem habt genügend Spiele bis zum 1. März zu spielen, müsst ihr mit Eurem Ligacoach Kontakt aufnehmen. Hier nochmals die Ligacoaches: \n1. Liga - Stefan Schöb\n2. Liga - Mirco Sauter\n3. Liga - Marc Kollmuss\n4. Liga - Charly Kavuma\n5. und 6. Liga - Florian Guyer\nDiese könnt Ihr jederzeit per E-Mail (oder in dringenden Fällen auch via SMS - sorry Ligacoaches, Ihr habt quasi Pikettdienst ;)) kontaktieren. Alle Kontaktdaten sind auf Fordere.ch zu finden. \nCup\nAuf das erste Drängen folgt gleich das zweite: Termine für die aktuellen Runden in den beiden Cups. Die aktuellen Runden (sowohl Liga-Cup als auch Ullrich-Cup) sollten bis Ende diese Woche (3. Februar 2013) gespielt sein. Bitte versucht, die Termine einzuhalten. \nHalbzeitparty\nDas halbe E-Mail ist bereits erreicht und passend dazu möchte ich Euch alle zur Halbzeitparty einladen. Diese findet am Freitag, dem 01. März 2013 im Acapulco statt. Wie üblich geöffnet ab 20:00 Uhr und ein Turnier ab 21:00 Uhr. Wir freuen uns, euch alle dort begrüssen zu dürfen und werden Euch auch mit einem kleinen Apéro verwöhnen. \nWeitere Informationen\nSTF-Turnier am 16. und 17. Februar in Zollikon ZH, Restaurant Riethof. Samstag mit Lizenz und am Sonntag ohne Lizenz. Fordere Spieler können übrigens eine Jahreslizenz beim STF vergünstig beziehen.\nFalls Ihr Lust habt am Finaltag mitzuhelfen, freuen wir uns über eine kurze E-Mail an info@fordere.ch auf Eure Bewerbungen :)\nBei Fragen zur Clubliga dürft Ihr euch gerne an Murbi (Andreas Murbach) wenden.\n \nDas war\'s bereits wieder. Notiert euch doch das Datum der Halbzeitparty, wird bestimmt witzig!\nLiebe Grüsse vom Fordere-Team\nFlorian\n',1,1),(29,85,'2013-01-21 09:41:32','Ullrich-Cup - Runde #2',NULL,'Die Auslosung für die 2. Runde Ullrich Cup ist online. Deadline ist der 3. Februar.\n',1,1),(30,85,'2012-12-05 00:03:07','Daten 1. Cup Runde',NULL,'Ullrich Cup: 13.01.2013 \nLiga-Cup: 03.02.2013\nAlle Spiele müssen dann durchgeführt sein, falls bei einer Partie das Resultat zum gegebenen Datum noch nicht eingetragen ist scheiden beide Teams aus dem Wettbewerb aus!\n',1,1),(31,85,'2012-12-03 15:05:05','Fehlende Kontaktdaten',NULL,'Aufgrund eines Fehlers könnt ihr momentan die Kontaktdaten eurer Gegner noch nicht sehen.\nDies wird heute Abend behoben.\n',1,1),(32,85,'2012-11-11 21:12:23','Anmeldung abgeschlossen',NULL,'Die Anmeldephase für die 10. Saison ist abgeschlossen.\nWeitere Infos zum kommenden Saisonstart folgen in Kürze.\n',1,1),(33,85,'2012-09-19 21:43:45','Anmeldung freigeschaltet',NULL,'Momentan laufen die Vorbereitungen für die 10. Saison von Fordere auf Hochtouren. Ab sofort ist die Anmeldung für die nächste Saison für alle freigeschaltet - los geht\'s!\nBitte beachtet, dass die Kontoinformationen sich geändert haben. Diese sind sowohl in den FAQs auf fordere.ch als auch im Bestätigungsmail nach eurer Anmeldung zu finden.\nFür die neue Saison hat sich auch die Sansibar vorbereitet. Vor wenigen Wochen wurde auf Anraten von Fordere ein neuer Garlando Deluxe aufgestellt, welcher nun - zur Freude einiger Spieler - keinen traditionellen \"Sansi-Eggen\" mehr aufweist. Bitte zielt doch ab jetzt ein wenig genauer, dass wir diesen Luxus noch ein wenig geniessen dürfen. Übrigens: Das Fordere-Team ist in der Clubliga nach dem Ullrich-Spieltag auf dem respektablen vierten Zwischenrang (von 8 Teams) gelandet. Mehr Informationen zur Clubliga finden sich der STF-Homepage.\nWir freuen uns sehr auf die neue Saison und hoffen, dass wir alle von euch bei der Saisoneröffnungsparty am 1. Dezember 2012 in der Vollmond-Taverne antreffen werden.\nNatürlich dürft Ihr auch selbst kräftig Werbung für die Fordere-Liga machen. Gerne könnt Ihr die brandneuen Plakate auch selbst ausdrucken - sie sind ab sofort auf der Startseite von fordere.ch zu finden. Somit könnt Ihr die Liga leichter euren Freunden, Mitarbeitern und anderen Bekannten näher bringen.\n',1,1),(34,85,'2012-08-03 11:01:34','2 x Vizeweltmeister!',NULL,'Grandiose Leistung an der Garlando-WM: fordere-Spieler Stefan Schöb (Randomizer 3500) wird in den Rookie-Kategorien 2 x Vizeweltmeister! Wir freuen uns über diesen Erfolg und gratulieren herzlich.\n \n',1,1),(35,85,'2012-07-25 09:26:40','Einladung zur Gv',NULL,'Wir möchten euch herzlich zur Generalversammlung vom Mittwoch, 15. August 2012 um 19.30 Uhr in der Vollmond taverne einladen. Es ist notwendig, dass ihr euch anmeldet bzw. auch abmeldet für diese Veranstaltung. Bitte tut dies über info@fordere.ch.\n',1,1),(36,85,'2012-05-20 08:41:11','6. Runde Ullrich Cup',NULL,'Die Auslosung der 6. Runde für den Ullrich Cup ist online. Diese muss bis am 1. Juni gespielt werden.\n',1,1),(37,85,'2012-05-02 15:08:30','Finaltag am 2. Juni 2012',NULL,'Alle Infos sind hier zu finden:Finaltag Samstag 2. Juni 2012\n',1,1),(38,85,'2012-04-26 08:24:45','Ullrich Cup',NULL,'ACHTUNG - Die 5. Runde des Ullrich Cup muss bis am 13. Mai gepielt werden. Anschliessend kommt dann die letzte Runde, diese muss bis zum 28. Mai gespielt werden.\n',1,1),(39,85,'2012-04-26 08:23:09','Cup',NULL,'Die restlichen bar-foos-league Cupspiele müssen bis am 19. Mai gespielt werden.\n',1,1),(40,85,'2012-04-04 17:30:06','Helfer gesucht...',NULL,'Wer möchte gerne ins Helferteam für den Finaltag am 2.6. 2012 in der Roten Fabrik (Aufbau, Abbau, Organisation etc.)? Es gibt auch ein rauschendes Helferfest...\nMail an: info@fordere.ch\n',1,1),(41,85,'2012-03-18 23:51:54','neue Ullrich Runde LB',NULL,'Die Auslosung der neuen Ullrich Runde ist online. Deadline nur für das Loosers Bracket ist der 8. April 12. Das Winners Bracket muss ihre Runde noch nicht Spielen und kann die Sonnenstrahlen des Frühlings geniessen.\n',1,1),(42,85,'2012-03-18 23:49:55','neue Cup Runde',NULL,'Die Auslosung der neuen Cup Runde ist online. Deadline zum Spielen ist der 8. April 12.\n',1,1),(43,85,'2012-03-06 00:27:27','Bilder Halbzeitparty',NULL,'Hier sind die Bilder:Halbzeitparty\n',1,1),(44,85,'2012-02-25 11:59:25','3. Runde Cup',NULL,'Die Auslosung für die 3. Cup-Runde ist online.\n \nDeadline zum Spielen ist der 11. März\n',1,1),(45,85,'2012-02-14 20:46:06','Ullrich Cup Runde 3',NULL,'Die Auslosung für die 3. Runde sind online.\nDeadline zum Spielen ist der 11. März\n',1,1),(46,85,'2012-01-25 18:49:54','Termine für die 2. Runde Cup',NULL,'Cup: 19. Februar\nUllrich-Cup: 8. Februar Neu!\n',1,1),(47,85,'2011-11-29 16:00:33','Ullrich-Tisch in der Toro Bar!',NULL,'Wir gratulieren der Toro Bar zum ersten Ullrich-Spieltisch in einer Zürcher Bar.\nToro Bar, Schöneggstrasse 25, 8004 Zürich (100m von der Sansibar entfernt)www.torobar.com\nAchtung: Freitags und samstags eingeschränkter Spielbetrieb ab 22Uhr!\nEnjoy!\n',1,1),(48,85,'2011-11-17 19:47:13','Plauschturnier im TFCZ!',NULL,'Wann: Freitag 18.11.11, offen ab 19 Uhr\nWo: TFCZ (Landenbergstrasse 10)\nModus: Crazy-DYP\nTurnierbeginn: 20 - ca. 23Uhr\nTurnierbeitrag: Fr. 5.- (kein Münzeinwurf)\n',1,1),(49,85,'2011-10-09 11:19:33','Wichtige Daten für die Saison 9.',NULL,'Anmeldebeginn Montag 10. Oktober 2011\nAnmeldeschluss Samstag 19. November 2011\nSaisonbeginn Samstag 03. Dezember 2011\nSaisonhalbzeit Samstag 03. März 2012\nSaisonende Samstag 19. Mai 2012\nFinaltag Samstag 02. Juni 2012\n',1,1),(50,85,'2011-10-04 21:21:22','GV 30. August',NULL,'Vorgestern wurde in der Vollmond-Taverne der neue Vorstand gewählt.\n Es waren 15 Mitglieder anwesend. Gewählt wurden:\n Präsident: Nicolas Spinner\n Vize-Präsident: Marco Correani\n Sportchef: Mirco Sauter\n Kassier: Divyam Ruth Täschler\n Kommunikationschef: Suena Jäger\n Veranstaltungschef: Sabine Meiren\n',1,1),(51,85,'2011-10-04 21:20:54','Neuer Vorstand',NULL,'Tonight, we decide who will be the next president of fordere at 8pm at the tfcz! we will also see who will be part of the organisation of next year! sportchef, marketing, events, etc... wanna help next year ? come tonight :-) you are all welcome!\n',1,1),(52,85,'2014-10-07 23:12:00','Anmeldephase Saison #12',NULL,'Endlich ist es soweit! Die Bar-foos-league startet in die nun bereits zwöflte Saison! Registriere dich jetzt! ',1,1),(53,85,'2014-10-30 13:21:33','Neu: wöchentliches Plausch – Turnier in der Fambar’84',NULL,'<p>Ab sofort findet in der Fambar’84 jeden Dienstag ein Turnier statt. Die Mannschaften werden zugelost, so dass auch Einzelspieler willkommen sind.  Anmeldung jeweils bis 20:00 Uhr, Spielbeginn um 20:15 Uhr. Das Niveau liegt zwischen 3. und 5. Liga, es sind aber für gewöhnlich auch besser klassierte Spieler anwesend. Die Teams werden nach Stärke zugelost, so dass jedes Team eine faire Chance hat zu gewinnen.  Keine Teilnahmegebühr, die Gewinner erhalten eine Flasche Prosecco. Gespielt wird auf Garlando De Luxe.</p>',1,1),(54,85,'2014-11-14 09:56:29','Eröffnungsparty 29. November',NULL,'<p>Am. 29. November starten wir in der Fambar in die Saison #12. Beginn ist um 20:00! Weitere Infos zum Plauschturnier geben wir in Kürze bekannt :-)</p><p>Hier noch der Facebook-Event:</p><p>https://www.facebook.com/events/363069303852943/</p>',1,1),(55,85,'2014-12-02 23:19:04','Ligastart',NULL,'<p>Aufgrund von einem kleinen technische Problem verzögert sich der Ligastart bis Mittwoch dem 3.12.2014! </p>',1,1),(56,85,'2014-12-03 23:18:51','Ligastart: Jetzt gehts los!',NULL,'<p>Die Webseite läuft, die Teams sind zugeteilt! Es kann los gehen.</p><p>Wir freuen uns die Saison #12 nun auch auf der neuen Webseite starten zu können. Ab sofort könnt ihr eure Spiele durchführen.</p><p>Falls ihr auf der Webseite Fehler finden solltet oder ihr irgendwas vermisst lasst es uns so schnell wie möglich wissen!</p>',1,1),(57,85,'2015-01-07 18:01:24','Cup - Auslosung online!',NULL,'<p>Die Cup-Auslosung ist online. Ihr findet das Bracket unter: </p><p><a href=\"https://fordere.ch/cups/1/tree\">Cup-Auslosung Saison #12</a><br/></p><p>Die Deadline der 1. Runde ist der 8. Februar 2015!</p>',1,1),(58,85,'2015-01-29 11:02:41','Halbzeitparty 13.02.2015',NULL,'<p>Am Freitag dem 13.02.2015 ist bereits die Halbzeit der Saison #12 erreicht. Entsprechend schmeissen wir unsere Halbzeitparty. Der Event findet in der Coyote Bar statt. </p><p>Wie immer werden wir ein DYP-Turnier durchführen. Anmeldeschluss resp. Spielbeginn ist hier 20:00. Wir starten die Party jedoch bereits ab 19:00.</p><p>Natürlich werden wir für euch auch ein paar Snacks organisieren :-)</p>',1,1),(59,85,'2015-03-27 11:09:16','Billiardino Liga Abend 16.04 Donnerstag',NULL,'<p>Zum ersten Mal führt fordere.ch am Donnerstag 16.April 2015 einen Liga-Abend in einer Partnerbar durch. </p><p>Im Billiardino begrüssen euch ein Ullrich sowie ein Garlando Deluxe in top Zustand.</p><p>Jeder Spieler der an diesem Abend zwischen 18:00 und 23:30 ein Spiel beginnt erhält von uns ein Getränk (Bier oder Softdrink) geschenkt. </p><p>Weiter übernimmt fordere an diesem Abend die Spielkosten. D.h. ihr könnt eure Einfränkler für einmal zu Hause lassen.</p><p>Also los, die Timeslots sind begrenzt, am besten gleich jetzt Spiele abmachen und auf fordere.ch eintragen!<br/><br/></p><p>Der Facebook-Event ist hier zu finden:<br/>https://www.facebook.com/events/659741500797250/ </p>',1,1),(60,85,'2015-04-12 14:26:38','Liga Deadline 17. Mai 24:00',NULL,'<p>Dieses Jahr könnt ihr bis zum17. Mai Liga Spiele (Ullrich oder Garlando) durchführen und eintragen. Nach diesem Datum werden alle nicht gespielten Partien als Forfait-Sieg für das Auswärtsteam gewertet. D.h. 4:0. </p><p>Beachtet, um für den Finaltag zugelassen zu werden dürft ihr maximal zwei Spiele nicht gespielt haben!</p>',1,1),(61,85,'2015-04-17 11:07:56','Acapulco schliesst die Töggelitore',NULL,'<p>Leider müssen wir bekannt geben, dass das Acapulco nach dieser Saison den Töggeliraum in einen Partykeller umbauen wird. Leider geht uns somit auch ein bekanntes Lokal verloren! Sicherlich ein Verlust für unsere Liga!</p><p>Gerne würde das Acapulco ihre <b>Tische verkaufen</b>. Falls du also Interesse an einem <b>Garlando World Champion</b> oder einem <b>Garlando Deluxe</b> hast melde dich beim fordere.ch-Team.</p>',1,1),(62,85,'2015-05-03 11:26:25','Neues Forum',NULL,'<p>Mit dem heutigen Update können wir euch endlich wieder ein Forum bereitstellen. Wir sind gespannt auf ein paar hitzige Diskussionen! <a href=\"https://fordere.ch/forum\">https://fordere.ch/forum</a></p>',1,1),(63,85,'2015-06-03 16:30:31','Fordere in den Medien',NULL,'<p>Vor dem Finaltag waren wir bei <a href=\"http://www.radio1.ch/\"><b>Radio1</b></a> zu hören. Heute hat die Lokalzeitung <a href=\"http://neu.lokalinfo.ch/\"><b>Züri West</b></a> einen super Artikel über unsere Liga veröffentlicht. Zu finden hier: <a href=\"http://neu.lokalinfo.ch/uploads/media/ZW_2015_23.pdf\">Bericht Finaltag</a><br/></p>',1,1),(64,85,'2015-07-27 04:42:08','1. Poli Open Air Turnier',NULL,'<p>Es freut uns sehr, dass wir euch in Zusammenarbeit mit der Poli Bar zum 1. Poli Open Air Töggeli Cup einladen können.</p><p>Gespielt wird ab 17:30. Wir spielen eine Vorrunde im Crazy DYP Modus. Die besten 8 qualifizieren sich direkt für die Halbfinals.</p><ul><li>Turnierbeginn: 17:30</li><li>Turnierende: 22:00</li><li>Tische: 2 x Garlando Deluxe</li></ul><p>Natürlich ist auch für Speis und Trank gesorgt. Die Poli Bar bedient euch gerne mit feinen Würsten vom Grill und bestem Bier direkt vom Zapfhahnen :-)</p><p>Hier noch der Link zum Facebook-Event:<br/>https://www.facebook.com/events/865550833529492/</p>',1,1),(65,85,'2015-10-10 10:09:30','Anmeldephase Saison #13',NULL,'<p>Die Anmeldephase für die 13. Ausgabe der Bar-foos-league hat begonnen. Meldet euch jetzt direkt hier auf fordere.ch an!</p>',1,1),(66,85,'2015-10-17 06:58:27','Mailproblem',NULL,'<p>Wir hatten in den letzten Tagen ein Mail Problem. Es kann sein dass eure Kontakt Nachricht oder auch die Anmeldebestätigung nicht angekommen ist. Falls ihr also nichts von uns gehöhrt habt meldet euch direkt auf info@fordere.ch.</p>',1,1),(67,85,'2015-10-26 20:45:08','Vorspielen Saison #13',NULL,'<p>Alle Teams die noch nie mitgespielt haben müssen ein kurzes Vorspiel absolvieren damit wir euch optimal einteilen können.</p><p>Bitte tragt euch im folgenden Doodle ein:<br/><a href=\"http://doodle.com/poll/vxw5dcqmaauts8ca\">Fordere Vorspiel Doodle</a><br/></p>',1,1),(68,85,'2015-10-27 21:39:39','Fordere Bar Masters',NULL,'<p>Fordere startet dieses Jahr mit einer neuen Turnierserie in die Saison. Neben der altbekannten und erfolgreichen Liga werden wir das Fordere Bar Masters austragen. Dabei handelt es sich um eine Reihe von Turnieren welche wir in unseren Partnerbars durchführen. Gewinnen kann hier jeder!</p><p>Weitere Infos unter:<br/><a href=\"https://fordere.ch/rules/barmasters\">Spielmodus Fordere Bar Masters</a><br/></p>&#10;&#10;Das Eröffnungsturnier wird die erste Möglichkeit sein Punkte für das Masters zu sammeln.',1,1),(69,85,'2015-10-30 20:42:55','Anmeldeschluss - Ligaparty',NULL,'<p>Die neue Saison steht vor der Tür, neben der riesigen Vorfreude gibt es noch ein paar Informationen an alle:</p><p>1. Anmeldeschluss ist diesen Sonntag (1. November) 24:00 Uhr. Organisiert euch, macht ne Partnerbörse auf oder nehmt einfach euren alten Indianer-Freund oder die Stadtpiratin von letzter Saison!<span> </span><span> </span></p><p>2. Die Eröffnungsparty findet im TFCZ am 28. November 2015 statt. Es gibt einiges an Essen und Häppchen und die Bar wird sich über eure durstigen Kehlen freuen. Ab 19Uhr können sich alle für das erste Bar Masters Turnier einschreiben. Jawoll, die Eröffnungsparty ist auch gleichzeitig das erste Bar Masters. Turnierbeginn ist 20 Uhr. Wir freuen uns auf einen hoffentlich fulminanten Start in die neue Saison.</p><p>3. Die Profile auf www.fordere.ch wollen gepflegt sein. Die Natelnummer und die E-Mail Adresse sollten unbedingt aktuell und vorhanden sein. Nur wer sich auch bei Fordere registriert, hat Einsicht in die Nummern, es wird also nicht gestreut oder verkauft. Die Nummern sind wichtig, wenn ihr eure Spiele während der Saison abmacht und kurzfristig eine Mitteilung an den Gegner machen möchtet. Falls ein Missbrauch von Nummern vorliegen sollte, dann meldet euch sofort beim Vorstand, wir sind bemüht dies sofort zu unterbinden. Bei den E-Mail Adressen ist es wichtig, dass es nicht eure Spam-Adresse ist. Wir teilen wichtige Informationen per Mail mit, und sind darauf angewiesen, dass es euch erreicht. Dafür verschicken wir keine Briefe per Post und schonen so die Bäume ;-)</p>',1,1),(70,85,'2015-11-04 18:10:20','Vorbereitungsturnier',NULL,'<p>Am Samstag 7.11.2015 findet in der Coyote Bar ein Saison Vorbereitungs Turnier statt. Hier die Ausschreibung: <a href=\"https://www.facebook.com/photo.php?fbid=10207872329749942&amp;set=gm.10153753248799577&amp;type=3&amp;theater\">Klick</a></p>',1,1),(71,85,'2015-11-23 21:13:53','28.11.2015 Saisoneröffnungsturnier',NULL,'<p>Endlich ist es soweit. Wir starten mit dem traditionellen Eröffnungsturnier in die Saison #13.</p><p>Wir spielen eine Crazy-Multitable-DYP-Vorrunde. D.h. In jeder Runde wird euch ein neuer Spielpartner zugelost und ihr habt die Möglichkeit eure Töggeli-Skills auf folgenden Tischen zu zeigen:</p><ul><li>Garlando Deluxe</li><li>Garlando WCS</li><li>Robert Sport</li><li>Bonzini</li><li>Ullrich </li><li>Leonhart</li><li>Sportlux</li><li>Fireball</li></ul><p>Da es sich um ein Crazy DYP handelt könnt ihr auch später in das Turnier einsteigen oder bereits vor Turnierende weiterziehen. </p><p>Die besten 32 der Vorrunde qualifizieren sich für die Finalrunde. </p><p>Natürlich haben wir Snacks organisiert und der Kühlschrank wird ebenfalls nochmals gefüllt! Für Verpflegung ist also gesorgt :-)</p><p>Achtung: Dies ist bereits das erste Turnier an dem ihr Punkte für das Fordere-Bar-Masters sammeln könnt!</p><p>Türöffnung: 18:30<br/><span>Spielbeginn: 19:30<br/></span><span>Letzte Runde: 23:00<br/></span><span>Beginn Finals: 23:10</span></p><p>Ort: Landenbergstrasse 10, CH-8037 Zürich</p><p><br/></p><p>Facebook-Event: https://www.facebook.com/events/184258015247317/</p>',1,1),(72,85,'2015-12-01 22:10:21','Spielbetrieb gestartet',NULL,'<p>Bereits sind die ersten Resultate eingetragen! Wir vom fordere.ch Team wünschen allen Teilnehmern eine erfolgreiche Saison mit vielen spannenden Spielen!</p><p>Auf die neue Saison gibt es eine kleine Regelanpassung:<br/>Neu sind Standschüsse aus der 5er Reihe erlaubt!</p>',1,1),(73,85,'2015-12-03 11:01:00','16.12.2015 Poli Bar Masters',NULL,'<p>Das fordere Bar Masters geht in die 2. Runde.</p><p>Wir freuen uns mit diesem Turnier auch den zweiten Tisch in der Poli Bar zu eröffnen. Dieser wurde übrigens extra für die Bar-foos-league in Betrieb genommen! <span>Gespielt wird erneut ein Two-Ball Crazy DYP. Allerdings dieses Mal auf zwei Garlando Deluxe. </span></p><p>Spielbeginn ist um 19:00 und das geplante Turnierende um 23:00.</p><p>Wie bei einem Crazy-DYP üblich könnt ihr natürlich auch später einsteigen oder früher aus dem Turnier aussteigen.</p><p>Willkommen sind alle die gerne Töggelen (auch nicht Liga Spieler) oder sonst einfach gerne in die Poli Bar kommen :-)</p>',1,1),(74,85,'2015-12-17 17:51:56','Zwischenstand Bar Masters',NULL,'<p>Die aktuelle Rangliste nach zwei von sechs Turnieren ist online: (Excel-Liste Download rechts oben)<br/><span>https://fordere.ch/rules/barmasters</span></p><p>Es ist noch nichts entschieden, auch wer bis jetzt an keinem Turnier teilgenommen hat kann sich noch problemlos für die Finalrunde qualifizieren!</p><p>Das kommende Turnier wird am 11. Januar 2016 in der Fambar stattfinden &amp; die nächste Möglichkeit um Punkte zu ergattern sein. <br/></p>',1,1),(75,85,'2016-01-11 09:40:25','Fambar Bar Masters',NULL,'<p>Heute Abend (11.01.2016) findet in der Fambar die 3. Runde das Bar-Master statt! Turnierbeginn ist 20:00! </p><p>Weitere Infos zum Turnier:<br/>https://www.facebook.com/events/1737917033106845/</p>',1,1),(76,85,'2016-01-16 21:03:41','Zwischenstand Bar Masters',NULL,'<p>Die Rangliste wurde aktualisiert! Momentan führt Karin Merian vor Roman Thies und Silvan Zuber! </p><p>Am 13.02 habt ihr in der Coyote Bar die nächste Chance Punkte zu sammeln!</p>',1,1),(77,85,'2016-01-22 19:29:30','1. Ligaabend 1.2.2016',NULL,'<p>Am Montag, 1.2.2016 führen wir in der Fambar den ersten Ligaabend der Saison #13 durch!</p><p>Was ist ein Liga Abend?<br/><span>Jeder der an diesem Abend in der Fambar ein Ligaspiel absolviert erhält ein Bier von uns offeriert! </span></p><p>Also, am besten gleich jetzt dein Spiel abmachen und am 1. Februar eintragen. </p><p>Dies ist ein Versuch! Sollte die Idee ankommen werden wir noch weitere Ligaabende in anderen Bars durchführen.</p>',1,1),(78,85,'2016-02-04 17:38:12','Halbzeit Party und Coyote Bar Masters 13.02.2016',NULL,'<p>Die Saison-Halbzeit ist bereits bedrohlich nahe! Erste Teams haben bereits sämtliche Spiele absolviert. Andere müssen definitiv noch richtig Gas geben!</p><p>Auf jeden Fall wollen wir die Halbzeit mit einem gebührenden Fest feiern. Dazu laden wir euch alle zur Halbzeit Party in der Coyote Bar ein. </p><p>Natürlich soll auch das Töggelen nicht zu kurz kommen, darum spielen wir an diesem Abend die 4. Ausgabe unserer Bar-Masters-Serie. In der Rangliste ist immer noch alles offen. Erinnerung: nur die Spieler mit den meisten Punkten können am Finaltag um den grossen Bar-Masters-Titel mitspielen! Natürlich dürfen wie immer auch nicht Liga-Spieler am Turnier teilnehmen!</p><p>Turnierbeginn und Modus wird hier in Kürze bekannt gegeben!</p><p>Damit ihr uns nicht verhungert werden wir auch dieses Mal für ein paar Snacks sorgen :-)</p><p>Weitere Infos auf:<br/><span>https://www.facebook.com/events/186814061680646/</span></p>',1,1),(79,85,'2016-02-27 10:27:35','La Catrina Bar Masters 8.3 19:00',NULL,'<p>Das Bar-Masters geht in die 5. Runde. Eure Chance weitere Punkte zu sammeln um euch für das entscheidende Turnier am Finaltag zu qualifizieren und dort um den grossen Preis mitzuspielen. Jeder kann es noch schaffen!</p><p>Weitere Infos:<br/>https://www.facebook.com/events/752259984917992/</p><p><br/></p>',1,1),(81,85,'2016-03-02 18:05:30','1. Clubliga Spieltag im TFCZ (Sa, 02.03.2016)',NULL,'<p>Diesen Samstag dürfen wir einige der besten Tischfussballspieler der Schweiz bei uns in Zürich begrüssen. Wir hosten im TFCZ die Region Ost der STF Clubliga. An diesem Event stellt jeder Verein eine oder mehrere Mannschaften. An zwei Spieltagen wird dann der beste Töggeliclub der Schweiz ermittelt. Dieser qualifiziert sich für den ECL, der Championsleague des Tischfussballs :-)</p><p><br/></p><p>Wir von fordere.ch stellen dieses Jahr drei Mannschaften. Möchtest du uns unterstützen oder einfach mal den Profis über die Schulter schauen? Ab 11:00 geht’s los im TFCZ.</p><p><br/></p><p>Für alle die später auch noch ein paar Bälle spielen möchten, wir werden um ca. 20:30 noch ein CrazyDYP für jedermann durchführen!</p>',1,1),(82,85,'2016-03-12 08:32:11','Rangliste Bar-Masters',NULL,'<p>Wir haben soeben die BarMasters-Rangliste auf den neusten Stand gebracht!</p><p>Seid ihr noch nicht unter den besten 16? Dann reserviert euch schonmal den 5. April! Letzte Chance Punkte zu sammeln um euch für das Finaltag-BarMasters-Turnier zu qualifizieren!</p><p>Ihr findet die Rangliste wie immer unter folgendem Link zum Download:<br/><a href=\"https://fordere.ch/rules/barmasters\">https://fordere.ch/rules/barmasters</a><br/></p>',1,1),(83,85,'2016-03-23 17:13:08','Billiardino Masters (05.04.2016)',NULL,'<p>Eure letzte Chance Punkte zu sammeln und euch so für das finale Turnier im Dynamo zu qualifizieren!</p><p>Ort: Billiardino<br/>Datum: Di. 05.04.2016<br/>Turnierbeginn: 20:00</p><p>Weitere Infos auf:<br/>https://www.facebook.com/events/849392441872752/</p>',1,1),(84,85,'2016-04-21 20:59:20','Endspurt',NULL,'<p>Die Saison #13 geht noch weniger als 10 Tage. Hast du noch offene Spiele? Dann ist jetzt der Zeitpunkt deine Gegner zu kontaktieren und nächste Woche noch die Spiele abzumachen!</p>',1,1),(85,85,'2016-04-29 15:29:05','Saisonverlängerung bis 15. Mai',NULL,'<p>Da noch knapp 100 Partien nicht ausgetragen wurden, haben wir uns entschieden, die Saison bis zum 15. Mai 2016 24:00 zu verlängern. </p>',1,1),(86,85,'2016-04-29 15:29:46','Infos Finaltag (4. Juni 2016)',NULL,'<p><span>Ort: Dynamo (http://www.dynamo.ch/)<br/></span><span>Türöffnung: 11:00<br/></span><span>Beginn Bar-Masters: 11:30 (die besten 16 Spieler konnten sich hierfür qualifizieren)<br/></span><span>Beginn Liga-Finals: 12:00 <br/></span><span>Plausch-Turnier ab ca. 18:30 (hier können auch nicht Liga-Spieler mitspielen)</span></p><p></p><p>Wir bitten euch alle pünktlich spätestens um 12:00 im Dynamo zu erscheinen. Falls du trotz Qualifikation nicht am Finaltag teilnehmen kannst, melde dich bitte bei uns um unnötige Verzögerungen zu verhindern!</p><p></p>',1,1),(87,85,'2016-05-31 21:14:08','SMS Aufruf am Finaltag',NULL,'<p>Wir werden die Spiele am Finaltag per SMS aufrufen. Bitte kontrolliere deine Handy-Nummer in deinem <a href=\"https://fordere.ch/profile\">Profil</a></p>',1,1),(88,85,'2016-06-01 17:04:30','Einlass erst ab 11:00',NULL,'<p>Leider stimmt die Information der Türöffnung aus der Mail nicht ganz. Wir dürfen die Türen erst um 11:00 und nicht bereits um 10:30 öffnen! </p>',1,1),(89,85,'2016-06-06 19:55:05','Saison #13 vorbei... Open Air kommt!',NULL,'<p>Rund sieben Monate nach den ersten Toren der Saison #13 wurde im Dynamo der beste resp. die beste Töggeler/in der Stadt Zürich erkoren. </p><p>Bevor wir in die Sommerpause gehen haben wir einen weiteren Höhepunkt! Am 25.6 führen wir am OpenAir Wipkingen ein OpenAir Töggeliturnier durch. Reserviert euch schon mal das Datum und esst ab jetzt bitte alle eure Teller aus, damit wir diese Turnier bei schönem Wetter durchführen können :)</p>',1,1),(90,85,'2016-06-20 19:51:21','Openair Töggeliturnier am 25.6. ab 18:00',NULL,'<p>Gibt es was Gemütlicheres als unter freiem Himmel bei schönstem Wetter, einem Bier und cooler Musik zu Töggelen? Wir sind der Meinung nein! Darum stellen wir diesen Samstag unsere Tische am Openair Wipkingen auf!. Für Bier und gute Musik sorgt bereits das Openair Team. Auf das Wetter hoffen wir nun einfach mal :-)</p><p>Diesen Samstag organisieren wir am Openair Wipkingen zum ersten Mal ein Plauschturnier für jede und jeden! Um 18:00 gehts los. Gespielt wird ein CrazyDYP. D.h. du kannst auch noch später einstiegen oder einfach auch schon früher abziehen. z.B. wenn gerade deine Lieblingsband auf der Bühne zu sehen ist ;-)</p><p>Weitere Infos findet ihr hier: <a href=\"https://www.facebook.com/events/483701981836184/#\">Facebook</a></p>',1,1),(91,85,'2016-07-06 15:51:07','Fordere Generalversammlung 18.07',NULL,'<p>Am 18.07 um 19:30 führt der Verein fordere.ch die ordentliche Generalversammlung in der Fambar durch. Im Anschluss an die Versammlung wird natürlich noch getöggelt bis sich die Balken biegen :)</p><p>Dieses Jahr müssen mindestens 18 Spieler der Saison #13 anwesend sein damit wir die Generalversammlung durchführen können! Wir zählen auf euch!</p>',1,1),(92,85,'2016-07-20 16:58:22','GV 18.07.2016',NULL,'<p>Wow! 36 Spieler haben sich am Montag zur jährlichen Generalversammlung in der Fambar eingefunden. Vielen Dank an alle die sich diese Stunde Zeit genommen haben!</p><p>Ein weiterer riesen Dank geht an unsere beiden zurückgetretenen Vorstandsmitglieder Charly Kavuma und Florian Wittwer! Eure Arbeit hat viel zum Gelingen der letzten Saison beigetragen!</p><p>Es freut uns mit Mirco Sauter ein neues altes Vorstandsmitglied in unserem Team begrüssen zu dürfen! Yeii :-)</p><p>Den kompletten Vorstand findet ihr unter <a href=\"https://fordere.ch/verein/vorstand\">https://fordere.ch/verein/vorstand</a></p><p>Wer gerne das vollständige Protokoll der GV erhalten möchte, der sende doch kurz ein Mail an info@fordere.ch :-)</p>',1,1),(93,85,'2016-08-24 16:16:59','STF - Informationen',NULL,'<p>Die Swiss Tablesoccer Federation hat neue Informationen zur kommenden Saison veröffentlicht. Wer beabsichtigt das eine oder andere Turnier auf STF-Stufe zu bestreiten sollte kurz einen Blick darauf werfen. Ihr findet die Infos auf der <a href=\"http://stf-tischfussball.ch/clubdesk/www?p=100100&amp;b=100101&amp;c=ND1000060\">STF-Seite</a></p>',1,1),(94,85,'2016-08-24 16:23:09','La Catrina Open Air Turnier',NULL,'<p>Mit einem Open-Air Töggeli Turnier melden wir uns aus der Sommerpause zurück.</p><p><b>Wann?</b> <span>Mittwoch 14. September<br/></span><b>Zeit?</b><span> </span><span>19:00 Türöffnung, 19:30 Turnierbeginn<br/></span><b>Du kannst erst später? </b><span>Kein Problem, wir werden einen Modus wählen der Teilnahmen bis ca. 21:00 zulässt.<br/></span><b>Wie lange?</b><span> </span><span>Turnierende ca. 23:00<br/></span><b>Wo?</b><span> </span><span>La Catrina, Kurzgasse 4, Zürich<br/></span><b>Modus?</b><span> </span><span>Wissen wir selbst noch nicht so genau :-)<br/></span><b>Kosten?</b><span> </span><span>Keine!<br/></span><b>Schlechtes Wetter?</b><span> </span><span>Kein Problem, wir haben notfalls ein Dach.</span></p><p></p><p>Weitere Informationen werden laufend auf <a href=\"https://www.facebook.com/events/183301138756626/\">Facebook</a> publiziert.<br/>Wir freuen uns auf euch :-)</p><p></p>',1,1),(95,85,'2016-10-07 15:31:08','Anmeldephase hat begonnen!',NULL,'<p><span>Es geht los! Die Anmeldephase für die Saison 2016/17 ist eröffnet. Du kannst dich jetzt unter <a href=\"http://fordere.ch/season/register\">fordere.ch/season/register</a> anmelden.</span><br/></p>',1,1),(96,85,'2016-10-15 09:04:24','Amboss Bier als Hauptsponsor',NULL,'<p>Lange haben wir gesucht, endlich haben wir ihn gefunden. Den perfekt zu fordere.ch passenden Hauptsponsor. Wir freuen uns auf die Zusammenarbeit mit Amboss Bier! Prost! </p>',1,1),(97,85,'2016-10-26 08:14:23','27.10.2016 - St. Josephs Bar Masters',NULL,'<p>Es geht los. Wir starten in die neue SAISON 2016/17</p><p>Das erste Bar-Master Turnier in der Reihe findet im St. Josephs Pub im Kreis 5 statt. Bereits können die ersten Punkte gesammelt werden, für den grossartigen Titel zum Bar Master 2017. Wir steigen gleich richtig ein und auch eine Überraschung zu Turnierhalbzeit wird es geben!</p><ul><li>Start: 19:30 (Einstieg bis max. 20:30 möglich)</li><li>Modus: Crazy DYP La Regle</li><li>Turnierschluss: ca. 23.00</li></ul><p>Kommt alle und testet gleich den neuen Garlando Kasten in unserer neuen Partnerbar. Und die Bierauswahl ist so richtig richtig gut. St. Joseph\'s Pub Style. Das Essen ist übrigens auch klasse..</p><p>Wir freuen uns auf euch, auf die neue Bar und das erste Bar-Masters. ENDLICH gehts wieder los.</p>',1,1),(98,85,'2016-10-28 15:43:20','Endspurt Anmeldephase',NULL,'<p>Ihr habt noch drei Tage Zeit euch für die Saison 2016/17 anzumelden. Also loooos, am besten gleich sofort registrieren und zwar <a href=\"https://fordere.ch/season/register\">HIER</a></p>',1,1),(99,85,'2016-11-14 20:04:45','Einteilung online',NULL,'<p>Ihr wollt wissen, mit wem ihr es während der Saison 2016/17 zu tun bekommt? Die Einteilungen sind online!</p><ul><li><a href=\"http://fordere.ch/season/einteilung/5\">Bar-foos-league</a><br/></li><li><a href=\"http://fordere.ch/season/einteilung/6\">Ullrich Liga</a></li></ul><p><br/></p>',1,1),(100,85,'2016-11-21 20:40:17','Saisoneröffnungsturnier am 26.11',NULL,'<p>Es geht los! Gemeinsam starten, spielen und feiern wir am 26.11 in die 14. Ausgabe der Bar-foos-league.</p><p>Die wichtigsten Fakten zu diesem Abend:</p><p>Türöffnung: 18:00<br/><span>Turnierbeginn: 19:00<br/></span><span>Wo: TFCZ (Landenbergstrasse 10)<br/></span><span>Wer: Alle die in der Liga mitspielen oder einfach sonst gerne mit uns diesen Abend verbringen möchten :) <br/></span><span>Modus: Multitable-Crazy-DYP</span></p><p>Gleichzeitig ist das Eröffnungsturnier auch bereits die zweite Möglichkeit, Punkte für das Bar-Masters zu sammeln. Wer sich als im Bar-Masters für den Finaltag qualifizieren möchte, der tut gut daran am Turnier dabei zu sein :-)</p><p>Natürlich werde ihr an diesem Event nicht hungern müssen. Unser bereits weit umher bekanntes Catering-Team rund um Sandra Schwarz und Noemi Reichel kreiert bereits unter Hochdruck feinstes Knaberzeugs. Hurray!</p>',1,1),(101,85,'2016-11-28 12:07:25','Saisonstart',NULL,'<p>Ready? GO! Ab jetzt können Spiele abgemacht und ausgetragen werden. Ihr findet alle eure Begegnung im Menü unter &gt; Season 2016/17 &gt; Meine Saison</p><p>Bitte beachtet die neue, eindeutige Regel bezüglich Anspiel: Bei der ersten Schussabgabe durch die Fünferreihe zählen Tore nie, auch wenn der Ball von eigenen oder gegnerischen Figuren anderer Reihen zufällig ins Tor abgelenkt wird. Sobald der Gegner aber Ballkontakt hatte, der Ball zurück auf die Fünferreihe gelangt (also zum Beispiel ein Hin- und Her zwischen den beiden Fünferreihen) und dann eine Schussabgabe erfolgt, zählt das Tor auf alle Fälle, egal wie der Ball den Weg ins Tor findet. Die Regeln findet ihr <a href=\"https://fordere.ch/rules/barfoosleague\">HIER</a></p>',1,1),(102,85,'2016-12-12 18:41:01','Fordere Skitag',NULL,'<p>Wie ihr wisst, werden wir ein <b>Skiweekend machen in den Bergen</b>. Zur Zeit hat sich eigentlich niemand fix angemeldet. Nun starten wir eine Offensive, wer sich <b>bis 31. Dez. 2016 über den Link anmeldet ist dabei und verpflichtet sich</b>..</p><p>Anmeldung: <a href=\"https://de.surveymonkey.com/r/VXZH5VK\">https://de.surveymonkey.com/r/VXZH5VK</a></p><p>Da sich niemand so richtig gemeldet hat bis anhin, können wir auch wirklich noch nicht sagen wohin wir gehen werden. Da dies einfach sehr stark von der Anzahl Personen abhängt, respektive wo wir ein Haus finden.</p><p>Was wir sagen können:</p><ul><li><span><b>Samstag und Sonntag 11. und 12. März 2016</b></span></li><li><span>Favorisiert Graubünden weil schneller erreichbar und Innerschweiz im März etwas unsicher mit dem Schnee</span></li><li><span>Es wird irgendwo sein, wo man auch schlitteln kann.</span></li><li><span>Kosten werden von den Teilnehmern übernommen, ein kleiner Teil wird von Fordere bezahlt.</span><span> </span></li></ul><p>Anmeldungen nach dem 31. Dezember werden leider nicht berücksichtigt.</p><p>Wer sich morgens um halb 3 in einer Bar bei jemandem von uns anmeldet, sollte sich bitte am nächsten Tag doch noch via Link anmelden, da wir sonst evt. jemanden vergessen könnten..</p>',1,1),(103,85,'2017-01-13 14:15:11','18.01.2017 Poli Bar Masters',NULL,'<p></p><p>Das BarMasters startet mit dem Poli Masters in das Jahr 2017. Auf zwei Tischen kann um wichtige Punkte gekämpft werden :-)</p><p>Anmeldung: 19:00<br/><span style=\"font-size: 13px;\">Turnierbeginn: 19:30<br/></span><span style=\"font-size: 13px;\">Modus: CrazyDYP 2-Ball</span></p><p>Wie immer wenn wir ein CrazyDYP spielen können auch Spätankömmlige noch mittun. Wenn du vor 21:00 in der Poli-Bar eintriffst, können wir dich noch ins Turnier aufnehmen :-)</p>',1,1),(104,85,'2017-02-02 05:50:13','Strauss ist zurück',NULL,'<p>Jeii! Nach einer mehrjährigen Abwesenheit meldet sich das Strauss zurück. Ab sofort können jeden Tag zwischen 08:30 und 02:00 Spiele durchgeführt werden. Das Lokal befindet sich an der Kreuzung Milität/Langstrasse. Genauer gesagt hier: Langstrasse 132, 8004 Zürich</p>',1,1),(105,85,'2017-02-06 18:16:30','HALBZEIT! Party und Turnier am 10.02 in der Fambar',NULL,'<p>Am 10.02.2017 ist es bereits so weit. Wir haben die Halbzeit der Saison 2016/17 erreicht. Dies muss natürlich entsprechend gefeiert werden. Dafür treffen wir uns am Freitag, 10.02 in der Fambar zur diesjährigen Halbzeit-Party!</p><p>Turnierbeginn: 20:00<br/>Spätester Einsteigezeitpunkt: 21:15<br/>Modus: Crazy DYP La Règle</p><p>Natürlich könnt ihr auch an diesem Turnier wichtige Punkte für die Bar-Masters Rangliste sammeln.</p>',1,1),(106,85,'2017-03-15 12:31:33','Amboss Bar Masters 18. März',NULL,'<p>Am Samstag dem 18. März organisieren wir das 5. Bar-Masters der Saison. </p><p>Die Facts:<br/>Wo: Amboss Garage, Neugasse 14, Zürich<br/>Türöffnung: 19:30 Uhr<br/>Turnierbeginn: 20:30 Uhr<br/>Turniereintritt bis: 21:30 Uhr<br/>Modus: Crazy DYP Garage Style :-)<br/>Tische: 4 Garlando Deluxe</p><p>Wir freuen uns, euch alle in der Amboss Garage anzutreffen und natürlich dürft ihr auch alle eure Freunde, Bekannten, Familienmitglieder oder wer auch immer mitnehmen :-)</p><p><img src=\"https://fordere.ch/assets/images/flyer/ambossmasters.jpg\"/>?</p><p><br/></p><p><br/></p>',1,1),(107,85,'2017-03-29 16:17:14','1/2 April: Ullrich STS Turnier',NULL,'<p>Gemeinsam mit dem TFCZ organisieren wir am kommenden Wochenende (1./2. April) das erste Ullrich STS Turnier der Schweiz. </p><p>Alle Infos findest du unter <a href=\"https://fordere.ch/sts\" target=\"\">https://fordere.ch/sts</a></p>',1,1),(108,85,'2017-04-03 20:27:40','Coyote Bar Masters Do. 06.04.2017',NULL,'<p>Eure zweitletzte Chance um Punkte für die Finaltag-Qualifikation zu ergattern. <br/><br/>Turnierbeginn: 20:00<br/>Einsteigen bis: 20:30<br/>Turnierende ca 23:00<br/>Modus: Crazy DYP im Ligabonus-Modus. Es müssen jeweils soviele Tore geschossen werden wie das gegnerische Team zusammen in der Liga eingestuft ist. Gegen einen 3 und einen 2 Liga Spieler müssen entsprechend 6 Tore erzielt werden um zu gewinnen. Gegen zwei 1. Liga Spieler hingegen nur deren 2.<br/><br/>Natürlich dürfen wie immer auch nicht Liga-Spieler teilnehmen.<br/><br/><br/></p>',1,1),(109,85,'2017-05-01 10:11:01','Mi. 03.05.2017 Sansibar Masters',NULL,'<p>Letzte Chance Punkte für die Finaltag-Qualifikation zu ergattern. <br/><br/>Die Bar öffnet (extra für unser Turnier!) um 20:00<br/>Turnierbeginn 20:30<br/>Einsteigen möglich bis: 21:00<br/>Modus: Speedball CrazyDYP<br/><br/><br/></p>',1,1),(110,85,'2017-05-06 06:49:14','Finaltag 20. Mai',NULL,'<p>Die Vorbereitungen laufen auf Hochtouren. Hier die ersten Infos zum Finaltag:</p><p>Datum: 20. Mai<br/>Location: Dynamo<br/>Spielbeginn: 12:00</p><p>Weitere Infos folgen :-)</p>',1,1),(114,85,'2017-07-25 21:38:12','Die Anmeldung hat begonnen!!! Meldet euch an!!',NULL,'<p>Melde dich bis zum 25. November 2017 für die erste Luzerner Töggeli-Liga an. </p><p>Saisonstart ist am 04. Dezember 2017. Wir freuen uns auf euch!<br/></p>',1,3),(117,85,'2017-09-23 18:05:11','Anmeldephase gestartet!',NULL,'<p>Auf gehts! Ab jetzt kannst du dich für die Saison 2017/18 anmelden :)</p>',1,1),(118,85,'2017-10-04 17:26:01','Neue Bar: UG Dart Club Zürich',NULL,'<p>Wir freuen uns eine neue Bar bei fordere.ch begrüssen zu dürfen:</p><p>Ihr findet diese hier: Wyssgasse 6, 8004 Zürich</p><p>Die Spielzeiten sind wie folgt: </p><p>Mo: 17:30 - 23:30<br/>Di: 17:30 - 23:30<br/>Mi: 17:30 - 23:30<br/>Do: 17:30 - 23:30<br/>Fr: 17:30 - 23:30<br/>Sa: 17:30 - 23:00</p><p>Es stehen ein Ullrich und ein Garlando Deluxe zur Verfügung.</p><p>Achtung, der Eingang ist ein bisschen versteckt. Evtl. müsst ihr an der Klinge leuten :)</p><p><br/></p>',1,1),(119,85,'2017-10-11 09:19:19','Anmeldeschluss am 17.10.2017',NULL,'<p>Ihr habt nicht mehr lange Zeit! Melde dich jetzt für die Saison 17/18 an!</p>',1,1),(120,3095,'2017-10-18 15:36:42','Anmeldefrist verlängert bis am 24. Oktober.',NULL,'<p>Du hast noch bis am Dienstag, 24. Oktober Zeit um dein Team anzumelden.</p><p><br/></p>',1,1),(121,3095,'2017-10-25 08:33:33','Saison - Eröffnungsparty & Bar - Master No 1 am 11. November im TFCZ.',NULL,'<p><br/><!--StartFragment-->Endlich ist es soweit: Die Fordere - Saison 2017/18 startet am 11. <br/>November mit der Eröffnungsparty im TFCZ. Dazu gibts das erste <br/>Bar-Master-Turnier der Saison, schon fast traditionell ein <br/>Multi-Table-Crazy DYP. Gespielt wird auf sieben verschiedenen Tischen.<br/> Türöffnung: 19 00 Uhr<br/> Turnierbeginn: 20 00 Uhr, Einstieg möglich bis 21 30 Uhr.<!--EndFragment--><br/>TFCZ, Landbergstrasse 10, 8037 Zürich<br/><br/></p>',1,1),(122,3557,'2017-10-28 14:18:47','Anmeldephase St.Galler Töggeli-Liga hat begonnen!',NULL,'<p></p><p><span style=\"font-size: 13px;\">Das Wichtigste in Kürze:</span><br/></p><p><b>Anmeldeschluss: </b>12.12.2017</p><p><b>Saisonstart:</b> 15.12.2017</p><p></p>',1,2),(123,85,'2017-11-12 12:10:24','Saisonstart!',NULL,'<p><span style=\"font-size: 14px;float: none;\">Saisonstart! Jetzt! Ab heute köntn ihr über fordere.ch (</span><a href=\"https://fordere.ch/my-season\" target=\"_blank\" rel=\"noopener nofollow\" style=\"font-size: 14px;\">https://fordere.ch/my-season</a><span style=\"font-size: 14px;float: none;\">) eure Spiele abmachen. Total müssen 1629 Spiele durchgeführt werden. Am besten also jetzt schon in die Saison starten! Wir wünschen viele gute, spannende und faire Spiele </span><span class=\"_47e3 _5mfr\" title=\"„smile“-Emoticon\" style=\"vertical-align: middle;font-size: 14px;\"><img class=\"img\" height=\"16\" src=\"https://www.facebook.com/images/emoji.php/v9/f4c/1/16/1f642.png\" width=\"16\" alt=\"\" style=\"vertical-align: -3px;\"/><span class=\"_7oe\" style=\"font-size: 0px;width: 0px;\">:)</span></span><!--EndFragment--><br/><br/><br/></p>',1,1),(124,85,'2017-11-15 07:29:34','Zeitfehler',NULL,'<p>Wie einige bereits bemerkt haben, hat die Webseite momenten einen Fehler. Spiele werden zwei Stunden zu spät eingetragen. Wir arbeiten an einer Lösung. Solange bitte einfach den Tisch zwei Stunden früher reservieren, dann stimmt auch die reservierte Zeit. Bitte solange die Seite einmal nach dem Eintragen aktualisieren, um die Zeit zu kontrollieren!</p>',1,1),(125,3558,'2017-11-22 15:22:16','',NULL,'',1,3),(126,3557,'2017-11-25 11:52:12','Verlängerung der Anmeldephase',NULL,'<p style=\"font-size: 14px;vertical-align: baseline;text-align: left;\"><b style=\"font-size: inherit;vertical-align: baseline;\">neuer Anmeldeschluss: </b>12.12.2017</p><p style=\"font-size: 14px;vertical-align: baseline;text-align: left;\"><b style=\"font-size: inherit;vertical-align: baseline;\">neuer Saisonstart:</b> 15.12.2017</p>',1,2),(127,3558,'2017-12-01 09:41:58','Ligaeinteilung erfolgt',NULL,'<p><span style=\"font-size: 13pt;\"><b>38 Teams! 76 Fordere Spielerinnen und Spieler! 4 Ligen!</b></span></p><p><span style=\"font-size: 13pt;\">Es wird pro Liga ein Hin- und Rückspiel gespielt.<br/></span><span style=\"font-size: 13pt;\">Es darf bereits fleissig gefordert werden! Auf eine tolle erste Saison 17/18! :)</span></p>',1,3),(128,85,'2017-12-03 19:32:30','Coyote Bar am 5.12. geschlossen',NULL,'<p><span style=\"font-size: 14px;text-align: left;float: none;\">Nächsten Dienstag (5.12) bleibt die Coyote Bar geschlossen. Bitte keine Liga-Spiele abmachen!</span><!--EndFragment--><br/><br/><br/></p>',1,1),(129,3545,'2017-12-04 22:43:47','Poli Bar Masters am 6.12',NULL,'<p><span style=\"font-size: 14px;float: none;\">Wir freuen uns auf Deine Teilnahme am 2. Bar-Master:</span><br style=\"font-size: 14px;\"/><span style=\"font-size: 14px;float: none;\">Chlaus-Töggele in der Poli Bar. </span><br style=\"font-size: 14px;\"/><span style=\"font-size: 14px;float: none;\">Turnier Start: 19 30 Uhr</span><br style=\"font-size: 14px;\"/><span style=\"font-size: 14px;float: none;\">Spätest mögliche Teilnahme: 20 30 Uhr.</span><br style=\"font-size: 14px;\"/><span style=\"font-size: 14px;float: none;\">Modus: Voll auf die Mütze</span><!--EndFragment--><br/><br/><br/></p>',1,1),(130,85,'2017-12-21 15:17:00','STF-Lizenz - Jetzt melden!',NULL,'<p>Das Jahr 2017 ist bald vorbei und somit auch die Saison 17 vom STF. </p><p><br/>Wer im 2018 STF Turniere bestreiten möchte, der benötigt weiterhin eine Lizenz. <br/>Diese könnt ihr direkt über fordere zu einem verbilligten Preis (50.- anstatt 80.-) beziehen. <br/><br/>Wer interesse hat meldet sich direkt bei uns (<a href=\"https://fordere.ch/contact\" target=\"\">Kontaktformular</a>) mit folgenden Informationen<br/></p><ul><li>Name</li><li>Vorname</li><li>Email</li><li>Nationalität</li><li>Geburtsdatum</li><li>Geschlecht</li></ul><p>Gleichzeitig muss der Betrag von 50 CHF an unseren Verein überwiesen werden. Die nötigen Konto-Informationen findet ihr <a href=\"https://fordere.ch/verein\" target=\"\">HIER</a></p><p><b>Das erste STF-Turnier findet bereits am 6/7 Januar in Sempach statt.</b><br/><br/><br/></p>',1,1),(131,85,'2018-01-12 18:04:16','Fambar Masters 15. Januar',NULL,'<p><span style=\"font-size: 14px;float: none;\">Das dritte Bar-Masters findet am 15.Januar in der Fambar statt. Gespielt wird im Mode de Mirco: dies ist also die ideale Gelgenheit für alle Spieler aus den unteren Ligen die Erstligisten endlich mal so richtig vernichtend zu schlagen. </span></p><p><font color=\"#4b4f56\"></font></p><p><font color=\"#4b4f56\">Türöffnung: 19:00<br/>Turnierbeginn: 19:30<br/>Turniereintritt bis: 20:30</font></p><p><font color=\"#4b4f56\">Wir freuen uns auf viele Teilnehmer :)</font></p><p><br/></p><p></p>',1,1),(132,85,'2018-01-18 22:12:14','Halbzeit-Party neu am 09.02.18!',NULL,'<p>Da wir am Samstag dem 3. Februar alle am <a href=\"http://fordere.ch/reisli\" target=\"\">Fordere-Töggelireisli</a> unterwegs sind, verschieben wir die Halbzeit-Party um eine Woche! </p><p><b>Neuer Termin: 09.02.2018<br/>Ort: Coyote-Bar</b></p>',1,1),(133,3558,'2018-02-02 11:44:09','Am 25. Februar ist Halbzeit der Fordere Saison Luzern!',NULL,'<p><span style=\"font-size: 10pt;\">Bis dann sollte die Hälfte der Spiele gespielt sein, damit ihr bis zum Ende der Saison durchkommt. Das macht 9/18 Spiele in der 1.-3. Liga und 8/16 in der 4. Liga. Los geht\'s! </span></p>',1,3),(134,76,'2018-02-09 14:12:49','Halbzeitparty im Coyote am 9. Februar 18',NULL,'<p>Türöffnung um 19:30 Uhr Turnierstart um 20:00 Uhr Einstieg ins Turnier bis 21:00 Uhr möglich Kommt vorbei und feiert mit uns. Was zu knabbern gibts auch</p>',1,1),(135,85,'2018-02-22 17:37:04','Sansibar Masters am 7. März',NULL,'<p>Das Bar-Masters in der Sansibar geht in die zweite Runde. Wir freuen uns am Mittwoch, 7. März 2018 ein Bar-Masters-Turnier in der Sansibar durchführen zu dürfen.</p><p>Die Bar öffnet dazu extra wegen uns die Türen. </p><p>Türöffnung: 19:30<br/>Turnierbeginn: 20:00<br/>Letzte Anmeldung: 20:30</p><p>Modus: Crazy DYP al volo</p>',1,1),(136,3095,'2018-03-21 10:37:04','Termine für die letzten beiden Bar - Master',NULL,'<p>Freitag, 20 April: Amboss Garage</p><p>Dienstag, 8. Mai: St. Joseph Pub</p><p>Weitere Infos folgen.<br/></p><p><br/></p>',1,1),(137,85,'2018-04-17 15:36:54','Freitag 20.4 - Amboss Bar Masters',NULL,'<p>Diesen Freitag (20.4) findet in der Amboss Garage das zweitletzte Bar Masters statt.</p><p>Die wichtigsten Infos:<br/>Datum: Freitag, 20. April 2018<br/>Türöffnung: 19:00<br/>Turnierbeginn: 20:30<br/>Einsteigen bis: 21:30<br/>Modus: Garage Masters ;-)<br/>Location: Amboss Garage, Zollstrasse 80<br/>Tische: 4 Garlando Deluxe</p><p>Auch für das Catering (Bier-Teig-Pizzen.. mmmmmh) und Sound ist natürlich wieder gesorgt. </p><p>Wir freuen uns auf euch :-)</p>',1,1),(138,85,'2018-05-06 10:02:25','Di. 08.05: St. Joseph\'s Bar masters',NULL,'<p><span style=\"font-size: 14px;float: none;\">Am Dienstag, dem 8. Mai findet das letzte Bar-Masters der Saison im St. Joseph\'s Pub statt. </span><br style=\"font-size: 14px;\"/><br style=\"font-size: 14px;\"/><span style=\"font-size: 14px;float: none;\">Damit alle zum Spielen kommen, haben wir wieder einen zusätzlichen Tisch organisiert :)</span><br style=\"font-size: 14px;\"/><br style=\"font-size: 14px;\"/><span style=\"font-size: 14px;float: none;\">Turnier Start: 20:00 Uhr</span><br style=\"font-size: 14px;\"/><span style=\"font-size: 14px;float: none;\">Spätest mögliche Teilnahme: 20 30 Uhr.</span><br style=\"font-size: 14px;\"/><span style=\"font-size: 14px;float: none;\">Modus: Crazy Dyp Two Ball</span><!--EndFragment--><br/><br/><br/></p>',1,1),(139,3095,'2018-05-21 07:40:40','Gruppen - Zuteilungen für den Finaltag sind online.',NULL,'<p>Hier könnt Ihr sehen, gegen wen Ihr am Finaltag spielen müsst:</p><p><a href=\"https://fordere.ch/finaltag\" target=\"\">https://fordere.ch/finaltag</a></p><p>Erklärungen, warum ausgerechnet gegen diese Teams, findet Ihr in diversen Beiträgen der letzten Tage auf</p><p><a href=\"https://www.facebook.com/fordere/\" target=\"\">https://www.facebook.com/fordere/</a><br/></p><p>oder Ihr könnt die Erklärungen am Finaltag am Info-Brett nachlesen.<br/></p><p><br/></p>',1,1),(140,85,'2018-07-10 19:22:27','GV am 12.07.2018',NULL,'<p>Die Saison ist vorbei, es ist wieder Zeit für die jährliche Generalversammlung.<br/><br/><b>Datum: 12. Juli 2018<br/>Zeit: 19:30 Uhr<br/>Dauer: ca. 30min<br/>Ort: Fambar, Militärstrasse 84, 8004 Zürich</b><br/><br/>Jeder der sich mit dem Vereinswesen ein bisschen auskennt weiss, dass der Vorstand nur arbeiten kann, wenn er durch eine entscheidungsfähige GV auch bestätigt wird. <br/>Das heisst, ohne gültige GV gibt es keinen Vorstand, ohne Vorstand keinen Verein und ohne Verein keine Saison 2018/19! Wir brauchen jede Stimme, also auch deine!<br/><br/>Nach der GV werden wir für alle Anwesenden ein kleines Crazy-DYP organisieren.<br/></p>',1,1),(141,3642,'2018-08-29 14:19:59','Saison 2018/2019',NULL,'<p>Liebe Tischfussballfreunde</p><p>Das Anmeldefenster zur neuen Saison von Fordere SG öffnet sich bald. Wir freuen uns jetzt schon auf zahlreiche Anmeldungen, spannende Matches, massenhaft gelungene oder misslungene Tricks und tolle neue Bekanntschaften. Zudem sind wir stolz, dass wir im Hinblick auf die neue Saison neben TSS Goldach mit dem TFC St. Gallen einen weiteren Partner präsentieren können. </p><p>Wir werden in den nächsten Wochen über die genauen Daten zur Anmeldephase und die weiteren Eckdaten zur neuen Saison informieren. </p><p>Bis dahin freuen wir uns, Tischfussball-Freunde aller Stärkeklassen bei unseren Turnieren im Rahmen des FunFoosballTeam Tischfussball-Cups anzutreffen. Die Turnierdaten findet ihr unter <a href=\"http://www.funfoosballteam.ch\">www.funfoosballteam.ch</a>. </p><p>Mached en Trick<br/>Michael Sätteli<br/>FunFoosballTeam<br/></p>',1,2),(143,76,'2018-09-24 07:45:35','Anmeldung Saison 18/19 ist geöffnet',NULL,'<p>Ab sofort könnt ihr euch auf fordere.ch für die neue Saison anmelden!!!</p>',1,1),(144,3558,'2018-09-26 19:18:07','Anmeldung für die Luzerner Fordere Saison 18/19 öffnet bald!',NULL,'<p>Am Montag, 01. Oktober öffnet die Anmeldung für die kommende Luzerner Fordere Saison! Anmelden könnt ihr euch hier auf der Homepage.</p>',1,3),(145,3558,'2018-10-01 20:10:39','Anmeldefenster geöffnet bis zum 15. November 2018',NULL,'<p>Ihr könnt euch ab sofort bis zum 15. November auf unserer Homepage für die Fordere Luzern Saison 18/19 im Team anmelden. Häufige Fragen werden in den FAQs erklärt. Bei Unklarheiten steht euch der Vorstand gerne unter info.luzern@fordere.ch zur Verfügung.</p>',1,3),(146,3484,'2018-10-22 08:35:09','Anmeldephase Liga verlängert',NULL,'<p>Wir haben die Anmeldephase bis am 24.10.2018 um 23:59 Uhr verlängert.<br/>Verpasst nicht, euch bis dann anzumelden. Danach können keine Anmeldungen mehr entgegen genommen werden!</p>',1,1),(147,3095,'2018-10-28 21:13:36','Einteilung Saison 18 / 19 ist online',NULL,'<div>Das Modusteam hat die Teams in vier Garlando- und drei Ullrich Ligen eingeteilt. In welcher Liga und welcher Gruppe Ihr eingeteilt seid, seht Ihr hier:</div><p><br/></p><p><a href=\"https://fordere.ch/season/einteilung/22\" target=\"\">Garlando</a> (Für die angestrebte Plauschliga sind leider zuwenig Anmeldungen erfolgt)<br/></p><p><a href=\"https://fordere.ch/season/einteilung/23\" target=\"\">Ullrich</a> (3. Liga Ullrich spielt Hin- und Rückrunde, das heisst, gegen jedes Team zwei mal).</p><p><u>Wichtig:</u></p><p>Falls Ihr mit Eurer Einteilung überhaupt nicht einverstanden seid, habt Ihr bis Mittwoch, 31. Oktober die Möglichkeit Rekurs dagegen einzureichen und zwar schrfitlich an info@fordere.ch</p><p>Ab 3. November können Liga Spiele abgemacht werden. Wir freuen uns auf die neue Saison.<br/></p><p><br/></p>',1,1),(148,3095,'2018-10-31 17:08:52','Neue Regel: Anspieltore zählen. Neuer Modus: Bei 3 zu 0 ist das Spiel beendet.',NULL,'<p><br/></p><!--StartFragment--><div class=\"_5pbx userContent _3576\" id=\"js_s\"><p>Achtung, wir haben eine Regel- und eine Modus- Änderung:</p><p> Neue Regel:</p><p> Bei jeder Spielaufnahme (Anspiel, Out, Foul, Toter Ball) gilt:<br/><br/> Mit der Berührung durch die zweite Figur auf der gleichen Stange ist <br/>das Spiel frei. Die zweite Figur kann passer oder schiessen. <br/> Oder kurz: Anspiel-Tore zählen!</p><p><br/>Grund für die Änderung: Obwohl wir in den letzten Jahren versucht <br/>haben, die Anspiel-Regel durch zusätzliche Erläuterungen zu klären, ist <br/>es immer wieder zu teils heftigen Diskussionen darüber gekommen, ob das <br/>Tor zählt oder nicht (&#34;Hat der 3-er geschossen oder nur abgelenkt?&#34; &#34;Hat<br/> der Gegner den Ball berührt oder war es die Bande?&#34;). Die neue Regel <br/>bedeutet zwar eine ziemliche Umstellung, dafür aber weniger unklare <br/>Situationen und Diskussionen.</p><p> Neuer Modus:</p><p>Wir spielen neu ein Bo5, Bei 3 zu 0 wird der vierte Satz nicht gespielt. Bei 2:2 wird ein Entscheidungssatz auf 3 Tore gespielt.<br/></p><p>Es sind also folgende Resultate möglich: 3 zu 0 (3 Punkte für Sieger), 3 zu 1 (3 Punkte für <br/>Sieger), 3 zu 2 (Entscheidungssatz auf 3 Tore, 2 Punkte für Sieger, 1 <br/>Punkt für Verlierer).</p><p> Grund für die Änderung:<br/> Von 950 Garlando-Spielen wurden letzte Saison nahezu 400 4. Sätze gespielt, <br/>obwohl der Sieger bereits feststand. Da dieses Jahr mehr Teams <br/>teilnehmen, aber weniger Tische zur Verfügung stehen, erwarten wir dadurch eine <br/>Verkürzung der Spielzeit und kürzere Wartezeiten an Abenden, mit vielen <br/>Spielen am gleichen Tisch.</p><p> Sobald die neue Saison auf fordere.ch <br/>gestartet ist, könnt Ihr die kompletten Regeln nachlesen. Die FAQs sind <br/>ebenfalls Teil der Regeln und sind bereits jetzt online (Änderungen beim<br/>Resultat-Eintrag werden noch gemacht)</p></div><!--EndFragment--><p><br/></p><p><br/></p>',1,1),(149,3095,'2018-11-01 14:47:55','Neue Liga Zuteilung',NULL,'<p>Wir mussten diverse Teams in andere Ligen verschieben. Aus diesem Grund besteht die 3. Liga neu aus 4 Gruppen. Die neue Zuteilung siehst du hier:</p><p><a href=\"https://fordere.ch/season/einteilung/22\" target=\"\">Garlando - Zuteilung</a></p><p>Ab Wochenende können Spiele abgemacht werden. Die Liga - Coaches werden in den nächsten Tagen die Gruppen - Chats eröffnen.<br/></p><p><br/></p>',1,1),(150,85,'2018-11-02 10:12:41','Saisoneröffnung',NULL,'<p>Datum: Freitag, 2. November<br style=\"font-size: 12.8px;\"/>Ort: Amboss Garage, Zollstrasse 80, 8005 Zürich<br style=\"font-size: 12.8px;\"/>Türöffnung: 19:00 Uhr<br style=\"font-size: 12.8px;\"/>Turnierstart: 19:30 Uhr<br style=\"font-size: 12.8px;\"/>Turniereinstieg bis: 20:30 Uhr<br/></p>',1,1),(151,76,'2018-11-02 15:21:06','Die 16. Saison von fordere.ch startet',NULL,'<p>Jetzt können die Bändeli wieder angebracht werden, die Biere kühl gestellt werden und die Stangen geschmiert werden. Denn ab sofort können Spiele abgemacht werden. Wir freuen uns auf viele spannende und schweisstreibende Partien in unseren Partnerbars.</p><p>Der Vorstand wünscht Euch allen ganz viel Spass </p>',1,1),(152,3558,'2018-11-05 20:08:57','SAISONDATEN',NULL,'<p><b>Anmeldeschluss: 15.11.18  / Saisonstart: 01.12.18 / Halbzeitturnier: Februar 19 / Saisonende: 25.05.19 / Finalturnier: Juni 19 </b></p>',1,3),(153,3642,'2018-11-07 13:05:47','Anmeldefenster zur Saison 2018/2019 geöffnet',NULL,'<p style=\"font-size: small;\"><span style=\"font-size: 10pt;\"><font color=\"#000000\">Liebe Tischfussballfreunde</font></span></p><p><font color=\"#000000\" face=\"Times New Roman\" size=\"3\"></font></p><p style=\"font-size: small;\"><span style=\"font-size: 10pt;\">Das Anmeldefenster zur Saison 2018/2019 ist nun geöffnet. Meldet euch an und spielt um Ruhm und Ehre – feiert Meisterschaften und Aufstiege!</span><br/></p><p><font color=\"#000000\" face=\"Times New Roman\" size=\"3\"></font></p><p style=\"font-size: small;\"><span style=\"font-size: 10pt;\">Wir freuen uns euch mitteilen zu können, dass mit dem Bierhof St. Gallen und dem BBC Gossau zwei neue Partnerbars bei Fordere St. Gallen dabei sind.</span><br/></p><p><font color=\"#000000\" face=\"Times New Roman\" size=\"3\"></font></p><p style=\"font-size: small;\"><span style=\"font-size: 10pt;\">Im Hinblick auf die neue Saison werden wir einige Neuerungen einführen. So werden die Ligen eher klein (6-8 Teams) gehalten, damit es möglich ist gegen jeden Gegner ein Heim- und ein Auswärtsspiel zu spielen. Zudem wird es pro Liga einen Whatsapp-Chat geben, damit die Spiele einfacher abgemacht werden können. </span><br/></p><p><font color=\"#000000\" face=\"Times New Roman\" size=\"3\"></font></p><p style=\"font-size: small;\"><span style=\"font-size: 10pt;\">Unser Ziel ist, dass wir alle, die gern Tischfussball spielen an die Tische bringen. Jeder ist willkommen – unabhängig von Talent, Spielstärke oder Alter. Meldet euch gemeinsam mit euern Arbeitskollegen oder Töggeli-Kollegen an und spielt mit.</span><br/></p><p style=\"font-size: small;\"></p><p><b>Wichtige Termine</b><br/>Anmeldeschluss: 7. Dezember 2018<br/>Liga-Start: 14. Dezember 2018<br/>Halbzeit-Turnier: 24. Februar 2019 (Plausch-Turnier im Lutzifer-Pub)<br/>Saisonende: 14. April 2019 (bis zu diesem Datum müssen alle Spiele gespielt sein)<br/>Finalturnier: 28. April 2019 (Einzelanmeldung, spezieller Finaltag-Modus)</p><p><br/></p><p></p><p><font color=\"#000000\" face=\"Times New Roman\" size=\"3\"></font></p><p style=\"font-size: small;\"><font color=\"#000000\" style=\"font-size: 10pt;\">Bei Fragen erreicht ihr uns unter </font><a style=\"font-size: 10pt;\"><font color=\"#000000\">info.stgallen@fordere.ch</font></a><font color=\"#000000\" style=\"font-size: 10pt;\">.</font><br/></p><p><font color=\"#000000\" face=\"Times New Roman\" size=\"3\"></font></p><p style=\"font-size: small;\"><span style=\"font-size: 10pt;\">Wir freuen uns jetzt schon über zahlreiche Anmeldungen!</span><br/></p><p><font color=\"#000000\" face=\"Times New Roman\" size=\"3\"></font></p><p style=\"font-size: small;\"><span style=\"font-size: 10pt;\">Sportliche Grüsse<br/></span><span style=\"font-size: 10pt;\">Euer Fordere SG OK</span></p><p></p><!--EndFragment-->',1,2),(154,3558,'2018-11-08 22:20:36','FRAGEN ZU FORDERE?',NULL,'<div><p><br/></p><p><b><a href=\"https://fordere.ch/faq\" target=\"\">FAQs</a></b></p><p><a href=\"https://www.facebook.com/Fordereluzern/\" target=\"\"><b>Facebook</b></a></p><p><b>info.luzern@fordere.ch</b></p></div>',1,3),(155,3558,'2018-11-08 22:28:25','DER COUNTDOWN LÄUFT',NULL,'<p><span style=\"font-size: 13px;vertical-align: baseline;float: none;\">Ihr habt <b>NUR NOCH HEUTE</b></span><span style=\"font-size: 13px;vertical-align: baseline;float: none;\"> Zeit, um euch für die Töggeli-Bar-Liga Luzern anzumelden! Am 15. November endet die Anmeldefrist.</span><br/></p>',1,3),(156,3484,'2018-11-16 14:15:47','Termine Saison 2018/19 bekannt',NULL,'<p>Alle Termine der laufenden Saison sind nun bekannt!<br/>Darunter sind die Turniere der Bar Masters Serie, das fordere-Reisli, der Finaltag, usw.<br/>Diese findest du unter: <a href=\"https://fordere.ch/season/termine\" target=\"\">Saison 18/19 &gt; Termine</a><br/></p>',1,1),(157,3558,'2018-11-24 23:12:03','DIE ANMELDUNG IST GESCHLOSSEN - WEITERE INFOS FOLGEN BALD',NULL,'<p>Schon bald erfahrt ihr, in welche Liga ihr eingeteilt seid. Am 01. Dezember geht\'s los mit Fordere!</p>',1,3),(158,3484,'2018-11-25 22:03:36','Töggelireisli 5. Januar',NULL,'<p></p><p></p><p></p><p>Es ist wieder so weit! Nach dem letztjährigen Erfolg veranstalten wir erneut das beliebte Töggelireisli nach Bern.<br/><span style=\"font-size: 13px;\">Am grössten Tischfussball-Event der Schweiz sind alle herzliche willkommen – egal ob Anfänger oder Profi. Du kannst dich entweder im 2er oder 4er Team für ein Turnier anmelden.</span></p><p><span style=\"font-size: 13px;\">Zu unschlagbaren Preisen von 10.- bis 40.- CHF bist du mit dabei! Im Angebot inbegriffen sind:<br/></span></p><p></p><p>* Hin- und Rückreise mit der SBB<br/>* Teilnahmegebühr<br/>* Frühstück<br/>* Bändeli<br/>* Bier</p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p>Alle wichtigen Infos und die Anmeldung findest du unter <a href=\"https://fordere.ch/reisli\" target=\"\">fordere.ch/reisli</a></p><p></p><p></p><p></p>',1,1),(159,3558,'2018-11-26 21:08:43','',NULL,'<h4></h4><h6></h6><h2></h2><h3></h3><h5></h5><h4></h4><h5></h5><h4><b>Termine zum Vormerken:</b></h4><ul><li><span style=\"font-size: 14px;color: inherit;\"><b>25. Mai 2019: </b>Saison-Ende </span></li><li><b>15. Juni 2019: </b>Finaltag (wer gewinnt die jeweilige Liga?)</li></ul><p></p>',1,3),(160,3484,'2018-12-02 14:02:25','Poli Bar Masters 5. Dezember',NULL,'<p>Am 5. Dezember findet bereits das zweite fordere Bar Masters der Saison statt!<br/>Passend zum Samichlaus spielen wir den beliebten Crazy DYP &#34;Voll-auf-die-Mütze&#34; Modus.<br style=\"font-size: 14px;\"/><br style=\"font-size: 14px;\"/>* Türöffnung Poli Bar: 17:00 Uhr<br style=\"font-size: 14px;\"/>* Turnierbeginn: 19:30 Uhr<br style=\"font-size: 14px;\"/>* Turniereinstieg bis: 20:30 Uhr<br/></p>',1,1),(161,3642,'2018-12-16 23:18:12','Es geht looooooooooooooos! :) Infos zum Saisonstart...',NULL,'<p>Liebe Ostschweizer Töggeli-Freunde</p><p>Zum Saisonstart möchten wir euch noch mit den wichtigsten Infos zum Ablauf, Spielmodus etc. versorgen:</p><p><span style=\"font-size: 11pt;color: black;\"><b>Spielmodus<br/></b></span><span style=\"font-size: 13px;\">Ihr spielt gegen jeden Gegner ein Heim- und ein Auswärtsspiel. Das bedeutet in einer 6er-Gruppe tragt ihr mit 5 Gegnern je 2 Spiele aus. Wenn ihr Heim- und Auswärtsspiel gleich nacheinander spielt, hält sich der «Aufwand» im Rahmen, dann investiert ihr 5 Tischfussball-Abende in Fordere. Wo ihr die Spiele am Ende spielt, ist euch überlassen. Eure Liga-Einteilung seht ihr in euerem Profil hier auf der Fordere-Homepage.</span></p><p></p><p><span style=\"color: black;\"></span></p><p><span style=\"font-size: 12.0pt;\"></span></p><p><b><span style=\"color: black;\">Wichtig: Die Liga dauert bis zum 14. April 2019! Bis dann müssen alle Spiele absolviert sein! </span></b><span style=\"font-size: 12.0pt;\"></span></p><p><span style=\"font-size: 12.0pt;\"></span></p><p><span style=\"font-size: 11pt;color: black;\"><b>Regeln<br/></b></span><span style=\"color: black;font-size: 11pt;\"><span style=\"font-size: 13px;float: none;\">Die Regeln und weiterführende Infos zum Spielmodus findet ihr unter «Regeln &amp; Modus». Uns ist bewusst, dass gewisse Punkte für einige Spielerinnen und Spieler «gewöhnungsbedürftig» sind. 5er-Tore zählen und angespielt wird in der Mitte. Ihr könnt natürlich gemeinsam mit euren Gegnern abweichende Regeln definieren. Wir kontrollieren euch nicht ;). Wichtig ist uns, dass die definierten Regeln den Rahmen vorgeben – im Zweifelsfalle zählen diese. Und gerade beim «nicht zählen von 5er-Toren» gib es sehr schnell sehr viele «Zweifelsfälle». Es wäre schade, wenn es wegen sowas Diskussionen geben würde.</span></span></p><p><b><span style=\"color: black;\"></span></b></p><p><b><font color=\"#000000\">Spiele abmachen</font><span style=\"font-size: 16px;\"><br/></span></b><span style=\"color: black;\"><span style=\"font-size: 13px;float: none;\">Für die Organisation der Spiele seid ihr selbst verantwortlich. Ihr findet eine Übersicht über die geplanten Spiele in euerem Profil unter Saison 18/19 &gt; Meine Saison. Dort findet ihr auch die wichtigsten Infos über eure Gegner (Kontaktdaten, bevorzugter Spieltag etc.) – nehmt einfach Kontakt mit ihnen auf und macht euer Spiel ab. Das Datum tragt ihr anschliessend unter «Meine Saison» ein, so haben alle die Übersicht über die geplanten Spiele und es gibt keine Missverständnisse.<br/><br/>Damit die Kommunikation einfacher ist, erstellen wir ausserdem pro Liga einen Whatsapp-Chat. Da könnt ihr euch einfach und schnell mit euern Gegnern betreffend Spielterminen austauschen. Wichtig ist, dass ihr längere Abwesenheiten frühzeitig kommuniziert, damit ihr eure Matches mit euern Liga-Kolleginnen und Kollegen planen könnt. In den Chats könnt ihr bei Unklarheiten auch eure Fragen platzieren. Zu Beginn wird sicher das eine oder andere Thema auftauchen, aber wir versuchen euch da so gut und schnell wie möglich zu unterstützen.</span></span></p><p><span style=\"font-size: 12.0pt;\"></span></p><p><b><font color=\"#000000\">Resultate melden</font><span style=\"font-size: 16px;\"><br/></span></b><span id=\"selectionBoundary_1545002174509_6798250197335836\">&#65279;</span>Nach einem Spiel tragt ihr selber die Resultate auf der Fordere Homepage ein. Unter Saison 18/19 &gt; <a href=\"https://fordere.ch/my-season\">Meine Saison</a> könnt ihr zu jedem abgemachten Spiel die Resultate hinterlegen.   </p><p>Ausserdem findet ihr unter Saison 18/19 &gt; <a href=\"https://fordere.ch/leagues/25/standings\">Bar-foos-League SG</a> die aktuelle Tabelle und alle absolvierten Partien von euch und den anderen Fordere-Teilnehmern.<font color=\"#000000\"> </font><span style=\"font-size: 12.0pt;\"></span></p><p><span style=\"font-size: 12.0pt;\"></span></p><p><b><font color=\"#000000\">Was gibt es zu gewinnen?</font><span style=\"font-size: 16px;\">?<br/></span></b><span style=\"font-size: 13px;color: black;\">Wir suchen pro Liga natürlich die Meister. Wer zum Saisonende Rang 1 belegt, hat die Liga gewonnen! Das Siegerteam wird mit je einem Pokal ausgezeichnet. Zusätzlich gibt es nach Saisonende in jeder Liga eine kleine (geheime) Abstimmung: wir werden einen Fairplay- Award vergeben, um das fairste Team pro Liga zu ehren. Gebt euch also Mühe und seid nett zu euern Gegnern </span><span style=\"font-size: 13px;color: black;\">:)</span><span style=\"font-size: 13px;color: black;\">. Die Pokal- und Award-Übergaben erfolgen am Finalturnier (28.04.2019).</span></p><p><span style=\"font-size: 12.0pt;\"></span></p><p><b>Kontakt bei Fragen<br/></b>Wie schon erwähnt: meldet euch jederzeit, wenn ihr Fragen habt oder es Probleme gibt. Am einfachsten erreicht ihr uns per Mail <a href=\"mailto:info.stgallen@fordere.ch\">info.stgallen@fordere.ch</a> – oder ihr stellt eure Frage in den Liga-Whatsapp-Chat.</p><p>Beste Grüsse<br/><span style=\"font-size: 13px;\">Julia, Thomas, Michael<br/></span><span style=\"font-size: 13px;\">OK Fordere SG</span></p>',1,2),(162,3484,'2019-01-09 17:01:50','STF Jahreslizenz',NULL,'<p>Möchtest du dieses Jahr Turniere vom STF spielen? Dann kannst du als fordere Mitglied vergünstigt eine Jahreslizenz erwerben! Solltest du die Lizenz bereits am Eröffnungsturnier in Luzern benötigen, brauchen wir deine Angaben bis zum 20. Januar.<br/><a href=\"https://fordere.ch/verein/stf\" target=\"\">Lizenz jetzt beantragen!</a></p>',1,1),(163,3484,'2019-01-19 13:04:54','St. Joseph\'s Pub Masters 21. Januar',NULL,'<p>Am Montag, 21. Januar findet das nächste fordere Bar Masters der Saison statt!<br style=\"font-size: 13px;\"/>Gespielt wird im Crazy DYP &#34;La Règle&#34; Modus.<br style=\"font-size: 14px;\"/><br style=\"font-size: 14px;\"/>* Türöffnung St. Joseph\'s Pub: 16:00 Uhr<br style=\"font-size: 14px;\"/>* Turnierbeginn: 19:30 Uhr<br style=\"font-size: 14px;\"/>* Turniereinstieg bis: 20:30 Uhr<br/></p>',1,1),(166,3558,'2019-02-01 18:26:37','',NULL,'<h4><b>Plauschturnier zur Saison-Halbzeit im Crazy DYP-Modus</b></h4><ul><li><b>16. Februar 2019 / Haifish Bar Luzern </b></li></ul>',1,3),(167,3484,'2019-02-02 16:01:20','Halbzeitparty 8.02. – TFCZ Bar Masters',NULL,'<p>Am Freitag, 8. Februar feiern wir die Halbzeitparty mit einem nächsten Bar Masters im TFCZ!<br/></p><p>Gespielt wird im Crazy DYP &#34;Multitable&#34; Modus.<br style=\"font-size: 14px;\"/><br style=\"font-size: 14px;\"/>* Türöffnung 19:00 Uhr<br style=\"font-size: 14px;\"/>* Turnierbeginn: 19:30 Uhr<br style=\"font-size: 14px;\"/>* Turniereinstieg bis: 21:00 Uhr<br/><br/>Auf 6 verschiedenen Tischen kannst du dein Töggeli-Können unter Beweis stellen:<br/><br/>* Garlando Deluxe<br style=\"font-size: 14px;\"/>* Garlando World Champion<br style=\"font-size: 14px;\"/>* Ullrich<br style=\"font-size: 14px;\"/>* Tornado<br style=\"font-size: 14px;\"/>* Leonhart<br style=\"font-size: 14px;\"/>* Bonzini<br style=\"font-size: 14px;\"/><br style=\"font-size: 14px;\"/>Für eine kleine Verpflegung wird gesorgt, Getränke und Bier gibt\'s an der Bar.<br/>Komm vorbei und feier mit uns - see you there!</p>',1,1),(168,3484,'2019-02-07 18:39:14','Halbzeitparty heute (Freitag) im TFCZ!',NULL,'<p>Am Freitag, 8. Februar feiern wir die Halbzeitparty mit einem nächsten Bar Masters im TFCZ!<br/><br/>Gespielt wird im Crazy DYP &#34;Multitable&#34; Modus.<br/><br/>* Türöffnung 19:00 Uhr<br/>* Turnierbeginn: 19:30 Uhr<br/>* Turniereinstieg bis: 21:00 Uhr<br/><br/>Auf 6 verschiedenen Tischen kannst du dein Töggeli-Können unter Beweis stellen:<br/><br/>* Garlando Deluxe<br/>* Garlando World Champion<br/>* Ullrich<br/>* Tornado<br/>* Leonhart<br/>* Bonzini<br/><br/>Für eine kleine Verpflegung wird gesorgt, Getränke und Bier gibt\'s an der Bar.<br/>Komm vorbei und feier mit uns - see you there!<br/></p>',1,1),(171,3484,'2019-02-28 09:06:02','Reminder Ligaspiele',NULL,'<p>Bis kommenden Sonntag, 3. März muss jedes Team mindestens 8 Spiele ausgetragen oder abgemacht haben!</p><p>Sollten die Vorgaben nicht erfüllt sein und der zuständige Liga-Coach nicht kontaktiert werden, werden die betreffenden Teams ohne weitere Rücksprache von der laufenden Saison disqualfiziert!</p><p>Von insgesamt 1628 Spielen in dieser Saison wurden bis jetzt 825 Spiele ausgetragen.<br/><span style=\"font-size: 13px;\">-&gt; Um 803 Spiele durchzuführen, bleiben also nur noch 70 Tage!</span></p>',1,1),(172,3484,'2019-03-04 22:56:18','UG Bar Masters 6. März',NULL,'<p>Am Mittwoch, 6. März findet das erste Mal ein Bar Masters im UG Dart Club statt! Gespielt wird im Underground Crazy DYP &#34;Old School&#34; Modus.<br/><br/>* Türöffnung UGDC: 17:30 Uhr<br/>* Turnierbeginn: 19:30 Uhr<br/>* Turniereinstieg bis: 20:30 Uhr<br/><br/><span style=\"font-size: 13px;\">Auf 3 Garlando und 1 Ullrich kannst du nochmals Punkte sammeln, um dich für die Bar Masters Finalrunde zu qualifizieren!</span></p>',1,1),(173,3484,'2019-03-17 17:56:19','Rothaus – neue Partnerbar!',NULL,'<p>Mit Freude dürfen wir eine neue fordere-Partnerbar vorstellen:<br/>Das <strong>Rothaus</strong> an der Langstrasse stellt uns ab sofort einen Garlando Deluxe für Ligaspiele zur Verfügung!<br/></p><p class=\"alert alert-info\"><b>Öffnungszeiten:</b><br/>Di-Do: 17:00-00:00<br/>Fr: 17:00-04:00<br/>Sa: 20:00-04:00<br/><em>* Während der Öffnungszeiten können Ligaspiele abgemacht werden.</em><br/><br/><b>Adresse:</b><br/>Sihlhallenstrasse 1, 8004 Zürich<br/><br/><b>Weitere Infos:</b><br/>Für bessere Lichtverhältnisse während der Ligaspiele gibt es einen einstellbaren Lichtschalter oben links beim Tisch.<br/></p><p>All unsere Partnerbars findest du hier: <a href=\"https://fordere.ch/bars\"> fordere Partnerbars</a></p>',1,1),(174,3484,'2019-03-25 18:12:30','FamBar Masters 1. April',NULL,'<p>Am Montag, 1. April findet das nächste Bar Masters der Saison statt!<br style=\"font-size: 13px;\"/>Gespielt wird im Crazy DYP &#34;Ligabonus&#34; Modus.<br style=\"font-size: 13px;\"/><br style=\"font-size: 13px;\"/>* Türöffnung Fambar: 19:00 Uhr<br style=\"font-size: 13px;\"/>* Turnierbeginn: 19:30 Uhr<br style=\"font-size: 13px;\"/>* Turniereinstieg bis: 20:30 Uhr<br style=\"font-size: 13px;\"/><br style=\"font-size: 13px;\"/>Auf 3 Garlando können insbesondere Spieler der unteren Ligen nochmals ordentlich Punkte sammeln!<br/></p>',1,1),(175,3750,'2019-03-28 11:58:19','Anmeldung Finalturnier',NULL,'<p>Die Planungen für das Finalturnier laufen bereits und es wäre toll, wenn möglichst viele von euch dabei wären. Neben einer grossen Portion Tischfussball-Spass (Einzelanmeldung, Ligaübergreifend, immer wieder mit neuem Mitspieler) werden die Sieger der verschiedenen Fordere-Ligen ausgezeichnet. Zudem wird in jeder Liga ein Team mit dem Extrapokal „Fun &amp; Fairplay“ geehrt. <br/></p><p>Wir freuen uns jetzt schon auf einen tollen Tischfussball-Tag! <br/></p><p>Unter dem folgenden Link könnt ihr euch an- oder abmelden:  <br/><a href=\"https://www.funfoosballteam.ch/clubdesk/www?p=1000045\" target=\"\">https://www.funfoosballteam.ch/clubdesk/www?p=1000045</a><br/></p>',1,2),(176,3484,'2019-04-08 15:00:36','Maximal 4 offene Ligaspiele bis zum 21.04.',NULL,'<p style=\"font-size: 14px;\">Bis zum 21.04. darf jedes Team maximal 4 offene Spiele haben! Die restlichen Partien müssen ausgetragen oder <i><i><i>abgemacht</i></i></i> sein.</p><div class=\"text_exposed_show\" style=\"font-size: 14px;\"><p>Für Fragen steht euch euer zuständiger Ligacoach stets zur Verfügung.</p></div>',1,1),(177,3484,'2019-04-28 21:13:26','Saisonende 11. Mai!',NULL,'<p style=\"font-size: 14px;\"><em style=\"font-size: 13px;vertical-align: baseline;\"><i><b>Nur noch 2 Wochen bis Liga-Saisonschluss!<br/></b></i></em><span style=\"font-size: 14px;\">In der Fambar steht ein nigelnagelneuer Garlando und im Rothaus ein neuer Occasions Tisch für eure letzten Ligaspiele zur Verfügung! Also nichts wie los und ran an den Tisch!</span></p>',1,1),(178,3642,'2019-04-29 21:18:43','Ausgelassene Stimmung am Finaltag von Fordere SG',NULL,'<p class=\"MsoNoSpacing\">Liebe Tischfussballfreunde<br/> <!--[endif]--><span style=\"font-size: 12.0pt;\"></span></p><p class=\"MsoNoSpacing\"><span style=\"font-size: 10.0pt;\">Am vergangenen Sonntag wurde im Lutzifer-Pub in Arbon der Fordere Finaltag ausgetragen. Spielerinnen und Spieler aus den unterschiedlichsten Ligen traten gemeinsam mit den Mitgliedern des Tischfussballclub St. Gallens und des Plausch-Tischfussballvereins „FunFoosballTeam“ um den Turniersieg an.</span></p><h4><span style=\"font-size: 10.0pt;\"><b>Pascal holt sich den Tagessieg</b></span></h4><p class=\"MsoNoSpacing\"><span style=\"font-size: 10.0pt;\">Gespielt wurde im CrazyDYP- Modus. Dieser definiert sich dadurch, alle Teilnehmer in jeder Runde einen anderen Mitspieler erhalten. Nach 8 Vorrunden qualifizierten sich die Top 16 des 36 Spieler grossen Teilnehmerfeldes für die Finalrunde. In dieser wurde jeder Spieler in eine 4er-Gruppe eingeteilt. Jeder Spieler dieser Gruppe musste einmal mit jedem – und zweimal gegen jeden spielen. Für die Finalgruppe der Top 4 qualifizierten sich Patric, Pascal, Steven I. und Steven D. Pascal sicherte sich den Turniersieg mit 2 Siegen und einem Unentschieden und gewann nach dem Jahr 2017 erneut den grossen Wanderpokal.</span></p><h4><span style=\"font-size: 10.0pt;\"><b>Fordere Preisverleihung</b></span></h4><h4><span style=\"font-size: 10.0pt;\">Nach der Vorrunde fand die grosse Fordere-Preisverleihung statt. Neben den Liga-Siegern wurden auch die jeweiligen Gewinner der „Fun &amp; Fairplay“ Abstimmung ausgezeichnet. Besonders interessant und oft auch recht witzig waren natürlich die Begründungen, warum die jeweiligen Teams gewählt wurden.</span></h4><p class=\"MsoNoSpacing\"><span style=\"font-size: 10.0pt;\"></span></p><p><a href=\"https://www.facebook.com/forderesg\">https://www.facebook.com/forderesg</a></p><!--EndFragment--><h4><span style=\"font-size: 10.0pt;\"><b>Crowdfunding-Unterstützung Tischfusssball Nationalteam</b></span></h4><h4><span style=\"font-size: 10.0pt;\">Zu Turnierbeginn wurde kurz das Crowdfunding-Projekt des Nationalteams vorgestellt. Im „Sammel-Hut“ konnten dank der Unterstützung der Fordere-Community grossartige CHF 330 einbezahlt werden. Herzlichen Dank! Ihr seht die Einzahlung unter dem Projekt unter dem Namen „info.stgallen“ unter dem folgenden Link:</span></h4><p class=\"MsoNoSpacing\"><span style=\"font-size: 10.0pt;\"><span style=\"color: #3498db;\"><a href=\"https://www.ibelieveinyou.ch/ibiy-ch/src/#!/projectdetail/20642/world-cup-murcia-2019\" target=\"_blank\">https://www.ibelieveinyou.ch/ibiy-ch/src/#!/projectdetail/20642/world-cup-murcia-2019</a></span></span></p><h4><span style=\"font-size: 10.0pt;\"><b>Ausblick 2019/2020 / Auf &amp; Abstieg</b></span></h4><h4><span style=\"font-size: 10.0pt;\">Wir hoffen natürlich, dass alle Teams auch im kommenden Jahr wieder dabei sind – und vor allem, dass ihr all eure Kollegen, die gerne Tischfussball spielen motiviert, bei Fordere mitzumachen. Im ersten Jahr war die Liga-Einteilung extrem schwer. In Zukunft wird es nicht gerade einfach, aber aufgrund der bisherigen Resultate – und euren Wünschen – werden wir eine bessere Liga-Einteilung vornehmen können. Alle Liga-Sieger, die aufsteigen möchten, werden natürlich aufsteigen. Es ist aber auch noch unklar, wie gross die Ligen sind und wie die Liga-Strukturen genau aussehen werden. In der abgelaufenen Saison gab es eine 1. Liga und je drei 2. &amp; 3. Ligen.</span></h4><h4><span style=\"font-size: 10.0pt;\"><b>Geplante Optimierungen</b></span></h4><p class=\"MsoNoSpacing\"><span style=\"font-size: 10.0pt;\"><font color=\"#000000\">Wir hoffen, es hat euch Spass gemacht! Wenn ihr Verbesserungsvorschläge und/oder Kritikpunkte habt, sind wir froh, wenn ihr uns diese </font><font color=\"#000000\">mit auf den Weg gebt. Es ist uns bewusst, dass wir noch einiges verbessern können, wie beispielsweise den Zeitraum zu verlängern, Zwischenziele zu setzen oder besser zu kommunizieren etc. Schreibt uns gern eure Wünsche und Anregungen <font color=\"#000000\">in einem kurzen Mail an </font><a><font color=\"#000000\">info.stgallen@fordere.ch</font></a><font color=\"#000000\">  – oder persönlich oder im Liga-Whatsapp-Chat</font>.</font></span></p><p class=\"MsoNoSpacing\"><span style=\"font-size: 10pt;\">Euer Fordere SG OK<br/></span><span style=\"font-size: 10pt;\">Julia, Thomas, Michael</span><span style=\"font-size: 10pt;\"> <br/><br/></span></p><p class=\"MsoNoSpacing\"><span style=\"font-size: 10.0pt;\">PS: Wer Lust hat, im Fordere-OK mitzuarbeiten, darf sich natürlich auch gerne bei uns melden.</span></p><p class=\"MsoNoSpacing\"><span style=\"font-size: 10.0pt;\">*********************************************************************************************************</span></p><p class=\"MsoNoSpacing\"><span style=\"font-size: 10.0pt;\"><b>Liga-Gewinner im Überblick</b></span></p><!--StartFragment--><p class=\"MsoNoSpacing\" style=\"font-size: 13px;vertical-align: baseline;\"><span style=\"font-size: 10pt;vertical-align: baseline;\">*********************************************************************************************************</span></p><p class=\"MsoNoSpacing\"><span style=\"font-size: 10.0pt;\">1. Liga: Die Jähzis (Serge Lutz &amp; Kevin Kaufmann)</span></p><p class=\"MsoNoSpacing\"><span style=\"font-size: 10.0pt;\">2. Liga Gruppe 1: Luutzbuäbä (Thomas Hoffmann &amp; Stefan Gemperli)</span></p><p class=\"MsoNoSpacing\"><span style=\"font-size: 10.0pt;\">2. Liga Gruppe 2: Rayo (Javier Aviles &amp; Hami Minzanali)</span></p><p class=\"MsoNoSpacing\"><span style=\"font-size: 10.0pt;\">2. Liga Gruppe 3: Töggeligsichter (Toni Baumann &amp; Thomas Rusch)</span></p><p class=\"MsoNoSpacing\"><span style=\"font-size: 10.0pt;\">3. Liga Gruppe 1: Pläuschler (Stefan Ackermann &amp; Jonny Bleiker)</span></p><p class=\"MsoNoSpacing\"><span style=\"font-size: 10.0pt;\">3. Liga Gruppe 2: Manuel Schnellmann (Manuel Schnellmann &amp; Samuel Sarkis)</span></p><p class=\"MsoNoSpacing\"><span style=\"font-size: 10.0pt;\">3. Liga Gruppe 3: Sweethearts reloaded (Julia Hiess &amp; Evelyne Sutter)</span></p><!--StartFragment--><p class=\"MsoNoSpacing\" style=\"font-size: 13px;vertical-align: baseline;\"><span style=\"font-size: 10pt;vertical-align: baseline;\">*********************************************************************************************************</span></p><p class=\"MsoNoSpacing\"><span style=\"font-size: 10.0pt;\"><b>Fun &amp; Fairplay Sieger im Überblick</b></span></p><!--StartFragment--><p class=\"MsoNoSpacing\" style=\"font-size: 13px;vertical-align: baseline;\"><span style=\"font-size: 10pt;vertical-align: baseline;\">*********************************************************************************************************</span></p><p class=\"MsoNoSpacing\"><span style=\"font-size: 10.0pt;\">1. Liga: Die Schöne und das Biest (Nora Holickova &amp; Fauzi Itani)</span></p><p class=\"MsoNoSpacing\"><span style=\"font-size: 10.0pt;\">2. Liga Gruppe 1: Luutzbuäbä (Thomas Hoffmann &amp; Stefan Gemperli)</span></p><p class=\"MsoNoSpacing\"><span style=\"font-size: 10.0pt;\">2. Liga Gruppe 2: The Loosing Foxes (Samuel Thoma &amp; Bosko Bozic)</span><span style=\"font-size: 10.0pt;\"></span></p><p class=\"MsoNoSpacing\"><span style=\"font-size: 10.0pt;\">2. Liga Gruppe 3: Team Manu Manu (Manuel Dudli &amp; Manuel Bernhardsgrütter)</span><span style=\"font-size: 10.0pt;\"></span></p><p class=\"MsoNoSpacing\"><span style=\"font-size: 10.0pt;\">3. Liga Gruppe 1: Än momänt schnäll (Raffaela Riedener &amp; Michèle Bachmann)</span><span style=\"font-size: 10.0pt;\"></span></p><p class=\"MsoNoSpacing\"><span style=\"font-size: 10.0pt;\">3. Liga Gruppe 2: BS Kickers (Jonas Süess &amp; Jazy Feurer)</span><span style=\"font-size: 10.0pt;\"></span></p><p class=\"MsoNoSpacing\"><span style=\"font-size: 10.0pt;\">3. Liga Gruppe 3: Wurlitzer (Hampi Gmünder &amp; Roger Engler)</span></p><p><br/></p>',1,2),(179,3484,'2019-05-05 20:29:40','Samstag ist Saisonschluss!',NULL,'<p style=\"font-size: 14px;\"><em style=\"font-size: 13px;vertical-align: baseline;\"><i><i style=\"vertical-align: baseline;\"><b style=\"font-size: inherit;vertical-align: baseline;\">Am Samstag, 11.05. ist Saisonschluss!<br/></b></i></i></em><span style=\"font-size: 14px;\">Letzte Chance, um sich für den beliebten Finaltag im Dynamo zu qualifizieren! Noch sind 107 Spiele nicht ausgetragen und davon lediglich 39 abgemacht...</span></p>',1,1),(180,3858,'2019-05-10 08:36:41','fordere Winti bei Facebook!!',NULL,'<p>Bis wir alle Details für die ERSTE Bar-Foos-league in Winti aufgearbeitet haben, dauert es noch ein paar Bier. Bis dahin fleissig Facebook-Seite liken und teilen, fordere Winti dankt Dir! <a href=\"https://www.facebook.com/fordereWinti/ \" target=\"\">https://www.facebook.com/fordereWinti/ </a></p>',1,4),(181,3484,'2019-05-10 15:05:58','Rekurs-Deadline 12. Mai',NULL,'<p>Die Liga-Saison 2018/19 geht bereits wieder zu Ende. Bei allfälligen Konflikten in der Liga, habt ihr bis Sonntag, 12.05. Zeit, Rekurs <a href=\"mailto:info@fordere.ch\">per Mail</a> einzureichen.</p>',1,1),(182,3484,'2019-05-12 21:08:22','SansiBar Masters 15. Mai',NULL,'<p>Am Mittwoch, 15. Mai findet das nächste Bar Masters der Saison statt!</p><p>Gespielt wird im Crazy DYP &#34;Two Ball&#34; Modus.</p><ul><li>Türöffnung Sansibar: 19:00 Uhr</li><li>Turnierbeginn: 19:30 Uhr</li><li>Turniereinstieg bis: 20:30 Uhr</li></ul><p><span style=\"font-size: 13px;\">Auf 2 Garlando Deluxe gibt\'s die letzte Chance, um nochmals Punkte zu sammeln...</span></p>',1,1),(183,3484,'2019-05-28 12:26:48','Rückblick Saison und Finaltag 2018/19',NULL,'<p><em style=\"font-size: 13px;vertical-align: baseline;\"><i><i style=\"vertical-align: baseline;\"><b style=\"font-size: inherit;vertical-align: baseline;\">Herzlichen Dank<br/></b></i></i></em>Vergangenen Samstag durften wir mit euch gebührend den Abschluss der Saison 2018/19 feiern! Wir bedanken uns bei euch für eine tolle Saison mit etlichen spannenden Spielen und sind stolz darauf, so viele begeisterte TischfussballerInnen als Mitglieder zu haben!</p><p><em style=\"font-size: 13px;vertical-align: baseline;\"><i><i style=\"vertical-align: baseline;\"><i style=\"vertical-align: baseline;\"><b style=\"font-size: inherit;vertical-align: baseline;\">Resultate Finaltag<br/></b></i></i></i></em>Herzliche Gratulation allen Sieger-Teams zu ihrem Erfolg! Die <a href=\"https://zh.fordere.ch/season/25/finaltag\" target=\"\">Resultate vom Finaltag</a> findet ihr nach Saisonschluss jeweils in unserem <a href=\"https://zh.fordere.ch/archiv\" target=\"\">Archiv</a>.</p><p><span style=\"font-size: 13px;vertical-align: baseline;\"><i><i><i style=\"vertical-align: baseline;\"><i style=\"vertical-align: baseline;\"><i style=\"vertical-align: baseline;\"><b style=\"font-size: inherit;vertical-align: baseline;\"><i><i><em style=\"font-size: 13px;vertical-align: baseline;\"><i><i style=\"vertical-align: baseline;\"><i style=\"vertical-align: baseline;\"><i style=\"vertical-align: baseline;\"><b style=\"font-size: inherit;vertical-align: baseline;\">Feedback Saison und Finaltag</b></i></i></i></i></em><br/></i></i></b></i></i></i></i><span style=\"font-size: 13px;\">Wir würden uns über jegliche Art von Kritik (positiv und negativ) freuen, denn nur so können wir die Saison und den Finaltag weiterhin verbessern! Keine Sorge - ihr könnt auch nur einen bestimmten Teil ausfüllen, wir sind über jedes Feedback dankbar! Hier geht\'s zum <a href=\"https://forms.gle/M29HWmkp2j1vunFX8\" target=\"\">Formular</a>.</span></i></span></p><p><span style=\"font-size: 13px;vertical-align: baseline;\"><span style=\"font-size: 13px;\"><b><i><em style=\"font-size: 13px;vertical-align: baseline;\"><i><i style=\"vertical-align: baseline;\"><i style=\"vertical-align: baseline;\"><i style=\"vertical-align: baseline;\"><b style=\"font-size: inherit;vertical-align: baseline;\">Fotos Finaltag</b></i></i></i></i></em></i></b><br/></span></span><span style=\"font-size: 13px;\">Die Fotos werden wir euch so schnell wie möglich zur Verfügung stellen.</span></p>',1,1),(184,76,'2019-06-21 12:22:54','fordere am Openair Wipkingen 2019',NULL,'<p><span style=\"font-size: 14px;float: none;\">Auch dieses Jahr darf fordere wieder Teil des Openair Wipkingen sein</span><span style=\"font-size: 14px;float: none;\">! Wir freuen uns auf eine fabelhafte Atmosphäre, tolle Konzerte und ein paar gemütliche Töggelispiele! Also besucht unser Zelt am Freitag, 21. und Samstag 22. Juni 2019.</span><br/><br/><br/></p>',1,1),(185,3484,'2019-07-15 14:25:07','fordere GV 18. Juli',NULL,'<p></p><p>Diesen Donnerstag, 18. Juli findet die fordere GV 2019 in der Fambar statt. Damit die Liga kommende Saison stattfinden kann, brauchen wir deine Stimme! Anschliessend veranstalten wir für alle Teilnehmer ein Crazy DYP.</p><p class=\"alert alert-info\"><b>Infos Fordere GV:</b><br/>Datum: 18. Juli 2019<br/>Ort: Fambar, Militärstrasse 83<br/>Zeit: 19:30 Uhr<br/>Dauer: 30-60 Minuten<br/></p><p>Ausserdem veranstalten wir einen grossen Fordere-Artikel-Verkauf mit diversen Shirts aus alten und neuen Zeiten sowie den aktuellen Caps.<br style=\"font-size: 13px;\"/><br/></p><p></p><p></p>',1,1),(186,3484,'2019-07-23 11:28:16','Swiss Tablesoccer League',NULL,'<p>Auch dieses Jahr stellen wir von fordere Zürich wieder mehrere Teams auf für die Swiss Tablesoccer League (STL, ehemals Clubliga). Nicht verpassen – der Anmeldeschluss erfolgt bereits diesen Freitag, 26. Juli!</p><p>Die STL findet dieses Mal an einem Wochenende in Herrliberg (ZH) statt:<br/>* Offene Liga (19. &amp; 20. Oktober)<br/>* Damenliga (19. Oktober)</p><p>Anmeldung und Infos:<br/>* <a href=\"https://docs.google.com/forms/d/e/1FAIpQLSfZg0wzilpstjCDKD47RaJsHoZ4-Ank0b8jNH3x-Z2oSURqJw/viewform\" target=\"_blank\">Anmeldung über fordere</a><br/>* <a href=\"https://swisstablesoccer.ch/media/attachments/2019/06/28/ausschreibung-stl-2019_d.pdf\" target=\"_blank\">Offizielle Ausschreibung des STF</a><br/>* <a href=\"https://swisstablesoccer.ch/media/attachments/2019/06/28/reglement-stl-2019_d.pdf\" target=\"_blank\">Offizielles Reglement zur STL</a></p><p>Die Anmeldung erfolgt über <a href=\"https://docs.google.com/forms/d/e/1FAIpQLSfZg0wzilpstjCDKD47RaJsHoZ4-Ank0b8jNH3x-Z2oSURqJw/viewform\" target=\"_blank\">dieses Formular</a> und als Einzelperson, Teamwünsche werden wir natürlich so gut wie möglich berücksichtigen!</p>',1,1),(187,3484,'2019-07-30 16:03:10','Fordere am Äms Fäscht',NULL,'<p>Auch dieses Jahr darf fordere wieder Teil des <a href=\"https://www.aemsfaescht.ch\" target=\"_blank\" style=\"vertical-align: baseline;\">Äms Fäscht</a> am 1. August sein! Wir freuen uns auf eine fabelhafte Atmosphäre, tolle Konzerte und ein paar gemütliche Töggelispiele!</p><p>Zeitplan:<br/>* 12:00 Beginn Äms Fäscht<br/>* 15:00 Fordere Kids-Turnier (Crazy DYP)<br/>* 19:00 Fordere Hauptturnier (Crazy DYP)<br/></p><p>Bei beiden Turnieren nimmt man als Einzelperson teil, wobei Ein- und Aussteigen vom Turnier jederzeit möglich ist. Bitte jeweils kurz bei uns melden, solltet ihr nicht mehr mitspielen wollen, merci! =)<br/></p><p>Übrigens: Für die 3 bestplatzierten Spielerinnen und Spieler jedes Turniers warten tolle Preise!</p>',1,1),(188,3858,'2019-08-25 10:44:21','Partnerbars und Termine',NULL,'<p>oh yeah, die erste Saison der Bar-Foos-League in Winti kommt näher - hier das wichtigste in Kürze:</p><p><b>Partnerbars:</b> Albani, Couleur Bar, Widder, Türmli Bar<br/></p><p><b>Anmeldung:</b> ab sofort möglich</p><p><b>Vorspielen A:</b> am Montag 07.10.2019, 18.00 - 22.00 Uhr im Widder</p><p><b>Vorspielen B:</b> am Dienstag 22.10.2019, 18.00 - 22.00 Uhr in der Couleur Bar</p><p><b>Saisonstart:</b> ab Samstag 09.11.2019<br/></p><p><b>Eröffnungsparty mit Barmaster:</b> am Samstag Nachmittag 16.11.2019 im Albani</p><p><b>Halbzeitparty mit Barmaster:</b> am Samstag Abend 25.01.2020 in der Couleur Bar</p><p><b>Finaltag mit Barmaster:</b> im April/Mai 2020 im Salzhaus</p>',1,4),(189,3750,'2019-09-11 09:22:29','',NULL,'<p><b>Diese Termine könnt ihr euch bereits vormerken</b>: </p><p> - Anmeldeschluss: 23. November 2019</p><p> - Saisonbeginn: 1. Dezember 2019</p><p> - Saisonende: Mitte Mai 2020 <br/></p><p>Wir halten euch hier auf dem Laufenden, sowie auf <a href=\"https://www.facebook.com/forderesg/\" target=\"\">Facebook</a> und <a href=\"https://www.instagram.com/fordere.ch_st.gallen/\" target=\"\">Instagram</a> :)<br/></p><ul style=\"font-size: 14px;\"></ul>',1,2),(190,3545,'2019-09-15 07:28:22','Anmeldung für die Saisson 19/20 hat begonnen',NULL,'<p><span style=\"font-size: 13px;\"><b>Anmeldeschluss:</b> 29.11.2019</span><br/></p><p style=\"font-size: 13px;vertical-align: baseline;\"><b>Liga-Start: </b>Dezember 2019</p><p style=\"font-size: 13px;vertical-align: baseline;\"><b>Finale:</b> Mai/Juni 2020</p>',1,3),(191,85,'2019-09-30 19:45:53','Anmeldeschluss 2. Oktober',NULL,'<p>Melde dich jetzt über <a href=\"https://zh.fordere.ch/season/register\" target=\"\">diesen Link</a> an der Bar-Foos-League Saison 2019/2020 an. </p>',1,1),(192,85,'2019-10-04 06:11:56','Anmeldephase vorbei',NULL,'<p>Dieses Jahr haben sich 151 Teams in der Garlando und 48 Teams in der Ullrich LIga angemeldet. Wir arbeiten gerade an der Einteilung und freuen uns auf eine Saison mit vielen spannenden Spielen :-)</p>',1,1),(193,3858,'2019-10-15 07:30:13','Spielpartner*in gesucht??',NULL,'<p>Du willst mitmachen, aber hast keine*n Spielpartner*in? <br/></p><p>Sende uns per Mail oder auf Facebook deine Handynummer und wir vermitteln dir dein*e passende*r Spielpartner*in.</p>',1,4),(194,3484,'2019-10-15 11:57:01','Einteilung Liga und Einsprache',NULL,'<p><em style=\"font-size: 13px;vertical-align: baseline;\"><i><i style=\"vertical-align: baseline;\"><b style=\"font-size: inherit;vertical-align: baseline;\">Rekordteilnahmen:<br/></b></i></i></em>169 Garlando und 47 Ullrich Teams durfte das Modusteam gestern in die passende Liga einteilen - ein neuer <strong>Rekord</strong> in beiden Ligen!<br/></p><p><em style=\"font-size: 13px;vertical-align: baseline;\"><i><i style=\"vertical-align: baseline;\"><b style=\"font-size: inherit;vertical-align: baseline;\">Einteilung:<br/></b></i></i></em>Die Einteilung deines Teams und deine Liga-Gruppe findest du hier:<br/>* <a href=\"https://zh.fordere.ch/season/einteilung/28\" target=\"_blank\">Garlando</a><br/>* <a href=\"https://zh.fordere.ch/season/einteilung/29\" target=\"_blank\">Ullrich</a></p><p><em style=\"font-size: 13px;vertical-align: baseline;\"><i><i style=\"vertical-align: baseline;\"><b style=\"font-size: inherit;vertical-align: baseline;\">Einsprache Einteilung<br/></b></i></i></em>Einsprachen zur Einteilung nehmen wir bis zum 21.10. um 12:00 Uhr per <a href=\"mailto:info@fordere.ch\">per Mail</a> entgegen.</p>',1,1),(195,3750,'2019-10-17 08:11:52','Seid dabei, Anmeldephase läuft!',NULL,'<p></p><p style=\"font-size: 11.0pt;\" lang=\"de-CH\">Es ist wieder soweit: ihr könnt euch ab sofort für die neue Bar-Töggeli-Saison anmelden.<br/> Macht mit und spielt in eurer Lieblingsbar gegen Teams in eurer Stärkeklasse. Bei Fordere sind vom Anfänger bis zum Profi alle willkommen.</p><p style=\"font-size: 11.0pt;\" lang=\"de-CH\">Hier geht\'s direkt zum <a href=\"https://sg.fordere.ch/season/register/27\" target=\"\">Anmeldeformular</a>.</p><p style=\"font-size: 11.0pt;\" lang=\"de-CH\">Falls ihr noch unsicher seid, wie Fordere überhaupt abläuft, haben wir hier die wichtigsten Infos für euch:<br/></p><p style=\"font-size: 11.0pt;\" lang=\"de-CH\"><br/></p><p></p><h2><b></b>Wie läuft die Saison?<b><br/></b></h2><p><br/></p><p><b>Jeder gegen Jeden</b><br/>Euer Team wird abhängig von eurer Spielstärke in eine Liga eingeteilt. Da spielt ihr gegen ca. 6 andere Gegner je ein Heimspiel bei euch in der Heimbar und ein Auswärtsspiel bei euren Gegnern. Wenn ihr gleich beide Matches an einem Abend durchführt, kommt ihr sehr schnell voran. Eine Variante ist auch, dass man gleich mehrere Spiele an einem Abend in einer Bar austrägt. Das ist euch überlassen. <br/><br/><b>Spiele selbst abmachen - wann es euch am besten passt</b><br/>Um euch grösstmögliche Flexibilität zu geben, entscheidet ihr selbst, wann ihr eure Matches spielt. Die Termine macht ihr direkt mit euren Gegnern ab. <br/>Dafür eröffnen wir pro Liga einen Whatsapp-Chat, in dem ihr euch austauschen könnt. Auch laufende Fragen können da platziert werden. <br/><br/><b>Neue Regeln</b><br/>Wichtig ist uns, dass die Spiele auch tatsächlich gespielt werden. Dieses Jahr werden wir daher strenger sein, was die Anzahl der gespielten Spiele anbetrifft: bis zur Halbzeit im Februar solltet ihr die Hälfte aller Spiele gespielt oder zumindest in naher Zeit fix abgemacht haben. Sollte euch das nicht möglich sein, besprecht das bitte frühzeitig mit dem OK. Teams die zu wenig Spiele spielen und sich auch nicht mit den Coaches absprechen, müssen wir leider disqualifizieren.<br/>Die gesammelten und überarbeiteten Regeln findet ihr demnächst unter &#34;Saison 2019/20&#34;.<br/><br/><b>Töggelichampion!</b><br/>Bei Fordere steht der Spielspass absolut im Vordergrund. Zu gewinnen gibt es nur Ruhm, Ehre und einen Pokal für die Besten der jeweiligen Liga.<br/>Wir wünschen euch einfach eine gute Zeit mit alten Bekannten und neuen Freunden. Am Finaltag im Mai laden wir die Spieler aus allen Ligen zu einer grossen gemeinsamen Abschlussfeier ein, an dem nochmal gemeinsam getöggelt, die Preise verliehen und auf die Saison angestossen wird. Wir freuen uns schon jetzt drauf!<br/></p><p><br/></p><p></p><h2>Spielmodus<b><br/></b></h2><p><br/><b>Drei Sätze plus Entscheidungssatz</b><br/>Das Team, welches zuerst drei Sätze für sich entscheidet, gewinnt das Spiel. Bei Drei zu Null oder Drei zu Eins ist das Spiel beendet. Steht es nach vier Sätzen Zwei zu Zwei wird der &#34;Entscheidungssatz&#34; ausgetragen. Um den Entscheidungssatz zu gewinnen, genügen drei Tore! <br/>Somit sind folgende Ergebnisse möglich: 3:0, 3:1, 3:2, 2:3, 1:3, 0:3<br/><br/><b>Sechs Tore zum Satzgewinn, drei Tore im Entscheidungssatz</b><br/>Ein normaler  Satz ist bei beendet sobald ein Team sechs Tore erreicht hat. Es wird nicht auf zwei Tore Abstand gespielt. <br/>Entscheidungssatz: Der Satz ist bei beendet sobald ein Team drei Tore erreicht hat. Es wird nicht auf zwei Tore Abstand gespielt.<br/><br/><b>Punkteverteilung</b><br/>Für einen 3:0 oder 3:1 - Sieg nach Sätzen erhält die gewinnende Mannschaft drei Punkte. Für einen 3:2 Sieg nach Sätzen erhält die gewinnende Mannschaft zwei Punkte, die verlierende Mannschaft einen Punkt.<br/><br/><b>Tabelle </b><br/>Die Tabelle wird wie folgt berechnet:<span id=\"selectionBoundary_1564502474718_1214196119228862\" class=\"rangySelectionBoundary\"><br/></span></p><ol> <li>Anzahl Punkte</li><li>Satzverhältnis</li><li>Direktbegegnung</li></ol><p><br/></p><h2>Noch Fragen?<br/></h2><p>Weitere Infos findest du in den <a href=\"https://sg.fordere.ch/faq\" target=\"\">FAQ</a>, aber du kannst uns auch jederzeit eine <a href=\"mailto:sg@fordere.ch\" target=\"\">Mail schreiben</a>.<br/></p>',1,2),(196,3484,'2019-10-22 10:32:09','Eröffnungsparty 25.10. - TFCZ Bar Masters',NULL,'<p>Am Freitag, 25. Oktober starten wir in die neue Saison! Dies feiern wir mit der Eröffnungsparty und zugleich dem ersten Bar Masters der Saison 2019/20 im TFCZ!<br/></p><p><span id=\"selectionBoundary_1571740194668_24113909955501178\" class=\"rangySelectionBoundary\"></span>* Ort: TFCZ, Landenbergstrasse 10<br/>* Türöffnung 19:00 Uhr<br/>* Turnierbeginn: 19:30 Uhr<br/>* Turniereinstig bis: 21:00 Uhr<br/>* Modus: Crazy DYP Multitable<br/></p><p><br/>Auf 7 verschiedenen Töggelikästen kannst du dein Können unter Beweis stellen:</p><p>* Garlando Deluxe<br/>* Garlando World Champion<br/>* Ullrich<br/>* Tornado<br/>* Leonhart<br/>* Bonzini<br/>* Roberto</p><p>Wir offerieren euch zur Feier des Saisonbeginns einen kleinen Apéro, Getränke gibt\'s wie immer an der Bar.<br/>Komm vorbei und feier mit uns den Start in die neue Saison!</p>',1,1),(197,3858,'2019-10-25 08:28:00','Anmeldeschluss Sonntag 27.10.2019',NULL,'<p>Meldet euch noch bis Sonntag 27.10.2019 für die Liga an. Es hat noch ein paar Startplätze frei!<br/></p>',1,4),(198,3858,'2019-10-31 10:40:17','Anmeldung für Eröffnungsturnier im Albani',NULL,'<p><span style=\"font-size: 14.666666984558105px;float: none;\">Liebe Teams, meldet euch für das Eröffnungsturnier im Albani </span><b style=\"font-size: 14.666666984558105px;\">bis am 07.11. bei uns per Mail (Teamname und Spieler*innen) an!</b><span style=\"font-size: 14.666666984558105px;float: none;\"> Danach öffnen wir die Anmeldungsphase für weitere Teams, welche nicht in der Liga spielen. <br/></span></p><p></p><p>Das Turnier startet um 16.00 Uhr und dauert spät. bis 21.00 Uhr<br/></p><p><br/></p><p></p>',1,4),(199,3858,'2019-11-04 10:58:18','Anmeldung Eröffnungsturnier bis 07.11.',NULL,'<p><span style=\"font-size: 14.666666984558105px;float: none;\">Liebe Teams, meldet euch für das Eröffnungsturnier im Albani </span><b style=\"font-size: 14.666666984558105px;\">bis am 07.11. bei uns per Mail (Teamname und Spieler*innen) an!</b><span style=\"font-size: 14.666666984558105px;float: none;\"> Danach öffnen wir die Anmeldungsphase für weitere Teams, welche nicht in der Liga spielen. <br/></span></p><p>Das Turnier startet um 16.00 Uhr und dauert spät. bis 21.00 Uhr</p>',1,4),(200,3858,'2019-11-08 15:02:04','Saisoneröffnung im Albani - Anmeldung immernoch möglich',NULL,'<p>Es hat noch Plätze frei für das Töggeliturnier im Albani am 16.11.- meldet euch zu Zweit und mit Teamname per Mail an winti@fordere.ch an<br/></p>',1,4),(201,3750,'2019-11-11 14:58:14','Diese Woche: Feierabend-Bier',NULL,'<p>Seid ihr noch nicht sicher, ob ihr bei Fordere mitmachen wollt?<br/>Kommt doch bei den Feierabend-Bieren diese Woche vorbei:</p><p>- am Dienstag, 12.11. ab 18 Uhr im BBC in Gossau</p><p>- am Donnerstag, 14.11. ab 18 Uhr in der Krug Quartierbeiz in St. Gallen</p><p>Wir vom Fordere-OK sind vor Ort und beantworten gerne eure Fragen. Die Events sind ideal zum reinschnuppern und  - wer noch einen Teampartner sucht - zum neue Leute kennenlernen! <br/></p><p>Pssssst: Die ersten 10 Töggeler die &#34;fordern&#34;, laden wir ausserdem auf ein Getränk ein ;)<br/><br/>Event verpasst? Hier findet ihr die wichtigsten Informationen zur Liga:<br/>https://sg.fordere.ch/news/195<br/></p>',1,2),(202,3484,'2019-11-14 14:45:42','FamBar Masters 18. November',NULL,'<p>Am Montag, 18. November findet bereits das zweite Bar Masters der Saison statt!<br style=\"font-size: 13px;\"/>Gespielt wird im Crazy DYP &#34;Ligabonus&#34; Modus.<br style=\"font-size: 13px;\"/><br style=\"font-size: 13px;\"/>* Türöffnung Fambar: 19:00 Uhr<br style=\"font-size: 13px;\"/>* Turnierbeginn: 19:30 Uhr<br style=\"font-size: 13px;\"/>* Turniereinstieg bis: 20:30 Uhr<br/>* Modus: Crazy DYP Mirco Modus (Ligabonus)<br style=\"font-size: 13px;\"/><br style=\"font-size: 13px;\"/><span style=\"font-size: 13px;float: none;\">Auf 3 Garlando haben insbesondere Spieler der unteren Ligen die Chance, ordentlich zu punkten!</span><span style=\"font-size: 13px;float: none;\"></span></p>',1,1),(203,3484,'2019-11-28 15:11:12','Poli Bar Masters 4. Dezember',NULL,'<p><span style=\"font-size: 13px;float: none;\">Am Mittwoch, 4. Dezember findet das dritte Bar Masters der Saison statt!</span><br style=\"font-size: 13px;\"/><span style=\"font-size: 13px;float: none;\">Passend zum Samichlaus spielen wir den beliebten Crazy DYP &#34;Voll-auf-die-Mütze&#34; Modus.</span><br style=\"font-size: 14px;\"/><br style=\"font-size: 14px;\"/><span style=\"font-size: 13px;float: none;\">* Türöffnung Poli Bar: 17:00 Uhr</span><br style=\"font-size: 14px;\"/><span style=\"font-size: 13px;float: none;\">* Turnierbeginn: 19:30 Uhr</span><br style=\"font-size: 14px;\"/><span style=\"font-size: 13px;float: none;\">* Turniereinstieg bis: 20:30 Uhr</span><br style=\"font-size: 14px;\"/><span style=\"font-size: 13px;float: none;\">* Modus: Crazy DYP Voll-auf-die-Mütze</span></p>',1,1),(204,3750,'2019-12-01 08:55:13','Die Saison ist eröffnet!',NULL,'<p style=\"font-size: 11.0pt;\">Liebe Töggeli-Freunde <br/></p><p style=\"font-size: 11.0pt;\">Zum Saisonstart möchten wir euch noch mit den wichtigsten Infos zum Ablauf, Spielmodus etc. versorgen:</p><p style=\"font-size: 11.0pt;\"> </p><p style=\"font-size: 11.0pt;\"><b>Spielmodus</b></p><p style=\"font-size: 11.0pt;\">Ihr spielt gegen jeden Gegner ein Heim- und ein Auswärtsspiel. Das bedeutet in einer 6er-Gruppe tragt ihr mit 5 Gegnern je 2 Spiele aus. Wenn ihr Heim- und Auswärtsspiel gleich nacheinander spielt, hält sich der «Aufwand» im Rahmen, dann investiert ihr 5 Tischfussball-Abende in Fordere. Wo ihr die Spiele am Ende spielt, ist euch überlassen. Eure Liga-Einteilung seht ihr in der Saisonübersicht unter <a href=\"https://sg.fordere.ch/leagues/27/teams\">Teams</a>.</p><p style=\"font-size: 11.0pt;\"> </p><p style=\"font-size: 11.0pt;\"><b>Regeln</b></p><p style=\"font-size: 11.0pt;\">Die Regeln und weiterführende Infos zum Spielmodus findet ihr unter <a href=\"https://sg.fordere.ch/rules/27\">Regeln &amp; Modus</a>. Uns ist bewusst, dass gewisse Punkte für einige Spielerinnen und Spieler «gewöhnungsbedürftig» sind. 5er-Tore zählen und angespielt wird in der Mitte. </p><p style=\"font-size: 11.0pt;\">Ihr könnt natürlich gemeinsam mit euren Gegnern abweichende Regeln definieren. Wir kontrollieren euch nicht ;) Wichtig ist uns, dass die definierten Regeln den Rahmen vorgeben – im Zweifelsfall zählen diese. Und gerade beim «nicht zählen von 5er-Toren» gib es sehr schnell sehr viele «Zweifelsfälle». Es wäre schade, wenn es wegen sowas Diskussionen geben würde.</p><p style=\"font-size: 11.0pt;\">Achtung: diese Saison haben wir neu auch die Halbzeit-Regel eingeführt. Das bedeutet, dass ihr bis zur Halbzeit am 15. Februar die Hälfte der Spiele gespielt haben müsst!</p><p style=\"font-size: 11.0pt;\"> </p><p style=\"font-size: 11.0pt;\"><b>Spiele abmachen</b></p><p style=\"font-size: 11.0pt;\">Für die Organisation der Spiele seid ihr selbst verantwortlich. Ihr findet eine Übersicht über die geplanten Spiele in eurem Profil unter Saison 18/19 &gt; <a href=\"https://sg.fordere.ch/my-season\">Meine Saison</a>. Dort findet ihr auch die wichtigsten Infos über eure Gegner (Kontaktdaten, bevorzugter Spieltag etc.) – nehmt einfach Kontakt mit ihnen auf und macht euer Spiel ab. Das Datum tragt ihr anschliessend auch auf dieser Seite ein, so haben alle die Übersicht über die geplanten Spiele und es gibt keine Missverständnisse.</p><p style=\"font-size: 11.0pt;\"> </p><p style=\"font-size: 11.0pt;\">Damit die Kommunikation einfacher ist, erstellen wir ausserdem pro Liga einen Whatsapp-Chat. Da könnt ihr euch einfach und schnell mit euern Gegnern betreffend Spielterminen austauschen. Wichtig ist, dass ihr längere Abwesenheiten frühzeitig kommuniziert, damit ihr eure Matches mit euern Liga-Kolleginnen und Kollegen planen könnt. In den Chats könnt ihr bei Unklarheiten auch eure Fragen platzieren. Zu Beginn wird sicher das eine oder andere Thema auftauchen, aber wir versuchen euch da so gut und schnell wie möglich zu unterstützen.</p><p style=\"font-size: 11.0pt;\"> </p><p style=\"font-size: 11.0pt;\"><b>Resultate melden</b></p><p style=\"font-size: 11.0pt;\">&#65279;Nach einem Spiel tragt ihr selber die Resultate auf der Fordere Homepage ein. Unter Saison 18/19 &gt; <a href=\"https://sg.fordere.ch/my-season\">Meine Saison</a> könnt ihr zu jedem abgemachten Spiel die Resultate hinterlegen.   </p><p style=\"font-size: 11.0pt;\">Ausserdem findet ihr unter Saison 18/19 &gt; <a href=\"https://fordere.ch/leagues/25/standings\">Bar-foos-League SG</a> die aktuelle Tabelle und alle absolvierten Partien von euch und den anderen Fordere-Teilnehmern. </p><p style=\"font-size: 11.0pt;\"> </p><p style=\"font-size: 11.0pt;\"><b>Was gibt es zu gewinnen?</b></p><p style=\"font-size: 11.0pt;\">Wir suchen pro Liga natürlich die Meister. Wer zum Saisonende Rang 1 belegt, hat die Gruppe gewonnen! Das Siegerteam wird mit je einem Pokal ausgezeichnet. Zusätzlich gibt es nach Saisonende in jeder Liga eine kleine (geheime) Abstimmung: wir werden einen Fun-&amp;-Fairplay Award vergeben, um das sympathischste Team pro Liga zu ehren. Gebt euch also Mühe und seid nett zu euern Gegnern :) Die Pokal- und Award-Übergaben erfolgen während dem Finalturnier am 17. Mai 2020.</p><p style=\"font-size: 11.0pt;\"> </p><p style=\"font-size: 11.0pt;\"><b>Kontakt bei Fragen</b></p><p style=\"font-size: 11.0pt;\">Wie schon erwähnt: meldet euch jederzeit, wenn ihr Fragen habt oder es Probleme gibt. Am einfachsten erreicht ihr uns per Mail <a href=\"mailto:sg@fordere.ch\">sg@fordere.ch</a> – oder ihr stellt eure Frage in den Liga-Whatsapp-Chat.</p><p style=\"font-size: 11.0pt;\"> </p><p style=\"font-size: 11.0pt;\">Beste Grüsse</p><p style=\"font-size: 11.0pt;\">Julia, Thomas, Michael</p><p style=\"font-size: 11.0pt;\">OK Fordere SG</p>',1,2),(205,3545,'2019-12-01 20:03:03','Danke fürs mitmache :)',NULL,'<p>Insgesamt händ sich <b>36 Teams</b> für die neui Saisson <b>ahgmeldet</b>! <br/>De Vorstand bedankt sich bi allne fürs mitmache!! <br/>Mir freued eus uf d Saisson&#128588;&#127996;<br/></p>',1,3),(206,3545,'2019-12-03 18:13:47','Turnier Daten sind jetzt bekannt!',NULL,'<p style=\"font-size: 13px;vertical-align: baseline;\"><b style=\"font-size: 13px;vertical-align: baseline;\">Halbzeitparty: </b><span style=\"font-size: 13px;vertical-align: baseline;\">15. Februar 2020</span></p><p style=\"font-size: 13px;vertical-align: baseline;\"><b style=\"font-size: 13px;vertical-align: baseline;\">Finale:</b><span style=\"font-size: 13px;vertical-align: baseline;\"> 6. Juni 2020</span></p><!--EndFragment-->',1,3),(207,3750,'2020-01-02 13:41:20','Halbzeit-Reminder',NULL,'<p>...und schon ist es 2020! <br/></p><p>Im Februar ist schon Halbzeit angesagt, das heisst, bis dahin sollte die Hälfte aller Spiele gespielt sein. <br/></p><p>Also los geht\'s, ran an den Weihnachtsspeck und an die Töggelikästen!</p><p>Euch allen ein frohes neues Jahr :)<br/></p><p></p>',1,2),(208,3858,'2020-01-14 09:05:59','Halbzeitturnier - Couleur Bar - 25.01.2020',NULL,'<p>Melde dich jetzt als Einzelspieler*in unter winti@fordere.ch für das Halbzeitturnier an. Spiel im gewohnten Doppel - Alle sind willkommen - Start ca. 19.30 Uhr<br/></p>',1,4),(209,3484,'2020-01-18 15:15:58','STF Lizenz 2020',NULL,'<p>Möchtest du dieses Jahr Turniere vom STF spielen? Dann kannst du als fordere Mitglied vergünstigt eine Jahreslizenz erwerben! Solltest du die Lizenz bereits am Eröffnungsturnier in Luzern benötigen, brauchen wir deine Angaben bis zum 24. Januar.<br/><a href=\"https://forms.gle/ZjhYSMGkjRTdH7Be9\" target=\"\">Lizenz jetzt beantragen!</a></p>',1,1),(210,3484,'2020-02-04 15:27:08','Halbzeitparty 8.02. – Amboss Garage Masters',NULL,'<p>Am Samstag, 8. Februar feiern wir die Halbzeitparty mit einem nächsten Bar Masters in der Amboss Garage!<br/>Gespielt wird im Crazy DYP &#34;Crazy Garage&#34; Modus.</p><p>* Türöffnung 19:00 Uhr<br style=\"font-size: 14px;\"/>* Turnierbeginn: 19:30 Uhr<br style=\"font-size: 14px;\"/>* Turniereinstieg bis: 21:00 Uhr<br/><br/>Auf 5 Garalando Deluxe spielen wir im Crazy Garage Modus:</p><p>* Bei Anspiel am Anfang wird der Ball neutral in der Mitte eingeworfen<br/>* Der Entscheidungsball bei Gleichstand (bspw. bei 5:5) wird neutral in der Mitte eingeworfen<br/>* Anspiel ansonsten beim Verteidiger (welcher das letzte Tor kassiert hat)<br/>* Das Spiel ist ab der ersten Ballberührung freigegeben<br/>* 5er Tore zählen nicht (Abpraller &amp; Fotos zählen; Schüsse zählen nicht)<br/>* Snakeschüsse und Kurbeln ist nicht erlaubt (Figur darf sich nicht drehen)<br/>* Positionstausch ist jederzeit möglich<br/>* Keine Timeouts<br/>* Faire Ablenkung, Gerede und Trinken während des Spiels ist erlaubt</p><p>Wir freuen uns auf eine tolle Töggeliparty mit euch an einem weiteren legendären Amboss Garage Masters!<br/></p>',1,1),(211,3484,'2020-02-10 10:43:38','Sperrzeiten Sansibar: 11.-12.02. und 18.-19.02.',NULL,'<p>An folgenden Tagen können in der Sansibar <i>keine</i> Ligaspiele ausgetragen werden:</p><p>* Di 11.02.<br/>* Mi 12.02.<br/>* Di 18.02.<br/>* Mi 19.02.<br/></p><p>Wir danken für euer Verständnis.</p>',1,1),(212,3858,'2020-02-12 15:34:03','Finaltag am Sonntag 26. April 2020 im Salzhaus',NULL,NULL,1,4),(213,3484,'2020-02-24 17:39:36','Absage St. Joseph\'s Pub Masters',NULL,'<p>Leider kann das <i><b>St. Joseph\'s Pub Masters </b></i>diesen Mittwoch, 26. Feburar <b><i>nicht durchgeführt</i></b><i> werden!<br/></i></p><p><i></i></p><p>Wir bedauern dies sehr und werden versuchen, sofern möglich, einen Ersatztermin für das Bar Masters zu vereinbaren. Bitte teilt diese Nachricht euren Ligapartnern und Töggelikollegen mit.<br/></p><p>Wir danken für euer Verständnis.</p>',1,1),(214,3484,'2020-03-13 21:42:51','Massnahmen Coronavirus',NULL,'<p><b>Stellungnahme von Fordere zum neuen Coronavirus</b><br/>In den letzten Tagen haben auch wir die Entwicklungen rund ums SARS-CoV-2 und die Mitteilungen des Bundesamtes für Gesundheit (BAG) genauer verfolgt. Die Lage bleibt für uns alle jedoch weiterhin schwer einzuschätzen. Nach der heutigen <a href=\"http://https://www.admin.ch/gov/de/start/dokumentation/medienmitteilungen.msg-id-78437.html\" target=\"\">Medienmitteilung des Bundesrates</a> ist für uns klar, dass wir die Fordere Saison 2019/20 leider nicht wie geplant fortsetzen können.<br/><br/><b>Saison Unterbruch</b><br/>Die aktuelle Saison wird unterbrochen. Es können weiterhin freiwillig Spiele ausgemacht werden, diese Entscheidung ist jedoch jedem Spieler selbst überlassen. Es werden keine Erwartungen hinsichtlich Anzahl der Spiele gestellt, ungeachtet dessen, wieviele Spiele bereits ausgetragenwurden. Bei den Spielen verzichten wir fortan auf den Handschlag und geben stattdessen die Faust! Der Vorstand verfolgt die Situation weiterhin und entscheidet zu gegebener Zeit, ob und wie die Saison fortgeführt werden kann.<br/><br/><b>Durchführung Finaltag ungewiss</b><br/>Aufgrund der momentanen Lage ist es unklar, ob der Finaltag am 9. Mai stattfinden kann. Ebenfalls ungewiss ist, wie eine allfällige Qualifikation aussehen würde. Die Richtlinien hinsichtlich Qualifikation würden jedoch bezüglich Anzahl Mindestspiele etc. entsprechend angepasst werden.<br/><br/><b>Absage Sansi Bar Masters</b><br/>Leider sehen wir uns gezwungen, das Sansi Bar Masters kommenden Mittwoch, 18.03. abzusagen. Dieser Schritt ist notwendig, da die Vorgaben des BAG\'s sonst nicht erfüllt werden können. Wir bitten um euer Verständnis.<br/><br/><b>Allgemeine Verhaltensregeln</b><br/>Wir bitten euch beim Töggelen und besonders im jetzigen Ausnahmezustand um <u><i><b>regelmässiges Händewaschen</b></i></u>! Bitte aufs <u><b>Händeschütteln verzichten</b></u> und <u><b>stattdessen die Faust geben</b></u> (fist bump). <u><b>Husten und Niesen in die Armbeuge</b></u> gemäss <a href=\"https://www.bag.admin.ch/bag/de/home/krankheiten/ausbrueche-epidemien-pandemien/aktuelle-ausbrueche-epidemien/novel-cov/so-schuetzen-wir-uns.html\" target=\"\">Angaben des BAGs</a>! Wir wollen diejenigen unter uns mit geschwächtem Immunsystem schützen und sind euch dankbar, wenn ihr uns aktivdabei unterstützt!<br/><br/>Der Vorstand beobachtet aktuell die Situation weiterhin und wird über den weiteren Verlauf der Saison entsprechend informieren.<br/><br/>Wir danken für euer Verständnis und eure Mithilfe!<br/><br/>Liebe Grüsse<br/>Euer Fordere.ch-Vorstand</p>',1,1),(215,3545,'2020-03-14 10:36:11','Coronavirus',NULL,'<p>Trotz Corona Kriese dörf im Moment gforderet werde, haltet euch eifach ad Reglä vo de Partnerbars&#128517;<br/>Und wie immer giltet, schützet euri Kollege/inne und bliebet drum mit Hueschte/Fieber und Erkältung dahai. <br/><br/>P.s nähmet euri Bändeli mit, Zwecks Hygiene und statt es &#34;Begrüessigsfüstli&#34; machets mitem Elleboge;) <br/><br/>Übrigens Bändeli chönd ihr bi griffband.ch bstelle oder in TFCL go chaufe.<br/></p>',1,3);
