,'2016-05-24 20:25:10'),(63,'Fordere.DbMigration.Scripts.0063 - CascadeDeleteOnMatchesOnFinalDayCompetitionDelete.sql','2016-05-24 20:25:10'),(64,'Fordere.DbMigration.Scripts.0064 - ReplaceFinalDayTableNameWithNumber.sql','2016-06-02 22:46:32'),(65,'Fordere.DbMigration.Scripts.0065 - ReplaceFinalDayTableNameWithNumberInMatchView.sql','2016-06-02 22:46:32'),(66,'Fordere.DbMigration.Scripts.0065 - ReplaceFinalDayTableNameWithNumberInMatchView - Copy.sql','2016-11-12 14:05:23'),(67,'Fordere.DbMigration.Scripts.0066 - SeasonAmbition Type to TEXT.sql','2016-11-12 14:05:23'),(68,'Fordere.DbMigration.Scripts.0067 - Rename AssignedLeague into AssignedLeagueId.sql','2016-11-12 15:50:58'),(69,'Fordere.DbMigration.Scripts.0068 - Add EinteilungReady Enum to Season.sql','2016-11-12 15:50:58'),(70,'Fordere.DbMigration.Scripts.0069 - Add LeagueMatchCreationMode.sql','2017-01-15 11:43:19'),(71,'Fordere.DbMigration.Scripts.0070 - Add StandingsOrderToLeague.sql','2017-04-08 16:00:04'),(72,'Fordere.DbMigration.Scripts.0071 - AddDypAndCrazyDypCompetitionMode.sql','2017-04-08 16:11:14'),(73,'Fordere.DbMigration.Scripts.0072 - Add Division.sql','2017-05-09 06:08:24'),(74,'Fordere.DbMigration.Scripts.0073 - Dynamic Paymentinformations.sql','2017-08-23 17:26:15'),(75,'Fordere.DbMigration.Scripts.0074 - AddDatesToSeason.sql','2017-08-23 17:26:15');
