CREATE TABLE `season` (
  `Id` int(11) NOT NULL AUTO_INCREMENT,
  `Name` varchar(255) DEFAULT NULL,
  `State` enum('PrepareRegistration','Registration','PrepareSeason','Running','PrepareFinalDay','FinalDay','Archived','EinteilungReady') NOT NULL DEFAULT 'PrepareRegistration',
  `DivisionId` int(11) DEFAULT NULL,
  `Dates` text,
  `InfosFinalDay` text,
  `InfosPrepareSeason` text,
  `InfosEinteilung` text,
  PRIMARY KEY (`Id`),
  KEY `FK_Season_Division_idx` (`DivisionId`),
  CONSTRAINT `FK_Season_Division` FOREIGN KEY (`DivisionId`) REFERENCES `division` (`Id`)
) ENGINE=InnoDB AUTO_INCREMENT=31 DEFAULT CHARSET=latin1;
