INSERT INTO `season` VALUES (1,'Season #1','Archived',1,NULL,NULL,NULL,NULL),(2,'Season #2','Archived',1,NULL,NULL,NULL,NULL),(3,'Season #3','Archived',1,NULL,NULL,NULL,NULL),(4,'Season #4','Archived',1,NULL,NULL,NULL,NULL),(5,'Season #5','Archived',1,NULL,NULL,NULL,NULL),(6,'Season #6','Archived',1,NULL,NULL,NULL,NULL),(7,'Season #7','Archived',1,NULL,NULL,NULL,NULL),(8,'Season #8','Archived',1,NULL,NULL,NULL,NULL),(9,'Season #9','Archived',1,NULL,NULL,NULL,NULL),(10,'Season #10','Archived',1,NULL,NULL,NULL,NULL),(11,'Season #11','Archived',1,NULL,NULL,NULL,NULL),(12,'Season #12','Archived',1,NULL,NULL,NULL,NULL),(13,'Season #13','Archived',1,NULL,NULL,NULL,NULL),(14,'Season 2016/17','Archived',1,NULL,NULL,'<p>Vorbereitung</p>',NULL),(21,'Luzerner Töggeli-Liga 17/18','Archived',3,'<p><strong>Wichtiger Termin:</strong></p><p><strong>Jahresendturnier am <u>09. Juni 2018.</u></strong></p><p><strong><strong>Merkt euch dieses Datum, dann findet das grosse Endturnier von Fordere Luzern statt!</strong></strong></p><p><br/></p><p></p><p><br/></p>','<p><strong><img src=\"C:\\Users\\OLIVEIV3\\Desktop\\Privat\"/><br/></strong></p><p><strong>Der Finaltag steht vor der Tür! </strong><br/>Am kommenden Samstag, <strong>09. Juni 2018</strong> treffen wir uns, um die Podestplätze pro Liga auszumachen. Es wird sich entscheiden, wer die 1. Fordere Saison in Luzern gewinnt!<br/><br/><strong><u>Anmeldung:</u></strong><br/>Wer sich als Team noch nicht angemeldet hat, hat bis am Dienstagabend, 05.06.18 noch die Chance, dies via folgendem Link zu tun: <br/><a href=\"https://doodle.com/poll/d9q3m2pi97ys93wm\">https://doodle.com/poll/d9q3m2pi97ys93wm</a><br/><br/>Kann in einem Team <strong>ein Partner nicht teilnehmen, könnt ihr euch gerne bei uns melden,</strong> um die Möglichkeiten zu diskutieren. Bei einem Partnerwechsel müssen immer alle Ligamitglieder einverstanden sein.<br/><br/><strong><u>Hier die wichtigsten Infos zum Turnier:</u></strong><br/><strong>Datum: Samstag, 09. Juni 2018<br/>Ort: El Barrio, Lädelistrasse 6, Luzern<br/>Zeit: 13.00 Uhr, Finalspiele ab 17.30 Uhr</strong><br/><br/><strong><u>Wer darf am Finalturnier teilnehmen?</u></strong><br/>Alle Teams, die gemäss aktuellem Stand in der Tabelle mehr als 10 gewertete Spiele erreicht haben. Um die Tabelle anzusehen klicke hier.<br/>Jene Teams, welche diese Spielanzahl nicht erreicht haben dürfen am Finaltag leider nicht teilnehmen und wurden bereits kontaktiert. <br/><br/><strong><u>Modus:</u></strong><br/>Pro Liga gibt es am Finaltag eine Vorrunde. Wer diese übersteht, kommt in die KO-Phase und hat so die Möglichkeit, ins Final einzuziehen. Für die Podestplätze gibt es tolle Preise und Ehre zu gewinnen! Die Platzierung aus der Saison wird in die Wertung am Finaltag miteinbezogen. Mehr dazu erzählen wir euch am Turnier!<br/><br/><strong><u>Öffentliches DYP Plauschturnier am Abend:</u></strong><br/>Auch nach dem Turnier kann im El Barrio fleissig weiter getöggelet und gefeiert werden! Wir veranstalten ein DYP-Turnier (draw your partner) für alle, die es nicht in die Finalrunde geschafft haben. An diesem Turnier sind auch eure Freunde und Bekannten herzlich willkommen. Die Partner werden zugelost.<br/><strong>• Start: 18.00 Uhr<br/>• Anmeldeschluss direkt vor Ort: 17.00 Uhr</strong><br/><br/>Bei Fragen könnt ihr uns gerne via info.luzern@fordere.ch oder per WhatsApp kontaktieren.<br/><br/>Wir freuen uns auf euch!<br/>Euer Fordere Luzern – Vorstand<br/>Jorge, Michelle, Reto &amp; Vasco<br/></p>',NULL,NULL),(22,'Fordere SG - Season 2017/18','Archived',2,'<p>Anmeldeschluss: 12.12.2017</p><p>Ligastart: 15.12.2017</p><p>Finaltag: 29.04.2018</p><p>Saisonende: 31.05.2018 (Alle Spiele abgeschlossen)</p>',NULL,NULL,NULL),(23,'Saison 2017/18','Archived',1,'<p><strike><b>Anmeldeschluss: 17.10.2017</b><br/>Bis zu diesem Datum müsst ihr euer Team angemeldet haben. </strike></p><p><strike><b>Eröffnungsparty: 11.11.2017</b><br/>Endlich gehts los. Wir feiern die Saisoneröffnung mit einem Turnier und einer der Saison 2017/18 würdigen Party im TFCZ :)</strike></p><p><strike><b>Halbzeit: 09.02.2018</b><br/>Bist zu diesem Termin musst du mindestens füng Spiele absolviert haben! Ansonsten droht die disqualifikation.</strike></p><p><strike><b>Saisonschluss: 09.05.2018</b><br/>Aus und vorbei. Alle Spiele deren Resultat an diesem Termin noch nicht eingetragen ist, werden als &#34;nicht gespielt&#34; gewertet.</strike></p><p><b>Finaltag: 26.05.2018</b><br/>Die besten 75% aller Teams qualifizieren sich für den Finaltag. Welche Teams dürfen sich wohl dieses Jahr die Krone aufsetzen?</p>','<p><b>Wann und wo?<br/></b><span style=\"font-size: 13px;\">Der Finaltag findet am 26. Mai im Dynamo (Wasserwerkstrasse 21) statt. Vor Ort hat es keine Parkplätze, wir empfehlen zu Fuss, dem Velo oder dem ÖV anzureisen :)<br/>Türöffnung: 11:00</span></p><p></p><p><b>Spielbeginn<br/></b><span style=\"font-size: 13px;\">Wir bitten sämtliche Spieler/innen um 11:45 Uhr im Dynamo zu sein. Wir möchten das Turnier gerne pünktlich um 12:00 Uhr beginnen.</span></p><p><b>Modus<br/></b><span style=\"font-size: 13px;\">Vorrunde. Anschliessend Single - KO. Weitere Infos, folgen sobald der Spielplan erstellt werden kann<br/></span></p><p></p><p><b>SMS-Aufruf</b><br/>Wir werden sämtliche Spiele per SMS aufrufen (natürlich zusätzlich auch noch über den Lautsprecher...). Damit dies funktioniert sind wir darauf angewiesen,dass ihr hier auf fordere.ch eure Handynummer hinterlegt habt. Ihr könnt eure Nummer in eurem <a href=\"https://fordere.ch/profile\" target=\"\">Profil </a>(oben links) anpassen.</p><p></p><p><b><b>Crazy DYP<br/></b></b>Zwischen 17:30 Uhr Uhr und 18:00 Uhr starten wir das Crazy DYP Turnier.<b> </b>Jeder kann teilnehmen (sofern bereits aus dem Finaltag-Turnier ausgeschieden)<b><br/><br/></b></p><p><b></b><!--EndFragment--><br/><br/><br/></p>','<p>Falls du die Anmeldung verpasst hast - schreib uns doch kurz eine Mail. Meist finden wir noch ein Plätzchen für dich :-)</p>',NULL),(24,'Fordere SG - Season 2018/19','Archived',2,'<p>Die wichtigsten Termine zur neuen Fordere-Saison auf einen Blick: </p><ul><li>Anmeldeschluss 7.12.18</li><li>Saisonbeginn 17.12.18</li><li>Halbzeitturnier 03.03.19 im Lutzifer-Pub in Arbon (bis dann sollte die Hälfte eurer Spiele gespielt sein)</li><li>Saisonabschluss 14.04.19 (bis dann müssen alle Spiele gespielt sein)</li><li>Finalturnier 28.04.19 (alle Fordere-Teilnehmer sind eingeladen am Finalturnier im Lutzifer-Pub teilzunehmen)</li></ul>',NULL,NULL,NULL),(25,'Saison 18/19','Archived',1,'<p></p><p><i><i><i><i><i><i><i><span style=\"font-size: 13px;float: none;\">25.05.19 Finaltag im Dynamo<br/><br/><strike>21.10.18 </strike></span><strike>Anmeldeschluss</strike><br/><!--StartFragment--><i><i><strike><span style=\"font-size: 13px;float: none;\">02.11.18 </span>Eröffnungsparty - Amboss Bar Masters</strike></i></i></i></i></i></i></i></i></i><br/><span style=\"font-size: 13px;\"><strike>17.11.18 - 18.11.18 fordere @Clubliga</strike><br/><strike>05.12.18 Poli Bar Masters</strike><br/></span><span style=\"font-size: 13px;\"><strike>05.01.19 Töggelireisli nach Bern<br/></strike></span><span style=\"font-size: 13px;\"><strike>21.01.19 St. Joseph\'s Pub Masters</strike><br/></span><span style=\"font-size: 13px;\"><strike>08.02.19 Halbzeitparty - TFCZ Bar Masters</strike><br/><strike>23.02.19 - 24.02.19 Ullrich STS Zürich</strike><br/><strike>06.03.19 UG Dart Club Bar Masters<br/></strike></span><strike style=\"font-size: 13px;\"><i style=\"font-size: 13px;\"><i><i><i><i><i><i><span style=\"font-size: 13px;\">01.04.19 Fam Bar Masters</span></i></i></i></i></i></i></i></strike></p><p><strike style=\"font-size: 13px;\"><i style=\"font-size: 13px;\"><i><i><i>11.05.19 Saisonschluss</i></i></i></i></strike></p><p><strike style=\"font-size: 13px;\"><i style=\"font-size: 13px;\"><i><i><i>15.05.19 Sansi Bar Masters<br/></i></i></i></i></strike></p><p></p><p><span style=\"font-size: 13px;\"><strike><br/><br/></strike></span></p><p></p>','<h4><span style=\"font-size: 13px;float: none;\">Unabhängig davon ob qualifiziert oder nicht, bitten wir dich uns eine allfällige Absage per Mail mitzuteilen.</span><br/><br/></h4><h4>Wichtigste Infos</h4><p><!--StartFragment-->Datum: Samstag, 25. Mai<br/>Ort: Dynamo, Wasserwerkstrasse 21<br/>Türöffnung: 11:00 Uhr<br/>Registration: bis 11:45 Uhr<br/>Crazy DYP: ca 18:00 Uhr<br/>Ende: ca 22:00 Uhr</p><h4>Registration als Team bis 11:45 Uhr</h4><p>Alle Teams, die sich qualifiziert haben, müssen sich gemeinsam(!) bis spätestens 11:45 Uhr im Dynamo<br/>am Empfang registrieren. Ab 11:00 Uhr sind die Türen des Dynamos für euch geöffnet.<br/></p><h4>SMS Service / Spielaufnahme<br/></h4><p>Bitte trag deine Handynummer in deinem fordere <a href=\"https://zh.fordere.ch/profile\" target=\"\">Profil </a>ein. So erhältst du während des Finaltags<br/>die Spielaufrufe (inkl. Tischnummer und Gegner) per SMS.<br/>Bitte nehmt die Spiele immer umgehend auf, der Sieger meldet das Resultat unverzüglich der Turnierleitung.<br/>Dies ermöglicht es uns, einen Turnierablauf ohne Verzögerungen durchzuführen.<br/></p><h4>Modus Finaltag<br/></h4><p>Gespielt wird eine Vorrunde und anschliessend die Finalrunde im Single KO Modus.<br/>Für die Vorrundenspiele wird dein Team gemäss Saisonrangliste einer Gruppe zugeteilt.<br/>Für die Finalrunde qualifizieren sich die besten Teams der Vorrunde.<br/>Der genaue Modus und die Gruppen können erst am Finaltag selbst bekannt gegeben werden.<br/>Die provisorische Gruppeneinteilung verkünden wir jeweils auf unserer <a href=\"https://www.facebook.com/fordere/\" target=\"\">FB Page</a>.</p><h4>Crazy DYP<br/></h4><p>Ab ca. 18:00 Uhr starten wir ein Crazy DYP Turnier. Teilnehmen kann, wer nicht (mehr) in einem<br/>anderen Bewerb spielt und Spass am Töggelen hat.<br/></p><h4>Verpflegung<br/></h4><p>Während des ganzen Tages besteht die Möglichkeit, sich mit vielseitigem Essen und Getränken zu verpflegen.<br/>Es gibt Kuchen, Sandwiches, warme Küche (Thai-Kitchen ab ca 16:30 Uhr), diverse Softdrinks und Bier.<br/></p><h4>Kuchen / Helfer<br/></h4><p>Hast du Lust für den Finaltag einen Kuchen zu backen? Wir freuen uns über jegliche Art von Süssigkeiten! Oder<br/>möchtest du uns beim Auf-/Abbau oder während des Finaltags unterstützen? Dann schreib uns kurz eine Mail.<br/>Für alle Helfer gibt es natürlich auch ein kleines Dankeschön von uns!<br/></p><h4>Weiteres<br/></h4><p>Am Ende des Finaltags wären wir froh, wenn du uns beim Abbau unterstützen würdest.<br/>Wenn jeder kurz mit anpackt, sind wir ruck zuck fertig!<br/>Der Finaltag ist öffentlich – eure Freunde dürfen gerne vorbeischauen und am Crazy DYP teilnehmen.<br/>Für Fragen stehen wir euch wie immer gerne per Mail (info@fordere.ch) zur Verfügung.<!--EndFragment--><br/><br/><br/></p>',NULL,NULL),(26,'Luzerner Töggeli-Liga 18/19','Archived',3,'<h5><ul><li><b>Die nächste Saison kommt bestimmt! Weitere Infos folgen...</b></li></ul></h5>','<p><b>DIE</b><span style=\"font-size: 13px;\"><b> SAISON IST VORBEI - NEXT STOP: FINALTAG</b> &#127942;&#128588;&#127995;</span></p><p><br/>- Datum: Samstag, 15. Juni 2019 <br/>- Ort: El Barrio, Lädelistrasse 6, Luzern – gespielt wird draussen &amp; drinnen ?<br/>- Start für qualifizierte Teams: 14.00 Uhr<br/>- Verpflegung: vor Ort möglich<br/>- Plauschturnier am Abend (mehr Infos siehe unten) <br/><br/><b>Anmeldung </b><br/>Alle Teams, die qualifiziert sind und sich noch nicht an-/abgemeldet haben: bitte meldet euch bis spätestens am 05. Juni 2019 bei mir per PN. <br/>Kann in einem Team ein Partner nicht teilnehmen, meldet euch bitte ebenfalls beim Vorstand, um einen Partnerwechsel zu diskutieren.  <br/> <br/><b>Wer darf am Finalturnier teilnehmen?</b><br/>Alle Teams, die gemäss Endtabelle mehr als 10 gewertete Spiele erreicht haben und sich über dem Qualifikationsstrich befinden. Endtabelle: https://lu.fordere.ch/leagues/24/standings<br/><br/><b>Modus am Finaltag </b><br/>Pro Liga gibt es eine Vorrunde. Wer diese übersteht, kommt in die KO-Phase (Finalspiele ab ca. 19:00 Uhr). Für die Podestplätze gibt es tolle Preise und Ehre zu gewinnen! &#127942;<br/>Die Platzierung aus der Saison wird in die Wertungen am Finaltag miteinbezogen.<br/>Mehr dazu erzählen wir euch am Turnier! <br/><br/><b>Öffentliches DYP-Plauschturnier am Abend </b><br/>- Start: 18.00 Uhr (Anmeldung bis 17.30 Uhr)<br/>- Partner werden zugelost (draw your partner) auch eure Freunde und Bekannten sind beim Plauschturnier herzlich willkommen. <br/><br/>Wir freuen uns auf einen tollen Finaltag mit euch allen! &#128512;<br/></p>',NULL,NULL),(27,'Bar-foos-league Winti 19/20','Running',4,'<p><b>Eröffnungsturnier:</b> am Samstag 16.11.2019 ab 16.00 Uhr im Albani<br/></p><p><b>Halbzeitturnier:</b> am Samstag 25.01.2020 in der Couleur Bar</p><p><b>Finaltag:</b> am Sonntag 26. April 2020 im Salzhaus<br/></p><p></p>',NULL,NULL,NULL),(28,'Saison 2019/20','Running',2,'<p>Fordere St. Gallen geht in die dritte Runde!</p><p>Hier sind die wichtigsten Daten der Saison 2019/20:<br/></p><p> - <u>01. Dezember 2019</u>: Saisonstart (ab dann können Spiele abgemacht und gespielt werden)<br/></p><p> - <u>07. Dezember 2019</u>: Eröffnungsturnier (Rookies only) in Arbon<br/></p><p> - <u>09. Februar 2020</u>: Halbzeit mit Crazy-DYP-Turnier in Arbon - bis dahin muss die Hälfte der Spiele gespielt sein<br/></p><p> - <u>17. Mai 2020</u>: grosser Finaltag zum Saisonabschluss</p><ul></ul>',NULL,NULL,NULL),(29,'Saison 19/20','Running',1,'<ul><li><span style=\"font-size: 14px;\">26.02.20  St. Joseph\'s Pub Masters</span><br/></li><li><span style=\"font-size: 14px;\">18.03.20  </span><b>[*]</b><span style=\"font-size: 14px;\"> Sansi Bar Masters</span><br/></li><li><span style=\"font-size: 14px;\">15.04.20  UG Dart Club Masters</span><br/></li><li><span style=\"font-size: 14px;\">25.04.20  Saisonschluss</span><br/></li><li><span style=\"font-size: 14px;\">02.05.20 - 03.05.20  STS Ullrich</span><br/></li><li><b>09.05.20  Finaltag im Dynamo</b><br/><br/></li><li><strike>02.09.19  Anmeldebeginn</strike><br/></li><li><strike>02.10.19  Anmeldeschluss</strike><br/></li><li><strike>03.10.19  1. Vorspielen im TFCZ</strike><br/></li><li><strike>09.10.19  2. Vorspielen in der Fambar</strike><br/></li><li><strike>15.10.19  Veröffentlichung der Ligaeinteilung</strike><br/></li><li><strike>19.10.19 - 20.10.19  fordere @STL (Swiss Tablesoccer League)</strike></li><li><strike>21.10.19  Einsprache Liga-Einteilung [Deadline 12:00 Uhr]</strike></li><li><strike>25.10.19  Saison-Eröffnungsparty – TFCZ Bar Masters</strike></li><li><strike>18.11.19  Fam Bar Masters</strike></li><li><strike><span style=\"font-size: 14px;\">04.12.19  Poli Bar Masters</span><br/></strike></li><li><strike><span style=\"font-size: 14px;\">22.12.19  Anmeldeschluss Reisli</span><br/></strike></li><li><span style=\"font-size: 14px;\"><strike>04.01.20  fordere Reisli nach Bern</strike></span><br/></li><li><span style=\"font-size: 14px;\"><strike>08.02.20  Halbzeitparty – Amboss Bar Masters</strike></span><br/></li><!--EndFragment--><br/><br/><b style=\"font-size: 14px;vertical-align: baseline;\"><i style=\"font-size: inherit;vertical-align: baseline;\"><b style=\"font-size: 14px;vertical-align: baseline;\">[*]</b><span style=\"font-size: 14px;vertical-align: baseline;\"> -&gt; </span>in Planung, noch nicht bestätigt!</i></b><br/></ul>',NULL,'<p>Hast du die Anmeldephase verpasst? Melde dich am besten per Mail an info@fordere.ch. Wir können nichts garantieren, aber je nach Konstellation können wir eine verspätete Anmeldung noch berücksichtigen. </p>','<p>Übrigens, alle wichtigen und bereits bekannten Termine zur Saison findest du <a href=\"https://zh.fordere.ch/season/termine\" target=\"\">hier</a></p>'),(30,'Luzerner Töggeli-Liga 19/20','Running',3,'<p><b style=\"font-size: 13px;\">Halbzeitparty: </b><span style=\"font-size: 13px;\">15. Februar 2020</span></p><p><b style=\"font-size: 13px;\">Finale:</b><span style=\"font-size: 13px;\"> 6. Juni 2020</span></p><p></p>',NULL,NULL,NULL);
